INSERT INTO `atop_acronym` VALUES ('1', 'APD', 'Avalanche Photo Diode', '雪崩光电二极管', 'http://baike.baidu.com/view/204056.htm#2', '光探测领域中使用的光伏探测器元件。在以硅或锗为材料制成的光电二极管的P-N结上加上反向偏压后，射入的光被P-N结吸收后会形成光电流。加大反向偏压会产生“雪崩”（即光电流成倍地激增）的现象，因此这种二极管被称为“雪崩光电二极管”。', '2014-01-20 13:54:05', '1');
INSERT INTO `atop_acronym` VALUES ('2', 'PON', 'Passive Optical Network', '无源光网络', 'http://baike.baidu.com/view/739561.htm', ' PON是指（光配线网）中不含有任何电子器件及电子电源，ODN全部由光分路器（Splitter）等无源器件组成，不需要贵重的有源电子设备。一个无源光网络包括一个安装于中心控制站的光线路终端（OLT），以及一批配套的安装于用户场所的光网络单元（ONUs）。在OLT与ONU之间的光配线网（ODN）包含了光纤以及无源分光器或者耦合器。', '2014-01-20 13:56:02', '1');
INSERT INTO `atop_acronym` VALUES ('3', 'EPON', 'Ethernet Passive Optical Network', '以太网无源光网络', 'http://baike.baidu.com/view/60609.htm', 'EPON是一种新型的光纤接入网技术，它采用点到多点结构、无源光纤传输，在以太网之上提供多种业务。它在物理层采用了PON技术，在链路层使用以太网协议，利用PON的拓扑结构实现了以太网的接入。因此，它综合了PON技术和以太网技术的优点：低成本；高带宽；扩展性强，灵活快速的服务重组；与现有以太网的兼容性；方便的管理等等。', '2014-01-20 13:56:56', '1');
INSERT INTO `atop_acronym` VALUES ('4', 'PD', 'Photo Diode', '光电二极管', 'http://baike.baidu.com/view/615249.htm', '光电二极管和普通二极管一样，也是由一个PN结组成的半导体器件，也具有单方向导电特性。但在电路中它不是作整流元件，而是把光信号转换成电信号的光电传感器件。', '2014-01-20 13:57:47', '1');
INSERT INTO `atop_acronym` VALUES ('5', 'GEPON', 'Gigabit Ethernet Passive Optical Network', '千兆以太网无源光网络', 'http://network.chinabyte.com/259/9118259.shtml', '采用无源光网络(PON)的接入协议有以ATM为传输平台的APON/BPON，和以以太网技术为传输平台的EPON/GEPON，以及以通用帧结构为传输平台的GPON三种类型。EPON/GEPON是将以太网(Ethernet，最具有发展潜力的链路层协议)与无源光网络(PON，接入网的最佳物理层协议)结合在一起形成的能很好适应IP数据业务的接入方式。', '2014-01-20 14:10:33', '1');
INSERT INTO `atop_acronym` VALUES ('6', 'GPON', 'Gigabit-Capable Passive Optical Network', '千兆无源光网络', 'http://baike.baidu.com/view/1172234.htm', 'GPON(Gigabit-Capable PON) 技术是基于ITU-TG.984.x标准的最新一代宽带无源光综合接入标准，具有高带宽，高效率，大覆盖范围，用户接口丰富等众多优点，被大多数运营商视为实现接入网业务宽带化，综合化改造的理想技术。', '2014-01-20 14:13:48', '1');
INSERT INTO `atop_acronym` VALUES ('7', 'SDH', 'Synchronous Digital Hierarchy', '同步数字体系', 'http://zh.wikipedia.org/wiki/SDH', '同步数字体系，根据国际电信联盟远程通信标准化组（ ITU-T）的建议定义，是不同速度的数字信号的传输提供相应等级的信息结构，包括复用方法和映射方法，以及相关的同步方法组成的一个技术体制。', '2014-01-20 14:17:38', '1');
INSERT INTO `atop_acronym` VALUES ('8', 'GBE', 'Gigabit Ethernet', '千兆以太网', 'http://zh.wikipedia.org/wiki/Gigabit_Ethernet', '吉比特以太网，或译千兆以太网，是一个描述各种以吉比特每秒速率进行以太网帧传输技术的术语，由IEEE 802.3-2005标准定义。该标准允许通过集线器连接的半双工千兆连接，但是在市场上利用交换机的全双工连接才是标准。', '2014-01-20 14:22:24', '1');
INSERT INTO `atop_acronym` VALUES ('9', 'ONU', 'Optical Network Unit', '光网络单元', 'http://baike.baidu.com/view/22105.htm', 'ONU即光网络单元，分为有源光网络单元和无源光网络单元。一般把装有包括光接收机、上行光发射机、多个桥接放大器网络监控的设备叫做光节点。', '2014-01-20 14:26:07', '1');
INSERT INTO `atop_acronym` VALUES ('10', 'OLT', 'Optical Line Terminal', 'Optical Line Terminal', 'http://baike.baidu.com/view/835964.htm', '光线路终端，用于连接光纤干线的终端设备。', '2014-01-20 14:28:19', '1');
INSERT INTO `atop_acronym` VALUES ('11', 'GBIC', 'Gigabit Interface Converter', '千兆接口转换器', 'http://baike.baidu.com/view/430108.htm', 'GBIC是将千兆位电信号转换为光信号的接口器件，设计上可以为热插拔使用。', '2014-01-20 14:30:30', '1');
INSERT INTO `atop_acronym` VALUES ('12', 'SFP', 'Small Form Factor Pluggable Transceiver', '小封装可插拔收发器', 'http://zh.wikipedia.org/wiki/%E5%B0%8F%E5%B0%81%E8%A3%85%E5%8F%AF%E6%8F%92%E6%8B%94%E6%94%B6%E5%8F%91%E5%99%A8', 'SFP是一种小型的可热插拔的光学收发器，用于电信和数据通信中光通信应用。SFP联接网络设备如交换机、路由器等设备的主板和光纤或UTP线缆。SFP是一些光纤器件提供商支持的工业规格。SFP收发器支持SONET、Gigabit Ethernet、光纤通道（Fiber Channel）以及一些其他通信标准。此标准扩展到了SFP+，能支持10.0 Gbit/s传输速率，包括8 gigabit光纤通道和10GbE。引入了光纤和铜芯版本的SFP+模块版本，与模块的Xenpak、X2或XFP版本相比，SFP+模块将部分畨坴畬\0\0\0\0醼畨羉眝\0', '2014-01-20 14:35:07', '1');
INSERT INTO `atop_acronym` VALUES ('13', 'SFF', 'Small Form Factor', '小封装光模块', '', '', '2014-01-20 14:39:33', '1');
INSERT INTO `atop_acronym` VALUES ('14', 'XFP', '10 Gigabit Small Form Factor Pluggable', '万兆小封装可插拔光模块', 'http://en.wikipedia.org/wiki/XFP_transceiver', 'XFP是一种可热插拔的，独立于通信协议的光学收发器，通常工作波长是 850nm, 1310nm 或1550nm，用于10Gbps的SONET/SDH，光纤通道，gigabit Ethernet，10 gigabit Ethernet和其他应用中，也包括 DWDM 链路。XFP包含类似于 SFF-8472 的数字诊断模块，但是进行了扩展，提供了健壮的管理工具。XFI 电气接口规范是 XFP Multi Source Agreement 规范的一部分。XFP 由 XFP Multi Source Agreement Group 开发。', '2014-01-20 14:43:51', '1');
INSERT INTO `atop_acronym` VALUES ('15', 'APON', 'Asynchronous Transfer Mode Passive Optical Network', '异步传输模式无源光网络', 'http://baike.baidu.com/view/204059.htm', 'APON是ATM PON的简称。ATM是一种基于信元的传输协议，近年来，被越来越广泛地应用于接入网上以提供视频广播、远程教学、以及数据通信等多种业务。ATM技术能为接入网提供动态的带宽分配，从而更适合宽带数据业务的需要。', '2014-01-20 14:49:29', '1');
INSERT INTO `atop_acronym` VALUES ('16', 'ATM', 'Asynchronous Transfer Mode', '异步传输模式', 'http://baike.baidu.com/subview/26/5395796.htm', 'ATM是一项数据传输技术，是实现B-ISDN的业务的核心技术之一。ATM是以信元为基础的一种分组交换和复用技术，它是一种为了多种业务设计的通用的面向连接的传输模式。它适用于局域网和广域网，它具有高速数据传输率和支持许多种类型如声音、数据、传真、实时视频、CD质量音频和图像的通信。', '2014-01-20 14:52:11', '1');
INSERT INTO `atop_acronym` VALUES ('17', 'STM', 'Synchronous Transfer Mode', '同步传输模式', 'http://baike.baidu.com/view/56603.htm#4', '同步传输是一种以数据块为传输单位的数据传输方式，该方式下数据块与数据块之间的时间间隔是固定的，必须严格地规定它们的时间关系。每个数据块的头部和尾部都要附加一个特殊的字符或比特序列，标记一个数据块的开始和结束，一般还要附加一个校验序列，以便对数据块进行差错控制。', '2014-01-20 14:56:11', '1');
INSERT INTO `atop_acronym` VALUES ('18', 'ONT', 'Optical Network Termination', '光网络终端', '', '', '2014-01-20 14:59:21', '1');
INSERT INTO `atop_acronym` VALUES ('19', 'FTTH', 'Fiber To The Home', '光纤到户', 'http://baike.baidu.com/view/50653.htm', '光纤到户，顾名思义就是一根光纤直接到家庭。具体说，FTTH是指将光网络单元(ONU)安装在住家用户或企业用户处，是光接入系列中除FTTD（光纤到用户）外最靠近用户的光接入网应用类型。FTTH的显著技术特点是不但提供更大的带宽，而且增强了网络对数据格式、速率、波长和协议的透明性，放宽了对环境条件和供电等要求，简化了维护和安装。', '2014-01-20 15:01:27', '1');
INSERT INTO `atop_acronym` VALUES ('20', 'FTTx', 'Fiber To The x', '光纤到x', 'http://zh.wikipedia.org/wiki/FTTx', 'FTTx是“Fiber To The x”的缩写，意谓“光纤到x”，为各种光纤通讯网络的总称，其中x代表光纤线路的目的地。', '2014-01-20 15:03:51', '1');
INSERT INTO `atop_acronym` VALUES ('21', 'AOP', 'Average Optical Power ', '平均光功率', '', '', '2014-01-20 15:06:18', '1');
INSERT INTO `atop_acronym` VALUES ('22', 'ER', 'Extinction Ratio', '消光比', '', '对于数字脉冲光发射机，消光比这个指标很重要，它定义为全“0”时平均光功率p0和全“1”时平均光功率p1之比，可用EXT表示，定义式如EXT=10lg(p1/p0)(dB) ， 消光比的不足容易引起对码元的误判等一系列问题。', '2014-01-20 15:06:45', '1');
INSERT INTO `atop_acronym` VALUES ('23', 'SENS', 'Sensitivity', '灵敏度', '', '灵敏度，指光模块接收端能正确识别的最小光功率值。', '2014-01-20 15:09:26', '1');
INSERT INTO `atop_acronym` VALUES ('24', 'SD', 'Signal Detected', '信号检测', '', '', '2014-01-20 15:10:25', '1');
INSERT INTO `atop_acronym` VALUES ('25', 'SDA', 'Signal Detected Assert', '信号检测判决', '', '', '2014-01-20 15:11:17', '1');
INSERT INTO `atop_acronym` VALUES ('26', 'SDD', 'Signal Detected De-assert', '信号丢失判决', '', '', '2014-01-20 15:12:34', '1');
INSERT INTO `atop_acronym` VALUES ('27', 'LOS', 'Loss Of Signal  ', '信号丢失', '', '', '2014-01-20 15:13:00', '1');
INSERT INTO `atop_acronym` VALUES ('28', 'SMSR', 'Side Mode Suppression Ratio ', '边模抑制比', 'http://baike.baidu.com/view/4834685.htm', '边模抑制比定义为：在全调制的条件下主纵模的光功率M1和最大边模光功率M2之比。', '2014-01-20 15:14:32', '1');
INSERT INTO `atop_acronym` VALUES ('29', 'OSA', 'Optical Subassembly', '光组件', '', '', '2014-01-20 15:25:24', '1');
INSERT INTO `atop_acronym` VALUES ('30', 'TOSA', 'Transmitter Optical Subassembly', '光发射组件', '', '', '2014-01-20 15:26:25', '1');
INSERT INTO `atop_acronym` VALUES ('31', 'ROSA', 'Receiver Optical Subassembly', '光接收组件', '', '', '2014-01-20 15:26:49', '1');
INSERT INTO `atop_acronym` VALUES ('32', 'BOSA', 'Bidirectional Optical Subssembly', '单纤双向光组件', 'http://baike.baidu.com/view/4989524.htm', '', '2014-01-20 15:35:21', '1');
INSERT INTO `atop_acronym` VALUES ('33', 'SFP+', 'Enhanced Small Form Factor Pluggable', '小封装可热插拔增强版', 'http://en.wikipedia.org/wiki/Enhanced_small_form-factor_pluggable_transceiver#SFP.2B', '', '2014-01-20 15:40:54', '1');
INSERT INTO `atop_acronym` VALUES ('34', 'TIA', 'Transimpedence Amplifier', '跨阻放大器', '', '', '2014-01-20 15:49:38', '1');
INSERT INTO `atop_acronym` VALUES ('35', 'WDM', 'Wavelength Division Multiplexing', '波分复用', 'http://baike.baidu.com/view/165607.htm', '波分复用是将两种或多种不同波长的光载波信号（携带各种信息）在发送端经复用器(亦称合波器，Multiplexer)汇合在一起，并耦合到光线路的同一根光纤中进行传输的技术；在接收端，经解复用器(亦称分波器或称去复用器，Demultiplexer)将各种波长的光载波分离，然后由光接收机作进一步处理以恢复原信号。这种在同一根光纤中同时传输两个或众多不同波长光信号的技术，称为波分复用。', '2014-01-20 15:51:07', '1');
INSERT INTO `atop_acronym` VALUES ('36', 'CWDM', 'Coarse Wavelength Division Multiplexing', '粗波分复用', 'http://baike.baidu.com/view/1064627.htm', 'CWDM是一种面向城域网接入层的低成本WDM传输技术。从原理上讲，CWDM就是利用光复用器将不同波长的光信号复用至单根光纤进行传输，在链路的接收端，借助光解复用器将光纤中的混合信号分解为不同波长的信号，连接到相应的接收设备。', '2014-01-20 15:53:00', '1');
INSERT INTO `atop_acronym` VALUES ('37', 'DWDM', 'Dense Wavelength Division Multiplexing', '密集波分复用', 'http://baike.baidu.com/view/3871678.htm', '密集波分复用（Dense Wavelength Division Multiplexing）技术，也就是人们常说的DWDM，指的是一种光纤数据传输技术，这一技术利用激光的波长按照比特位并行传输或者字符串行传输方式在光纤内传送数据。 DWDM是光纤网络的重要组成部分，它可以让IP协议、ATM和同步光纤网络/同步数字序列（SONET/SDH）协议下承载的电子邮件、视频、多媒体、数据和语音等数据都通过统一的光纤层传输。', '2014-01-20 15:54:36', '1');
INSERT INTO `atop_acronym` VALUES ('38', 'EVB', 'Evaluation Board', '评估板', '', '', '2014-01-20 16:01:53', '1');
INSERT INTO `atop_acronym` VALUES ('39', 'PM', 'Power Meter', '光功率计', '', '', '2014-01-20 16:02:35', '1');
INSERT INTO `atop_acronym` VALUES ('40', 'ATT', 'Attenuator', '光衰减器', '', '', '2014-01-20 16:04:07', '1');
INSERT INTO `atop_acronym` VALUES ('41', 'DCA', 'Digital Communication Analyser', '数字通讯分析仪', '', '', '2014-01-20 16:08:20', '1');
INSERT INTO `atop_acronym` VALUES ('42', 'BERT', 'Bit Error Rate Tester', '误码测试仪', '', '', '2014-01-20 16:10:31', '1');
INSERT INTO `atop_acronym` VALUES ('43', 'QSFP', 'Quad Small Form-factor Pluggable', '四通道SFP接口', 'http://baike.baidu.com/view/3144180.htm', 'QSFP（Quad Small Form-factor Pluggable）：四通道SFP接口(QSFP)，QSFP是为了满足市场对更高密度的高速可插拔解决方案的需求而诞生的。这种4通道的可插拔接口传输速率达到了40Gbps。很多XFP中成熟的关键技术都应用到了该设计中。', '2014-01-20 16:39:48', '1');
INSERT INTO `atop_acronym` VALUES ('44', 'VBR', 'Avalanche Breakdown Voltage', '雪崩击穿电压', '', '', '2014-01-20 16:47:37', '1');
INSERT INTO `atop_acronym` VALUES ('45', 'ODN', 'Optical Distribution Node', '光分配节点', 'http://baike.baidu.com/view/1170386.htm', 'ODN是基于PON设备的FTTH光缆网络。其作用是为OLT和ONU之间提供光传输通道。从功能上分，ODN从局端到用户端可分为馈线光缆子系统，配线光缆子系统，入户线光缆子系统和光纤终端子系统四个部分。在电子工业出版社的《计算机网络》教材第四版上10.6.2章节中，ODN理解为Optical Distribution Node，即光分配节点。指的是HFC（Hybrid Fiber Coax,光纤同轴混合网）中模拟光纤的光纤节点，用于连接模拟光纤。', '2014-01-20 16:52:33', '1');
INSERT INTO `atop_acronym` VALUES ('46', 'LR', 'Long Reach', '长距', '', '', '2014-01-20 16:55:22', '1');
INSERT INTO `atop_acronym` VALUES ('47', 'SR', 'Short Reach', '短距', '', '', '2014-01-20 16:55:46', '1');
INSERT INTO `atop_acronym` VALUES ('48', 'PRBS', 'Pseudo Random Binary Sequence', '伪随机二进制序列', 'http://www.360doc.com/content/11/1101/15/8015435_160820339.shtml', 'PRBS码具有“随机”特性，是因为在码流中，二进制数是随机出现的，但是它又和真正意义上的随机码不同，这种“随机”特性只是局部的，即在周期内部，“0”和“1”是随机出现的(码流生成函数与初始码确定后，码流的顺序也是固定的)，但各个周期中的码流却是完全相同的，所以我们称其为伪随机码。', '2014-01-20 17:05:16', '1');
INSERT INTO `atop_acronym` VALUES ('49', 'NRZ', 'Non Return to Zero', '不归零码', 'http://baike.baidu.com/view/1462294.htm', '', '2014-01-20 17:08:26', '1');
INSERT INTO `atop_acronym` VALUES ('50', 'EEPROM', 'Electrically Erasable Programmable Read-Only Memory', '电可擦可编程只读存储器', 'http://baike.baidu.com/view/93707.htm', 'EEPROM是一种掉电后数据不丢失的存储芯片。EEPROM可以在电脑上或专用设备上擦除已有信息，重新编程，一般用在即插即用。', '2014-01-20 17:14:49', '1');
INSERT INTO `atop_acronym` VALUES ('51', 'MSA', 'Multisource Agreement', '多源协议', '', '', '2014-01-20 17:17:35', '1');
INSERT INTO `atop_acronym` VALUES ('52', 'I2C', 'Inter-Integrated Circuit', '二线串行总线', 'http://baike.baidu.com/view/751581.htm', 'I2C总线是由PHILIPS公司开发的两线式串行总线，用于连接微控制器及其外围设备。是微电子通信控制领域广泛采用的一种总线标准。它是同步通信的一种特殊形式，具有接口线少，控制方式简单，器件封装形式小，通信速率较高等优点。', '2014-01-20 17:19:59', '1');
INSERT INTO `atop_acronym` VALUES ('53', 'SPI', 'Serial Peripheral Interface', '串行外设接口', 'http://baike.baidu.com/view/140064.htm', 'SPI总线系统是一种同步串行外设接口，它可以使MCU与各种外围设备以串行方式进行通信以交换信息。SPI接口是Motorola首先在其MC68HCXX系列处理器上定义的。SPI接口主要应用在EEPROM、FLASH、实时时钟、AD转换器，还有数字信号处理器和数字信号解码器之间。', '2014-01-20 17:25:48', '1');
INSERT INTO `atop_acronym` VALUES ('54', 'VAPD', 'Voltage of APD', '雪崩光电二极管工作电压', '', '', '2014-01-20 17:27:56', '1');
INSERT INTO `atop_acronym` VALUES ('55', 'MCU', 'Micro Control Unit', '微控制单元', 'http://baike.baidu.com/subview/100928/9483587.htm', 'MCU中文名称为微控制单元，又称单片微型计算机(Single Chip Microcomputer)或者单片机，是指随着大规模集成电路的出现及其发展，将计算机的CPU、RAM、ROM、定时计数器和多种I/O接口集成在一片芯片上，形成芯片级的计算机，为不同的应用场合做不同组合控制。', '2014-01-20 17:32:39', '1');
INSERT INTO `atop_acronym` VALUES ('56', 'ADC', 'Analog-to-Digital Converter', '模数转换器', 'http://baike.baidu.com/subview/204037/8092697.htm', 'ADC是指将连续变量的模拟信号转换为离散的数字信号的器件。真实世界的模拟信号，例如温度、压力、声音或者图像等，需要转换成更容易储存、处理和发射的数字形式。模/数转换器可以实现这个功能，在各种不同的产品中都可以找到它的身影。', '2014-01-20 18:01:37', '1');
INSERT INTO `atop_acronym` VALUES ('57', 'DAC', 'Digital-to-Analog Converter', '数模转换器', 'http://baike.baidu.com/view/66060.htm', 'DAC即数/模转换器，一种将[1]数字信号转换成模拟信号的装置。电脑对声音这种信号不能直接处理，先把它转化成电脑能识别的数字信号，就要用到声卡中的DAC（数字/模拟转换），它把声音信号转换成数字信号，要分两步进行，采样和转换。', '2014-01-20 18:03:13', '1');
INSERT INTO `atop_acronym` VALUES ('58', 'EED', 'EEPROM Definition', '模块E方定义', '', '', '2014-01-21 09:38:36', '1');
INSERT INTO `atop_acronym` VALUES ('59', 'LD', 'Laser Diode', '激光二极管', 'http://baike.baidu.com/view/615255.htm', '激光二极管本质上是一个半导体二极管，按照PN结材料是否相同，可以把激光二极管分为同质结、单异质结（SH）、双异质结（DH）和量子阱（QW）激光二极管。量子阱激光二极管具有阈值电流低，输出功率高的优点，是目前市场应用的主流产品。同激光器相比，激光二极管具有效率高、体积小、寿命长的优点，但其输出功率小（一般小于2mW），线性差、单色性不太好，使其在有线电视系统中的应用受到很大限制，不能传输多频道，高性能模拟信号。在双向光接收机的回传模块中，上行发射一般都采用量子阱激光二极管作为光源。', '2014-01-21 09:41:20', '1');
INSERT INTO `atop_acronym` VALUES ('60', 'LED', 'Light Emitting Diode', '发光二极管', 'http://baike.baidu.com/view/84213.htm', '发光二极管简称为LED。由镓（Ga）与砷（As）、磷（P）、氮（N）、铟（In）的化合物制成的二极管，当电子与空穴复合时能辐射出可见光，因而可以用来制成发光二极管。在电路及仪器中作为指示灯，或者组成文字或数字显示。磷砷化镓二极管发红光，磷化镓二极管发绿光，碳化硅二极管发黄光，铟镓氮二极管发蓝光。', '2014-01-21 09:42:45', '1');
INSERT INTO `atop_acronym` VALUES ('61', 'DFB', 'Distributed Feedback Laser', '分布式反馈激光器', 'http://baike.baidu.com/view/3882555.htm', 'DFB激光器，即分布式反馈激光器，其不同之处是内置了布拉格光栅（Bragg Grating），属于侧面发射的半导体激光器。目前，DFB激光器主要以半导体材料为介质，包括锑化镓(GaSb）、砷化镓（GaAs）、磷化铟(InP)、硫化锌(ZnS)等。DFB激光器最大特点是具有非常好的单色性（即光谱纯度），它的线宽普遍可以做到1MHz以内，以及具有非常高的边模抑制比（SMSR），目前可高达40-50dB以上。', '2014-01-21 09:47:36', '1');
INSERT INTO `atop_acronym` VALUES ('62', 'FP', 'Fabry Perot Laser', '法布里珀罗激光器', '', '以半导体材料作为光增益介质的光放大器。它在结构上与半导体双异质结构激光器相同。最早研究的是法布里珀罗半导体光放大器（FP-SLA），它实质上是偏置在阈值以下的半导体激光器。这种光放大器有增益带宽小、饱和输出功率低、温度稳定性差等缺点。', '2014-01-21 09:58:02', '1');
INSERT INTO `atop_acronym` VALUES ('63', 'SONET', 'Synchronous Optical Network', '同步光纤网络', 'http://baike.baidu.com/view/135282.htm', '美国在1988年首先推出的一个数字传输标准，整个的同步网络的各级时钟都来自一个非常精确的主时钟（采用昂贵铯原子钟，精度优于正负10的-11次方）。SONET光纤传输系统定义了同步传输的线路速率等级结构，其传输速率以51.84Mb/s为基础，大约对应于T3/E3的传输速率，此速率对电信号称为第1级同步传送信号，即STS-1；对光信号则成为第1级光载波(Optical Carrier， OC)，即OC-1。现已定义了从OC-1 —51.84Mb/s一直到OC-3072 — about 160 Gbit/s 的畨坴畬\0\0\0\0醼畨', '2014-01-21 10:01:01', '1');
INSERT INTO `atop_acronym` VALUES ('64', 'UPC', 'Ultra Physical Contact', '极度物理端面', '', '是一种光纤连接器端面接触方式，UPC代表插针体端面为极度物理端面，APC代表插针体端面为斜8度角物理端面。', '2014-01-21 10:06:06', '1');
INSERT INTO `atop_acronym` VALUES ('65', 'APC', 'Angle Physical Contact', '斜8度角物理端面', '', '是一种光纤连接器端面接触方式，UPC代表插针体端面为极度物理端面，APC代表插针体端面为斜8度角物理端面。', '2014-01-21 10:07:00', '1');
INSERT INTO `atop_acronym` VALUES ('66', 'APC', 'Automatic Power Control', '自动功率控制', 'http://www.elecfans.com/article/88/131/189/2009/2009030627506.html', 'APC电路的作用是，稳定LD输出光功率，使其不随温度升高和使用时间增长而改变。', '2014-01-21 10:11:16', '1');
INSERT INTO `atop_acronym` VALUES ('67', 'AGC', 'Automatic Gain Control', '自动增益控制', 'http://baike.baidu.com/view/99874.htm', '自动增益控制是使放大电路的增益自动地随信号强度而调整的自动控制方法。', '2014-01-21 10:13:49', '1');
INSERT INTO `atop_acronym` VALUES ('68', 'BER', 'Bit Error Rate', '误码率', '', '', '2014-01-21 10:15:37', '1');
INSERT INTO `atop_acronym` VALUES ('69', 'OA', 'Office Automation', '办公自动化', 'http://baike.baidu.com/subview/38368/5066312.htm', '办公自动化是将现代化办公和计算机网络功能结合起来的一种新型的办公方式。办公自动化没有统一的定义，凡是在传统的办公室中采用各种新技术、新机器、新设备从事办公业务，都属于办公自动化的领域。在行政机关中，大都把办公自动化叫做电子政务，企事业单位就大都叫OA，即办公自动化。通过实现办公自动化，或者说实现数字化办公，可以优化现有的管理组织结构，调整管理体制，在提高效率的基础上，增加协同办公能力，强化决策的一致性，最后实现提高决策效能的目的。', '2014-01-21 10:18:54', '1');
INSERT INTO `atop_acronym` VALUES ('70', 'DDM', 'Digital Diagnostic Monitoring', '数字诊断监测', 'http://baike.baidu.com/view/1420668.htm#4', '数字诊断光模块（DDMI）也称智能模块，光模块通过增加芯片和辅助电路设计，网络管理单元可以实时监测收发模块的温度、供电电压、激光偏置电流以及发射和接收光功率。这些参量的测量，可以帮助管理单元找出光纤链路中发生故障的位置，简化维护工作，提高系统的可靠性。', '2014-01-21 10:24:08', '1');
INSERT INTO `atop_acronym` VALUES ('71', 'FQC', 'Final Quality Control', '最终质量控制', 'http://baike.baidu.com/view/1099713.htm', 'FQC是在产品完成所有制程或工序後，对於产品「本身」的品质状况，包括：外观检验(颜色、光泽、粗糙度、毛边、是否有刮伤)、尺寸/ 孔径的量测、性能测试(材料的物理/化学特性、电气特性、机械特性、操作控制)，进行全面且最後一次的检验与测试，目的在确保产品符合出货规格要求，甚至符合客户使用上的要求(Fitness for Requirement)。', '2014-01-21 10:26:22', '1');
INSERT INTO `atop_acronym` VALUES ('72', 'FTP', 'File Transfer Protocol', '文件传输协议', 'http://baike.baidu.com/view/103832.htm', '文件传输协议使得主机间可以共享文件。 FTP 使用TCP 生成一个虚拟连接用于控制信息，然后再生成一个单独的 TCP 连接用于数据传输。控制连接使用类似TELNET协议在主机间交换命令和消息。文件传输协议是TCP/IP网络上两台计算机传送文件的协议，FTP是在TCP/IP网络和INTERNET上最早使用的协议之一，它属于网络协议组的应用层。FTP客户机可以给服务器发出命令来下载文件，上传文件，创建或改变服务器上的目录。', '2014-01-21 10:27:54', '1');
INSERT INTO `atop_acronym` VALUES ('73', 'OEM', 'Original Equipment Manufacturer', '原始设备制造商', 'http://baike.baidu.com/view/890452.htm', 'OEM生产，也称为定点生产，俗称代工（生产），基本含义为品牌生产者不直接生产产品，而是利用自己掌握的关键的核心技术负责设计和开发新产品，控制销售渠道，具体的加工任务通过合同订购的方式委托同类产品的其他厂家生产。之后将所订产品低价买断，并直接贴上自己的品牌商标。这种委托他人生产的合作方式简称OEM，承接加工任务的制造商被称为OEM厂商，其生产的产品被称为OEM产品。', '2014-01-21 10:29:18', '1');
INSERT INTO `atop_acronym` VALUES ('74', 'PCB', 'Printed Circuit Board', '印制电路板', 'http://baike.baidu.com/view/3672.htm', 'PCB的中文名称为印制电路板，又称印刷电路板、印刷线路板，是重要的电子部件，是电子元器件的支撑体，是电子元器件电气连接的载体。由于它是采用电子印刷术制作的，故被称为“印刷”电路板。', '2014-01-21 10:31:04', '1');
INSERT INTO `atop_acronym` VALUES ('75', 'ISO', 'International Organization for Standardization', '国际标准化组织', 'http://baike.baidu.com/subview/1007/5909092.htm', 'ISO是国际标准化组织的英语简称。ISO来源于希腊语“ISOS”，即“EQUAL”——平等之意。国际标准化组织（ISO）是由各国标准化团体（ISO成员团体）组成的世界性的联合会。制定国际标准工作通常由ISO的技术委员会完成。ISO与国际电工委员会（IEC）在电工技术标准化方面保持密切合作的关系。中国是ISO的正式成员，代表中国的组织为中国国家标准化管理委员会（Standardization Administration of China，简称SAC）。', '2014-01-21 10:33:58', '1');
INSERT INTO `atop_acronym` VALUES ('76', 'SMF', 'Single Mode Fiber', '单模光纤', 'http://baike.baidu.com/view/164686.htm', '单模光纤是指中心玻璃芯很细(芯径一般为9或10μm)，只能传一种模式的光纤。因此，其模间色散很小，适用于远程通讯，但还存在着材料色散和波导色散，这样单模光纤对光源的谱宽和稳定性有较高的要求，即谱宽要窄，稳定性要好。后来又发现在1.31μm波长处，单模光纤的材料色散和波导色散一为正、一为负，大小也正好相等。这样，1.31μm波长区就成了光纤通信的一个很理想的工作窗口，也是现在实用光纤通信系统的主要工作波段1.31μm常规单模光纤的主要参数是由国际电信联盟ITU－T在G652建议中确定的，因此这种光纤又称G6畨坴畬\0\0', '2014-01-21 10:38:33', '1');
INSERT INTO `atop_acronym` VALUES ('77', 'MMF', 'Multi Mode Fiber', '多模光纤', 'http://baike.baidu.com/view/164682.htm', '多模光纤容许不同模式的光于一根光纤上传输，由于多模光纤的芯径较大，故可使用较为廉价的耦合器及接线器，多模光纤的纤芯直径为50μm至100μm。', '2014-01-21 10:39:48', '1');
INSERT INTO `atop_acronym` VALUES ('78', 'NPI', 'New Product Introduction', '新产品导入', '', '', '2014-01-21 10:41:59', '1');
INSERT INTO `atop_acronym` VALUES ('79', 'AOC', 'Active Optical Cable', '有源光缆', '', '', '2014-01-21 10:50:14', '1');
INSERT INTO `atop_acronym` VALUES ('80', 'WI', 'Working Instruction', '作业指导书', '', '', '2014-01-21 10:58:16', '1');
INSERT INTO `atop_acronym` VALUES ('81', 'TEC', 'Thermal Electronic Cooler', '半导体制冷器', 'http://baike.baidu.com/view/906752.htm#1', '半导体致冷器是利用半导体材料的珀尔帖效应制成的。所谓珀尔帖效应，是指当直流电流通过两种半导体材料组成的电偶时，其一端吸热，一端放热的现象。重掺杂的N型和P型的碲化铋主要用作TEC的半导体材料，碲化铋元件采用电串联，并且是并行发热。TEC包括一些P型和N型对（组），它们通过电极连在一起，并且夹在两个陶瓷电极之间；当有电流从TEC流过时，电流产生的热量会从TEC的一侧传到另一侧，在TEC上产生″热″侧和″冷″侧，这就是TEC的加热与致冷原理。', '2014-01-21 11:01:10', '1');
INSERT INTO `atop_acronym` VALUES ('82', 'DS', 'Datasheet', '数据手册', '', '', '2014-01-21 11:02:55', '1');
INSERT INTO `atop_acronym` VALUES ('83', 'BOM', 'Bill of Material', '物料清单', 'http://baike.baidu.com/subview/126558/6920449.htm', '采用计算机辅助企业生产管理，首先要使计算机能够读出企业所制造的产品构成和所有要涉及的物料，为了便于计算机识别，必须把用图示表达的产品结构转化成某种数据格式，这种以数据格式来描述产品结构的文件就是物料清单，即是BOM。它是定义产品结构的技术文件，因此，它又称为产品结构表或产品结构树。', '2014-01-21 11:05:18', '1');
INSERT INTO `atop_acronym` VALUES ('84', 'MDIO', 'Management Data Input Output', '管理数据输入输出', 'http://baike.baidu.com/view/3657916.htm', 'MDIO是一种简单的双线串行接口，将管理器件(如MAC控制器、微处理器)与具备管理功能的收发器(如多端口吉比特以太网收发器或 10GbE XAUI收发器)相连接，从而控制收发器并从收发器收集状态信息。', '2014-01-21 11:10:02', '1');
INSERT INTO `atop_acronym` VALUES ('85', 'FIFO', 'First Input First Output', '先入先出队列', 'http://baike.baidu.com/view/736423.htm', '先入先出队列是一种传统的按序执行方法，先进入的指令先完成并引退，跟着才执行第二条指令。是一种先进先出的数据缓存器，他与普通存储器的区别是没有外部读写地址线，这样使用起来非常简单，但缺点就是只能顺序写入数据，顺序的读出数据，其数据地址由内部读写指针自动加1完成，不能像普通存储器那样可以由地址线决定读取或写入某个指定的地址。', '2014-01-21 11:11:32', '1');
INSERT INTO `atop_acronym` VALUES ('86', 'MSB', 'Most Significant Bit', '最高有效位', 'http://baike.baidu.com/view/1126764.htm', '在二进制数中，MSB是最高加权位。与十进制数字中最左边的一位类似。通常，MSB位于二进制数的最左侧，LSB位于二进制数的最右侧。', '2014-01-21 11:12:42', '1');
INSERT INTO `atop_acronym` VALUES ('87', 'LSB', 'Least Significant Bit', '最低有效位', '', 'LSB是指一个二进制数字中的第0位（即最低位），具有权值为2^0，可以用它来检测数的奇偶性。与之相反的称之为最高有效位。', '2014-01-21 11:15:43', '1');
INSERT INTO `atop_acronym` VALUES ('88', 'CFP', 'Centum Form-factor Pluggable', '100G小封装可插拔', 'http://en.wikipedia.org/wiki/C_Form-factor_Pluggable', '', '2014-01-21 11:23:12', '1');
INSERT INTO `atop_acronym` VALUES ('89', 'ESD', 'ElectroStatic Discharge', '静电放电', 'http://zh.wikipedia.org/wiki/%E9%9D%99%E7%94%B5%E6%94%BE%E7%94%B5', '自然界中的物质，可经由某种过程而获得或失去电子(例如摩擦或感应起电)，这类的电荷即称为静电。当这些正电荷或是负电荷逐渐累积时，会与周围环境产生电位差，电荷若是经由放电路径而产生在不同电位之间移转现象，即称此为静电放电现象，简称为ESD。', '2014-01-21 11:34:30', '1');
INSERT INTO `atop_acronym` VALUES ('90', 'RMA', 'Return Material Authorization', '退换货流程', '', '退换货流程，是处理客户不良产品退货、换货的主要流程。', '2014-01-21 11:43:09', '1');
INSERT INTO `atop_acronym` VALUES ('91', 'PE', 'Process Engineering', '工艺工程', '', '', '2014-01-21 11:44:10', '1');
INSERT INTO `atop_acronym` VALUES ('92', 'M&S', 'Marketing & Sales', '市场营销', '', '', '2014-01-21 11:44:38', '1');
INSERT INTO `atop_acronym` VALUES ('93', 'QA', 'Quality Assurance', '质量保证', '', '', '2014-01-21 11:45:01', '1');
INSERT INTO `atop_acronym` VALUES ('94', 'R&D', 'Research & Development', '研发', '', '', '2014-01-21 11:45:25', '1');
INSERT INTO `atop_acronym` VALUES ('95', 'FAE', 'Field Application Engineer', '现场应用工程师', '', '', '2014-01-21 11:45:51', '1');
INSERT INTO `atop_acronym` VALUES ('96', 'MC', 'Material Control', '物料控制', '', '', '2014-01-21 11:46:24', '1');
INSERT INTO `atop_acronym` VALUES ('97', 'PC', 'Planning Control', '计划控制', '', '', '2014-01-21 11:46:43', '1');
INSERT INTO `atop_acronym` VALUES ('98', 'BPON', 'Broadband Passive Optical Network', '宽带无源光网络', 'http://baike.baidu.com/view/1307656.htm', '这是一个基于APON的标准.这个标准增加了对WDM，动态和高速上联带宽分配，和耐久性的支持。BPON也创立了一个管理接口标准OMCI, 在OLT和 ONU/ONT之间的授权混合供应商网络。', '2014-01-21 11:55:33', '1');
INSERT INTO `atop_acronym` VALUES ('99', 'OTN', 'Optical Transport Network', '光传送网', 'http://baike.baidu.com/view/1473687.htm', 'OTN是以波分复用技术为基础、在光层组织网络的传送网，是下一代的骨干传送网。OTN是通过G.872、G.709、G.798等一系列ITU-T的建议所规范的新一代“数字传送体系”和“光传送体系”，将解决传统WDM网络无波长/子波长业务调度能力差、组网能力弱、保护能力弱等问题。', '2014-01-21 13:18:12', '1');
INSERT INTO `atop_acronym` VALUES ('100', 'LTE', 'Long Term Evolution', '长期演进', 'http://baike.baidu.com/view/1084057.htm', 'LTE是由3GPP（The 3rd Generation Partnership Project，第三代合作伙伴计划）组织制定的UMTS（Universal Mobile Telecommunications System，通用移动通信系统）技术标准的长期演进，于2004年12月在3GPP多伦多TSG RAN#26会议上正式立项并启动。', '2014-01-21 13:24:25', '1');
INSERT INTO `atop_acronym` VALUES ('101', 'HR', 'Human Resource', '人力资源', 'http://baike.baidu.com/view/10428.htm', 'HR-Human Resource人力资源，目标是让企业HR更好地进行人力资源的发展和规划。系统重点是实现人力资源部门在员工素质管理、薪酬管理、绩效考核等方面的需求。', '2014-01-21 13:27:23', '1');
INSERT INTO `atop_acronym` VALUES ('102', 'ITU', 'International Telecommunication Union', '国际电信联盟', 'http://baike.baidu.com/view/26606.htm', '国际电信联盟是联合国的一个专门机构，也是联合国机构中历史最长的一个国际组织。简称“国际电联”，“电联”或“ITU”。国际电联是主管信息通信技术事务的联合国机构。作为世界范围内联系各国政府和私营部门的纽带，国际电联通过其麾下的无线电通信、标准化和发展电信展览活动，而且是信息社会世界高峰会议的主办机构。国际电联总部设于瑞士日内瓦，其成员包括191个成员国和700多个部门成员及部门准成员。每年的5月17日是世界电信日(World Telecommunication Day)。', '2014-01-21 15:48:53', '1');
INSERT INTO `atop_acronym` VALUES ('103', 'IEEE', 'Institute of Electrical and Electronics Engineers', '电气和电子工程师协会', 'http://baike.baidu.com/view/1164737.htm', '美国电气和电子工程师协会(IEEE)是一个国际性的电子技术与信息科学工程师的协会，是目前全球最大的非营利性专业技术学会，其会员人数超过40万人，遍布160多个国家。IEEE致力于电气、电子、计算机工程和与科学有关的领域的开发和研究，在太空、计算机、电信、生物医学、电力及消费性电子产品等领域已制定了900多个行业标准，现已发展成为具有较大影响力的国际学术组织。', '2014-01-21 15:50:08', '1');
INSERT INTO `atop_acronym` VALUES ('104', 'DVT', 'Design Verification Test', '设计验证测试', '', 'DVT是硬件生产中不可缺少的一个检测环节，包括模具测试、电子性能、外观测试等等。', '2014-01-21 16:17:41', '1');
INSERT INTO `atop_acronym` VALUES ('105', 'DNS', 'Domain Name System', '域名系统', 'http://baike.baidu.com/view/22276.htm', 'DNS，是因特网的一项核心服务，它作为可以将域名和IP地址相互映射的一个分布式数据库，能够使人更方便的访问互联网，而不用去记住能够被机器直接读取的IP数串。', '2014-01-21 17:30:09', '1');
INSERT INTO `atop_acronym` VALUES ('106', 'HTTP', 'Hypertext Transfer Protocol', '超文本传输协议', 'http://baike.baidu.com/view/1628025.htm', '超文本传输协议是一种详细规定了浏览器和万维网服务器之间互相通信的规则，通过因特网传送万维网文档的数据传送协议。', '2014-01-21 17:31:22', '1');
INSERT INTO `atop_acronym` VALUES ('107', 'FC', 'Ferrule Connector', '套管式连接器', 'http://wju.sdau.edu.cn/network/2008/1013/article_150.html', '这种连接器最早是由日本NTT研制。FC是Ferrule Connector的缩写，表明其外部加强方式是采用金属套，紧固方式为螺丝扣。最早，FC类型的连接器，采用的陶瓷插针的对接端面是平面接触方式（FC）。此类连接器结构简单，操作方便，制作容易，但光纤端面对微尘较为敏感，且容易产生菲涅尔反射，提高回波损耗性能较为困难。后来，对该类型连接器做了改进，采用对接端面呈球面的插针（PC），而外部结构没有改变，使得插入损耗和回波损耗性能有了较大幅度的提高。', '2014-01-21 17:40:36', '1');
INSERT INTO `atop_acronym` VALUES ('108', 'SC', 'Subscriber Connector', '用户连接器', 'http://baike.baidu.com/view/26174.htm#1_3', '这是一种由日本NTT公司开发的光纤连接器。其外壳呈矩形，所采用的插针与耦合套筒的结构尺寸与FC型完全相同。其中插针的端面多采用PC或APC型研磨方式；紧固方式是采用插拔销闩式，不需旋转。此类连接器价格低廉，插拔操作方便，介入损耗波动小，抗压强度较高，安装密度高。', '2014-01-21 17:56:55', '1');
INSERT INTO `atop_acronym` VALUES ('109', 'LC', 'Line Connector', '线路连接器', 'http://baike.baidu.com/view/26174.htm#1_5', 'LC型连接器是著名Bell（贝尔）研究所研究开发出来的，采用操作方便的模块化插孔（RJ）闩锁机理制成。其所采用的插针和套筒的尺寸是普通SC、FC等所用尺寸的一半，为1.25mm。这样可以提高光纤配线架中光纤连接器的密度。当前，在单模SFF方面，LC类型的连接器实际已经占据了主导地位，在多模方面的应用也增长迅速。', '2014-01-21 17:59:07', '1');
INSERT INTO `atop_acronym` VALUES ('110', 'SNR', 'Signal-to-Noise Ratio ', '信噪比', 'http://baike.baidu.com/view/190275.htm', '信噪比，又称为讯噪比，即放大器的输出信号的电压与同时输出的噪声电压的比，常常用分贝数表示。设备的信噪比越高表明它产生的杂音越少。一般来说，信噪比越大，说明混在信号里的噪声越小，声音回放的音质量越高，否则相反。', '2014-01-21 18:00:17', '1');
INSERT INTO `atop_acronym` VALUES ('111', 'OS', 'Operating System', '操作系统', '', '', '2014-01-21 18:01:58', '1');
INSERT INTO `atop_acronym` VALUES ('112', 'CXP', '120 Gb/s 12x Small Form-factor Pluggable', '120G小封装可插拔', 'http://en.wikipedia.org/wiki/CXP_(connector)', '', '2014-01-25 14:50:39', '1');
INSERT INTO `atop_acronym` VALUES ('117', 'CSFP', 'Compact Small Form-factor Pluggable', '紧凑型小封装可插拔收发器', 'https://en.wikipedia.org/wiki/Small_form-factor_pluggable_transceiver#CSFP', 'Compact SFP，紧凑型SFP，在现有SFP封装基础上，发展为更先进、更紧凑的CSFP封装。CSFP MSA中共定义了3种C-SFP：\n1ch Compact SFP\n2ch Compact SFP（Option 1）\n2ch Compact SFP（Option 2）\nhttp://bbs.c114.net/thread-867395-1-1.html', '2017-06-30 09:10:49', '30');
INSERT INTO `atop_acronym` VALUES ('118', 'RT', 'Reliability Test', '可靠性测试', 'http://www.baike.com/wiki/%E5%8F%AF%E9%9D%A0%E6%80%A7%E6%B5%8B%E8%AF%95', '可靠性测试就是为了评估产品在规定的寿命期间内，在预期的使用、运输或储存等所有环境下，保持功能可靠性而进行的活动。', '2017-08-02 16:49:18', '30');
INSERT INTO `atop_acronym` VALUES ('119', 'CDR', 'Clock Data Recovery', '时钟数据恢复', 'https://baike.baidu.com/item/CDR/5040978', '时钟数据恢复（CDR）技术是高性能系统的一个关键性能。 除了FPGA的快速逻辑性能，高性能系统还要求设备之间具有可靠的高速数据传输性能。具有高带宽的发射机/接收机链并不一定能保证接入到此类带宽中--从传输信道的失真和噪声恢复数据的能力决定了一个网络的实际可用的可靠带宽。数据恢复是远程和密集波分多路(DWDM)光网络的基本功能块，也是高速芯片间和背板连接，以及光纤信道、无线、和存储区域网络的基本功能块。', '2017-08-03 11:14:09', '30');
INSERT INTO `atop_acronym` VALUES ('120', 'DAC', 'Direct Attach Copper', '直连铜缆', 'https://en.wikipedia.org/wiki/Twinaxial_cabling#SFP.2B_Direct-Attach_Copper_.2810GSFP.2BCu.29', '无', '2017-10-25 11:02:57', '30');
INSERT INTO `atop_acronym` VALUES ('121', 'ECN', 'Engineering Change Notice', '工程变更通知', 'https://en.wikipedia.org/wiki/Engineering_change_notice', '工厂中的任何受控资料需要变更时，以ECN形式提出，经相关单位会签批准后方可生效，即入文控中心存档。', '2017-10-25 11:20:18', '30');
INSERT INTO `atop_acronym` VALUES ('122', 'PLM', 'Product Lifecycle Management', '产品生命周期管理', 'https://en.wikipedia.org/wiki/Product_lifecycle', '所谓产品生命周期管理，就是指从人们对产品的需求开始，到产品淘汰报废的全部生命历程。PLM是一种先进的企业信息化思想，它让人们思考在激烈的市场竞争中，如何用最有效的方式和手段来为企业增加收入和降低成本。', '2017-10-25 11:22:44', '30');
