INSERT INTO `atop_ecn` VALUES ('73', 'ECN000000073', 'file', '<p class=\"MsoNormal\" style=\"text-align: start;\"><span lang=\"EN-US\">1. Datasheet</span><span>里</span><span lang=\"EN-US\">” Up to 2Km on 9/125um SMF”</span><span>改成</span><span lang=\"EN-US\">” Up to 2Km on OM2 MMF”;</span><span lang=\"EN-US\"></span></p><p class=\"MsoNormal\" style=\"text-align: start;\"><span>2. 光参数</span><span lang=\"EN-US\">”Output Opt. Power&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; PO&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; -15&nbsp; -&nbsp;&nbsp; -8”<span class=\"Apple-converted-space\">&nbsp;</span></span><span>改成</span><span lang=\"EN-US\">” Output Opt. Power&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; PO&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; -9.5&nbsp; -&nbsp;&nbsp; -3”;</span><span lang=\"EN-US\"></span></p><p class=\"MsoNormal\" style=\"text-align: start;\"><span lang=\"EN-US\"></span><span>3. 接收灵敏的内控指标调整到</span><span lang=\"EN-US\">-27dBm</span><span>，并发</span><span lang=\"EN-US\">PCN</span><span>。</span></p><p class=\"MsoNormal\" style=\"text-align: start;\"><span>4. 拉环颜色由原先的黑色改为蓝色拉环。<br></span></p>', '四川迈普通信客户要求对于指标和拉环等进行更改，做定制化流程。', '1', '0', 'Complete', '1', 'N', '1508225138', '49', '1508228153');
