INSERT INTO `atop_ecn` VALUES ('79', 'ECN000000079', 'file', '<p>修订WI文件 —— 客户要求产品拉杆颜色为‘蓝色’，与1.25G 20km 1310波长模块共用一个WI文件；</p><p>新建EED文件 —— 客户对发射端功率要求为‘-9.5dBm~-3dBm’，在标准品EED文件的基础上更改 TX / RX Powe r的 Alarm、Warning值；</p><p>新建REG文件——与标准品 REG 文件相同，未做任何更改（贯彻 REG 文件名与产品型号一致，方便后期修正）；</p><p>新建SEP文件——客户对收、发端性能均有特殊定制要求，针对客户定制要求更改调测试指标。</p><p><br></p>', '迈普定制产品型号：APS31123CDL2MP，对拉杆颜色、测试指标有特殊要求', '2', '0', 'Complete', '1', 'N', '1508733507', '67', null);
