INSERT INTO `atop_oacustomercomplaint` VALUES ('76', '2015-04-09', 'Bob', '马来西亚客户', '无', 'SFP+ ZR', 'Cisco', 'ME-3600X-24FS-M', 'The PID &amp; description display is incorrect. The Transceiver is programme ER instead of ZR.', 'SFF-8472协议只规定了10GBase-ER，并无ZR定义，所以只写了ER，思科的PID倒是可以修改为“SFP-10G-ZR”。', 'NULL', '-1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('77', '2015-04-18', 'Thomas', '无', '235-ATOPEU-A', 'APS31253CDL20/APS55253CDL40', 'Ericsson', 'OMS3255 720G', '“not working, can not read information, can not link up”', '可能是写码问题', '序列号：SH31250900001/SH55450900001', '-1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('78', '2015-04-20', 'wangli', '无', '无', 'CSFP 2pcs样品', 'Alcatel-Lucent', 'ISAM 7302', '阿朗型号显示错误，只能用在千兆模式，无法用于百兆', '公司阿朗码型号统一写的是“3FE65106AA”，在datasheet上查看支持百兆/千兆的型号应该是“3FE66131AA”，怀疑是型号错了导致。', 'NULL', '0', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('79', '2015-05-13', 'Allen', '马来西亚电信', '无', 'APS85123CDL05, XFP 40km/80km', 'Huawei', 'NE40E&80E', '1，Port not UP，DDM: Rx Power: -28.86dBm, Tx Power: -6.79dBm;&lt;br /&gt;2，The Vendor Name is xxx, The Vendor PN is xxx&lt;br /&gt;Transceiver max BW: 25500~25500Mbps, Transceiver Mode: Unknown Mode&lt;br /&gt;WaveLength: 3276nm, Transmission Distance: &gt;254km&lt;br /&gt;Rx Optical Power:  8.16dBm, Tx Optical Power:  8.16dBm', '1，收端监控过小，可能是跳线衰减过大；&lt;br /&gt;2，A0信息全为FF，可能是码或者I2C通信故障引起。', 'NULL', '1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('80', '2015-05-15', 'pangkunyang', '成都艾普', '无', 'XFP SR 4pcs', 'Cisco', 'ASR 9006', 'Operational state: Down (Reason: Module is not supported)', 'XFP兼容Cisco ASR 9000系列需要写A0 table 2，估计是没写。', 'NULL', '0', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('81', '2015-05-15', 'Bob', '越南CMC', '无', 'APSB53013CDL10C(25L95)', 'DCN', 'DCS-4500-24F-DC', '在Maipu/Zyxel上测试正常，在神州数码设备上监控和功率计实测相差3~5dB', '猜测可能是校准或者设备Vcc异常', 'APSB53013CDL10C(25L95) 3pcs&lt;br /&gt;S0T53151303024/S0T53151304822/S0T53151314793', '0', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('82', '2015-05-27', 'Jonas', 'Orienta', '无', 'APCSFP43123CDL20', 'Huawei', 'MA5600T', '1, A CPE is connected to a CSFP in Huawei MA5600T. Everything works fine.&lt;br /&gt;2, CPE reboots. This results in no link. CPE LED is yellow indicating 100Mb link. &lt;br /&gt;3, SFP or power source has to be removed in order for CPE to reach operating state up with link speed 1000Mb.&lt;br /&gt;4, Using orginal Huawei CFSP no problems occur during reboot.', '看了客户发回的能正常工作的码，是新飞通的T码，没有加密字节，排除写码问题，Jim认为是不同速率下LOS的影响。', '订单号：188-Orienta-A ，今年1月15日出货&lt;br /&gt;数量：2160 pcs&lt;br /&gt;型号：APCSFP43123CDL20&lt;br /&gt;序列号：SG43245100001-2160&lt;br /&gt;', '1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('83', '2015-06-18', 'Bob', '越南CMC', '044-CMCSI-A, 045A-CMCSI-A', 'APS31013CDL40/APS55063CDL80/APS55063CDLB2', 'Loop Telecom', 'Loop-O9400R', '1, Our equipment only detected SFP type 120Km but if used SFP 80km and 40km then can not detected. &lt;br /&gt;2, About compatibility: i think with SFP of ATOP type 120km is OK, so type 80km and 40 km need to check again', '客户使用的是台湾厂商Loop Telecom的SDH设备，猜测可能是SDH相关字节未写导致。', 'NULL', '0', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('84', '2015-06-08', 'Daniel', 'FOSS', '无', 'APS31123CDL20', 'Cisco', 'Cisco 891 Router', 'The same appears as a 1000BASE-LX as it should in a regular Cisco switch, but when they plug it into a Cisco 891 Router is appears as a 1000BASE-ZX and does not work.', '查看了客户通过设备读出的码，A0[06]=02h，按协议是1000BASE-LX，但是设备解析成了sfp_transceiver_code  0x02 (1000BaseZX)，猜测是思科在其他地方增加了特殊定义。', 'NULL', '-1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('85', '2015-06-30', 'Allen', 'Kabex', '007-ABEX-A', 'QSFP+ LR', 'Cisco', 'N3K-C3064PQ-10GX', 'the QSFP for the cisco switch is not working, seem like the switch do not detect the transceiver.', '初步猜测是写码问题，但是QSFP+的码一直都只有一个，出货这么久没遇到过客诉，这个需要好好研究下。', '2pcs样品，序列号分别为QFC31152300001和QFC31152300002', '1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('86', '2015-06-15', 'Daniel', 'FOSS', '无', 'APSB53123CDL40等5个型号，详见备注', 'Cisco', 'ASR 9000', '1, Media type: R fiber over 1550nm optics;&lt;br /&gt;2, Media type: CWDM with 1470nm optics;&lt;br /&gt;3, Media type: X fiber over long-wl laser PMD, full duplex;&lt;br /&gt;4, Media type: X fiber over long-wl laser PMD, full duplex&lt;br /&gt;5, Media type: Initializing, true state or type not yet known.', '根据客户邮件反馈，Media Type和产品不符，这个估计是3-10的transceiver字节Cisco自己的定义。', '1, SFP-1250C1471-80, SG47850200021;&lt;br /&gt;2, SFP1250C147180/D, SG47850300001;&lt;br /&gt;3, SFP-1250-SM-20/D, SG31243800030;&lt;br /&gt;4, SFP-1250-SM-20/D, SG31243800024; &lt;br /&gt;5, APSB53123CDL40, SG53441600006.', '1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('87', '2015-06-30', 'lvjianqiao', '北京格林威尔', 'SFP+_LR样品', 'APSP31B33CDL10 2pcs', '格林威尔', '自制交叉开关', 'SFP+_LR_TI模块，在流量分析仪上出现丢包。关闭均衡后正常工作。其他方案工作正常。', '客户预加重过多，我司模块再加入均衡补偿，导致信号质量劣化，通讯异常。', '重新发TI方案，关闭均衡的样品。', '0', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('88', '2015-07-08', 'wangli', '广州九博科技', '20150702JBKJ－CS', 'AP-ST1，AP-ST2', 'Huawei', 'ATN910、ATN950、S2300', '我司千兆电口模块在客户处测试数据传输，存在丢包问题，传输15小时丢几十个包。', '可能由于测试环境差别导致，需进一步了解测试环境信息在做分析', 'NULL', '1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('89', '2015-07-15', 'wangli', '广州宽带主干网络有限公司', '20150709GKWL', 'APSP31B33CDL10 5pcs，APS31123CDL20 6pcs', 'Huawei', 'S12708', '设备无法识别', 'S12700系列可能和93系列是新系统版本，采用了新的兼容方式。', 'NULL', '0', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('90', '2015-07-17', 'Nick', 'Goldwater networks', '004-Gold-A', 'APSP85B33CDL03', 'CISCO', 'ASR9006', '样品不工作，插入时不识别。', '初步分析为码的原因，将发两支另一个版本的码给客户测试。', '2pcs', '0', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('91', '2015-07-17', 'Sophia', 'Sereno', '005-Sereno-A', 'AP-ST1', 'Juniper,HP', 'Juniper EX4550,EX4200', 'Juniper EX4500和HP P4300G2做数据传输，当电口模块接入Juniper EX4550后，导致HP P4300G2冗余链路出现flapping现象，直连不接电口模块不会出现该现象。', '可能是由于在不同设备间的信号不连续导致，怀疑可能是发的电口的旧版本模块导致。', 'NULL', '1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('92', '2015-07-22', 'Jonas', '保加利亚IC Intracom', '无', 'APSP85B33CDL03 72pcs', 'Cisco', '6800 series chassis', 'Last week I told you about one issue with CISCO 6800 series chassis, that do not recognize your modules.', '11版C码能兼容思科大部分型号，这款应该是个例外。', 'NULL', '0', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('93', '2015-07-25', 'Daniel', '未知', '未知', '1.25g BIDI 34 43', 'CISCO', 'X4500', '不能在交换机上正常识别', 'x4500比较特殊，常规cisco码不能正常识别。', '根据销售反馈，此款型号交换机对 vendername 有特殊要求，会联系销售发一些进行测试。', '1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('94', '2015-07-27', 'henry', 'Telnet（西班牙）', '312-ATOPEU-A', 'APX31WM0CDL10-TZ', '未知', '未知', '一共发三只模块，客户自发自收测试 SEN分别为 -11.1  -13.7  -14.8 ；客户反馈-11.1  低于我们承诺的规格书标准；', '经过系统查询 发现1_2705451 该只模块对应客户测试的-11.1；查询测试记录 我司自己测试SEN为-14.4 ；其余两只我司自测试SEN 为-15.2  -15.8；由于客户是自发自收测试，检测了模块的发端眼图，优于标准眼图（眼图良好，抖动小，噪点少），分析如果是灵低的话，应该就是ROSA 本身灵敏度低的问题；', '处理办法：建议胡磊退厂分析，胡磊不同意；要求先做远程协助，然后再看剩下的该怎么走。。。', '1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('95', '2015-07-25', 'Sophia', 'Cable Superiores', '01-CSL-A', 'APCP04-QQC005-26 6条', 'Juniper', 'EX4550-EM-2QSFP', '1，客户买了6只，目前测了3只不能用。&lt;br /&gt;2，Link 或者Status灯都没有亮，闪都没闪过一下，只有ST灯是亮的。&lt;br /&gt;3，DAC装进Juniper交换机时，读不出DAC模块的PN，SN， 厂商等数据。', '暂时不确定是否是写码原因，需要进一步沟通。', 'NULL', '0', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('96', '2015-07-30', 'jiqi', '科光通讯', '20150713KGTX2', 'APSP55HM3CDL80(ADN8833低功耗版)', '科光通讯', '自制', 'ADN8833出现丢包现象，同批次及以往批次GN2010E方案工作正常。', '客退品退回后，因TOSA紧缺，被改制为GN2010E方案补货。未分析。侯羿推断：应该是电信号衰减导致，GN1444S对于信号衰减补偿的能力很弱，需要外部独立电路。但详细原因未能分析。', 'NULL', '1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('97', '2015-07-29', 'wangli', '广州汇信特', '20141212HXT', 'APS31303CDL20(25L91) 400+pcs', '诺基亚', 'BBU: FSMD; RRU: FRGP/FRGQ/FRGF/FRGT', '1，湘潭市(60只)：光模块主要用来做RRU拉远，和现网诺基亚的10km及20km的光模块不能兼容。如果BBU侧和RRU侧都用VISINT产品，则只有在距离很近的情况下才能用(距离最长不超过6km)。使用设备型号为诺基亚BBU型号：FSMD,RRU型号为：FRGP/FRGQ/FRGF/FRGT。&lt;br /&gt;2，长沙市(350只)：SFP 3G 1310nm 15km（诺西设备），此种模块试用50只，有半数不能正常工作，已安排邮寄几对问题模块返回公司检测。&lt;br /&gt;3，其他地市少量，多模模块暂时没有出现问题，但应用较少。', 'Jim猜测：&lt;br /&gt;1，95和91方案，在3.125G速率下，会存在过载点异常，收端带宽不足等情况。这个是芯片方案的缺陷，最快的解决方案要在年底才能批量提供产品。（即使用96替代95）&lt;br /&gt;2，客户用于3G射频拉远，一般是3.06G的速率。CPRI为短包结构，也有LOS异常的风险。（但肯定不是LOS异常，这个比例不会有这么高）', 'NULL', '0', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('98', '2015-08-05', 'haorui', '三台广电', '20150320CCXX', 'APSB53123CDL20', 'ZTE', 'ZXR 8905E', '和烽火OLT设备FiberHome AN5516-04（使用APSB35123CDL20）对连，无法link，通过设备读取模块信息正常，DDM正常（Bias：14.5mA，Tx_PWR：-6.03dBm，Rx_PWR：-13.56dBm）。', '千兆20km BIDI模块总共发了三次，第一批次和第三批次都正常，第二批次的53出现故障，猜测是BOSA问题。', '序列号范围：S1T53251002101-2110', '0', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('99', '2015-08-07', 'Allen', 'AXENTEL TECHNOLOGIES Pte.Ltd', '010-Axentel-A', 'APS31123CDL10 2pcs+另外一个订单的一百多支', 'Cisco', 'ME-3600X-24FS-M', 'Aug  3 02:40:43.253: %GBIC_SECURITY_CRYPT-4-VN_DATA_CRC_ERROR: GBIC in port 1 has bad crc&lt;br /&gt;*Aug  3 02:40:43.253: %PM-4-ERR_DISABLE: gbic-invalid error detected on Gi0/1, putting Gi0/1 in err-disable state', '我司兼容码不兼容此款交换机', '正在询问客户那是否有能在此款交换机上正常使用的模块，以便我司分析', '1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('100', '2015-08-11', 'jiqi', '蓝汛投标', '不详', '共19种样品', 'Cisco/H3C/HWI/ZT', '各类', '送样的19种产品，有10种被判定不合格', '客户无明确标准，部分优良的指标仍被判不良。仅外购X2属于我司无法测试的，对方判定灵敏度低。', 'NULL', '0', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('101', '2015-08-26', 'jiqi', '上海科光', '2015/5/1', 'APSC47253CDL80', 'ZTE', 'SDH分析仪', '2.5G-80Km-CWDM，L波段产品，在SDH分析仪上测试有极少误码。测试环境为常温短纤加衰减。数量50pcs左右，不良率60%以上，误码率10E-12以下。', '25L95方案眼图质量一般，带宽相对不足。具体尚待分析', '', '0', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('102', '2015-08-24', 'zhouheng', '上海博达', '20150730SHBD-CS', 'APS55123CDL80', '不详', '不详', '4pcs APS55123CDL80样品模块，在博达测试其中1pcs有丢包。', '怀疑可能与发端眼图都抖动稍大，或者是接收端宜鹏ROSA不线性导致。模块退回后测试常温收端端指标均正常，将接收端ROSA由宜鹏更换为麦特达，用itester在1000M速率下,帧长64/1518交替发，带80km光纤测试15H，无丢包也无错误帧。', '新更换麦特达ROSA样品本周内发出，等待后续测试结果', '0', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('103', '2015-08-31', 'pangkunyang', '成都必合科技', '不详', 'APSP55HM3CDL40', '爱立信', 'RRUS 13B3A', 'SFP+_ER/ZR无法使用于RRU设备。但低速和短距均无异常。目前已知1856，UX3320，7023无法使用。原装模块为10G-LTE', '经反复测试验证，确定为功耗问题。最大支持300mA左右的功耗。', '', '0', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('104', '2015-09-01', 'Daniel', 'FOSS', '无', 'XFP SR', 'Cisco', '不详', 'Oper State: Down;&lt;br /&gt;Pluggable Module optical receiver power out of range;&lt;br /&gt;SFP or XFP optical transmit power out of range', '可能是DDM监控值超出了warning/alarm阈值。', '客户使用的8G FC设备', '1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('105', '2015-09-01', 'Daniel', '3KV', '无', 'SFP 155M 2km', 'Cisco', 'C3750', '设备提示not supported，端口down掉。', '客户想要的是GLC-GE-100FX，公司只有GLC-FE-100FX的码，而3750并不支持GLC-FE-100FX，所以设备报错。', '', '1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('106', '2015-09-02', 'Daniel', 'Optocon', '无', 'QSFP+', 'DELL', 'Force 10 S6000', 'QSFP modules do not work with the switch firmware FTOS 9.8;&lt;br /&gt;QSFP modules work fine with the switch firmware 9.6.', '可能是设备升级固件后，采用了新的兼容验证规则。', '', '1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('107', '2015-09-02', 'jiqi', '上海科光', '无', 'SFP 1.25G 120km', 'Cisco', 'WS-C3750X-24T', '功率计实测模块不发光', '可能未写思科码，导致端口down掉。', '客户直接联系的Jim。', '-1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('108', '2015-09-01', 'Jonas', '保加利亚IC Intracom', '无', 'QSFP+ SR', 'Cisco', 'Nexus 5672', 'Transceiver on interface Ethernet2/2 is not supported.', 'QSFP的模块写C码后在品质的Nexus 3000上是正常工作的，估计5000系列和3000系列的规则有些不同。', 'QFC85T53200001-03, QRSR4348000026', '1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('109', '2015-09-09', 'wangli', '广州汇信特', '20130517HXT-RMA/20130607HXT-RMA', 'SFP+ZR DWDM C32/C36', 'H3C', '10508', '“模块在华三10508交换机上无法读取光衰减”', '客户说的“无法读取光衰减”应该是读取不到DDM，可能是客户修改A0时改动了A2H0。', '客户序列号：H1508310002/H1508310005&lt;br /&gt;出厂序列号：1306050001/1306050003', '0', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('110', '2015-09-10', 'lvjianqiao', '浩瀚深度', '20150720HHSD', 'AP-ST1', '恒为', '不知', '在恒为设备上测试，只要模块对应端口配置到千兆，不接网线link灯就正常。', '1.由于电口2在内部流量分析NuStreams测试，不接网线link也正常，需确认是否发错为电口2。&lt;br /&gt;2.可能电口1与恒为设备存在兼容性问题，需验证确认。', '', '0', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('111', '2015-09-14', 'jiqi', '上海科光', '无', 'SFP+ ZR', '博达', '无', '1pc ping包不通，业务灯不亮。', '可能模块光口性能出现故障。', '客户直接联系的Jim。序列号STT55852300028/29，客户想把出厂时候写的T码改一下，兼容最终客户的H3C S5500-28F-EI/S5500-28F-EI，经过远程改了过后先在自己的博达交换机上ping包测试，发现不通。', '1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('112', '2015-09-06', 'Nick', 'Microscan', 'Sample001-Microscan-A', 'APX55HM0CDL80 2pcs', 'ECI', 'AS9216', '“客户反馈可以通，但是读不到数据。”', '第一次遇到ECI的兼容问题，可能是码不对。', '', '1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('113', '2015-09-17', 'Allen', '泰国客户', '024-NI-A', 'AP-ST2', 'HP', '51201920', '5120上面能检测到，但是不能建立连接；1920说是可以识别，但是在还没有接线只插入模块的时候，交换机端口就up了。', '现象很奇怪，能检测到说明码没问题，已经被设备识别，怀疑是测试方法不对或者用错了电口模块，应该是AP-ST1，一切还需要进一步沟通才能确定。', '', '1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('114', '2015-09-16', 'jiqi', '北京森华易腾', '20150810SHYTL', 'APSPD53HM3CDL80/APSPD55HM3CDL80各1pc', 'H3C', '10508', 'dis tran di int ten 1/0/16  Error: The transceiver does not support this function.', '无法读取DDM，一般是A2H0没写对。', '同一批次其他通道都正常，只有C53和C55两支无法读取DDM。', '0', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('115', '2015-09-09', 'Thomas', '3KV', '355-ATOPEU-A', 'SFP+ SR', 'Cisco', 'Catalyst 4500', '*Sep  5 14:34:28.121: %GBIC_SECURITY-4-UNSUPPORTED_GBIC_INSERTED: Unsupported transceiver inserted in port 400&lt;br /&gt;*Sep  5 14:34:29.169: %GBIC_SECURITY-4-UNSUPPORTED_GBIC_INSERTED: Unsupported transceiver inserted in port 401&lt;br /&gt;*Sep  5 14:37:53.853: %GBIC_SECURITY-4-UNSUPPORTED_GBIC_INSERTED: Unsupported transceiver inserted in port Te1/1/2', '根据下面客户发回的设备版本信息，这台4500使用了思科最新的IOS XE系统，可能是新系统更改了兼容规则。&lt;br /&gt;Switch&gt;sh version&lt;br /&gt;Cisco IOS Software, IOS-XE Software, Catalyst 4500 L3 Switch  Software (cat4500e-UNIVERSAL-M), Version 03.07.02.E RELEASE SOFTWARE (fc1)&lt;br /&gt;Technical Support: http://www.cisco.com/techsupport&lt;br /&gt;Copyright (c) 1986-2015 by Cisco Systems, Inc.&lt;br /&gt;Compiled Wed 22-Jul-15 01:45 by prod_rel_team', '该订单总共457pcs，Thomas发回来4pcs码，分别是rpa5330182，rpa5330208，rpa5330372和rpa5330493', '1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('116', '2015-09-16', 'Allen', 'JPC', '004-JPC-A', 'APSB35123CDL20', 'Cisco', '891F Router', '读取不了模块信息在思科路由器上。', '可能是码的问题', 'S1T35251200302', '0', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('117', '2015-09-29', 'jiqi', '上海科光', '无', 'SFP+ ER CWDM 1470/1490', 'Huawei', 'BBU/RRU', '在设备上业务不通，同批次其他波段正常。', '由于其他波长是OK的，排除写码问题，猜测是端面或者光纤导致收光过小。', '', '1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('118', '2015-09-25', 'jiqi', '上海科光', '无', 'XFP LR', '科光', 'OPTW3000', '在客户的自制设备上告警。', '可能是功率超出阈值设定范围，需要读取DDM看看。', '', '1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('1118', '2015-10-09', 'Nick', 'GOIP', '003-GOIP-A', 'APSPB23B33CDL60 & APSPB32B33CDL60 10pairs', '不详', '不详', '模块插入交换机无法工作，但能读取DDM，DDM显示电压2.7-2.8V范围，RX监控正常', '交换机光口带负载能力不足导致。我司常规BIDI60Km模块，功耗在350mA以内，电压监控准确。&lt;br /&gt;判定为设备自身问题。', '', '1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('1119', '2015-10-09', 'Nick', 'Microscan', '携带免费样品', 'APX55HM0CDL80 2pcs', '不详', '不详', '其中1pcs正常，另外1pcs出现RX异常。疑似APD被击穿导致。', '根据客户提供的测试信息，推断是在实验室环境使用网络流量分析仪进行测试。&lt;br /&gt;或许测试时RX接入光功率过大，导致APD击穿。', '', '1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('1120', '2015-10-10', 'henry', 'Telnet', '345-351-370-384-ATOPEU-A', 'XFP/SR/LR/ZR', '暂未知，应该是客户自己系统', '暂未知', 'out of spec； CRC error&lt;br /&gt;In usual scenarios of 10GbE LAN applications presented  in circuits point to point which 4 modules of other manufacturer don’t get any trouble,  yours, however, don’t work the same way (CRC errors are generated). All the signal levels are respected. The modules are not able to make a proper regeneration.  &lt;br /&gt;&lt;br /&gt;Conclusions: specs are quite limited for this solution and don’t comply minimum requirements to make it work', 'xxxxxxxxxxxxxxxxx', 'xxxxxxxxxxxxxxxx', '1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('1121', '2015-10-13', 'wangli', '上海恒为', '不详', 'APSP31B33CDL10', '恒为', '不详', '出现数次APC失锁、模块异常等。', '肖艾佑分析得出，为旧PCB电源树磁珠损坏导致。其他也有类似原因造成的客诉。', '旧PCBA存在严重风险，因尽快切换。', '0', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('1122', '2015-09-24', 'Nicolas', '巴西Optitel', 'Sample 001-Optitel-A', 'SFP+ BIDI 40KM', 'Cisco', 'ME3600', 'The modules temperature was measured by the testing equipments namely a  CISCO ME3600 and  DELL 6224F . When modules got out of testing equippment they were very hot , almost “ boiling “ ...&lt;br /&gt;Modules have been tested in a laboratory , over a working bench . Average equipment ( environment  ) temperature was 24 Celsius degrees  .&lt;br /&gt;Those modules ( which they usually use ) temperature was measured and results showed only 35 to 45 Celsius degrees .', '客户反馈我司的模块工作一段时间后，DDM显示60-70度，摸起来烫手，而正常使用的别家模块没有这个问题。初步判断是出厂时校准温度偏高导致，需要远程修改校准系数。', '4pcs SFP+，2pcs XFP LR', '1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('1123', '2015-11-05', 'jiqi', '北京森华易腾通信技术有限公司', '20150810SHYTL', 'APSPD56HM3CDL80', 'H3C', 'H3C/10508', '在2015年11月3日14点左右时，森华易腾这边两个机房间有一条链路中断，使用的是我司万兆80KM的波分模块，波分模块通道是C56。森华易腾机房运维反馈测试如下：自环测试模块无法UP，不更换端口使用其他模块自环可以UP，把c56模块换到设备的其他端口自环也无法up。模块sn分别为：STH56853100001 、 STH56853100008   /  之后再11月5日本人到客户机房去进行模块测试，在H3C其他的设备上跑自环是没有任何问题的，此类事件，不止发生一次了，请研发部同事协助彻查此项问题，谢谢！模块本人11月5日会安排寄回我司！', '个人觉得有可能是模块在工作中过热或者发光功率过大，导致模块直接停止工作，在模块温度散出后，又可正常恢复工作？（此项建议仅供参考，纯属个人判断）', '', '0', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('1124', '2015-11-05', 'jiqi', '北京世纪互联数据中心有限公司', '20150826SJHL', 'APSPD32HM3CDL40/APSPD33HM3CDL40', '华为', '6800', '我司的产品在插在客户的机房设备中，同一批模块中出现部分模块无法读出DDM，收发光功率信息，此次供货108支波分模块出现16支无法读出DDM信息的情况，还有就是，有部分模块在客户本地设备验证的时候，可以读出DDM信息，但是拿到机房去使用，就无法读出DDM信息了，此种情况也是出现多次了，请给与答复，谢谢！', '本人去客户那边给客户解决，通过前几次的经验发现，出现无法读出DDM收发光功率的所有模块都可以正常工作，唯独无法看到信息，解决办法就是把同一批的模块内部的码从新往损坏的模块里面拷贝一下就可以了。', '', '0', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('1125', '2015-11-09', 'wangli', '上海欣诺', '送样样品', 'APSP85B33CDL03', '欣诺自制板卡', '不详', '板卡电压3.52V，SR模块出现RX监控暗电流较大，DDM偏差严重。且1/5pcs出现无光不LOS情况。', 'SR的ROSA有问题，在拉偏条件下测试，DDM偏差严重。LOS应是个别TIA对于拉偏出现异常。', '', '1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('1126', '2015-11-12', 'Allen', 'JPC', '009-JPC-A', 'APSP31B33CDL10', 'EXTREME', 'X450', '交换机能检测到模块，但是Tx输出。用光功率计检测无光通过。', '发射端是否失效？', '1只发射端', '1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('1127', '2015-11-04', 'Jonas', 'Serena', '20150928-Sereno RMA', 'SFP+ Passive Cable 1m', 'Cisco', 'ME-3600X-24FS-M', '%PHY-4-SFP_PLUS_NOT_SUPPORTED: The SFP PLUS in Te0/1 is not supported', '之前遇到过几次ME-3600X的客诉，ME系列的兼容规则可能和Catalyst系列不同', '', '0', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('1128', '2015-11-24', 'Bob', 'IPTRADING', '001-IPT-A', 'AP-ST2', 'Cisco', 'C3750', '设备提示不支持', '可能是写码错误', '', '0', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('1130', '2015-11-24', 'bob', 'ASONE', '020-ASONE-A', 'APX55HM0CDL40-15pcs;APX55HM0CDL80-20pcs', 'Alcatel-lucent', '7210-SAS-T', '模块在7210-SAS-R6 上可以使用，但是在7210-SAS-T上无法工作。插上设备显示”read error“并且无法读取DDM', 'I2C速率问题', '', '1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('1131', '2015-11-25', 'doris', 'T-2', '398-ATOPEU-A', 'APSP31B33CDL20', 'Extreme', 'x670-x460', '显示unspported，DDM 读取正常', '候羿说可能是码的问题，处理中。', '客户是说LR BIDI是正常的，LR有异常；初始编码是兼容Juniper的， 客户想同时兼容Extreme上，出现异常。', '1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('2131', '2015-12-03', 'wangli', '网宿科技', '不详', 'QSFP+ SR4', 'Ruijie', 'RG-S6220-48XS', '设备提示“transceiver info I/O error!”&lt;br /&gt;客户也在其他设备上测试了：&lt;br /&gt;1，H3C S9804-2135不支持DDM；&lt;br /&gt;2，IBM G8316/G8264T提示未授权，不支持DDM。', '对QSFP产品而言，我们掌握的兼容规则很少，可能是码，对Ruijie设备提示的这个错误，也可能是I2C，均需要设备验证。', '', '1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('2132', '2015-12-11', 'jiqi', '世纪互联', '20150709FYWX/20150909FYWX', 'QSFP-40G-SR4-MM850：QSFP+ 40G光模块850nm,100m,SR4', 'H3C', 'S5820V2-52QF)', '1：我司总共给富杨维鑫发了2批40G的模块，总共64支QSFP/40G/SR的模块产品，订单号为：20150709FYWX/20150909FYWX   （QSFP-40G-SR4-MM850：QSFP+ 40G光模块（850nm,100m,SR4,支持1分4））。&lt;br /&gt;   2：目前产生的主要问题在于，我司的模块在H3C的设备上（型号：S5820V2-52QF)无法读出收发光功率信息。（模块基本工作情况：可以正常的进行通光工作，能识别出厂家信息与模块的基本信息。）&lt;br /&gt;   3：客户处前期已提供过两只H3C原厂40G/850nm的模块给我司进行检测，但是经过研发多方面的去尝试，都还是无法解上述发现的问题。', '不确定具体原因', '', '0', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('2133', '2015-12-11', 'wangli', '网宿科技', '20151021WSKJ-CS', 'SFP+ LR/SR', 'H3C', 'LS-5820X-28S/S5500-52C-EI', '不支持DDM，无法查看光功率等信息。&lt;br /&gt;另外IBM G8000提示未授权；&lt;br /&gt;DELL Force10 S60有警告信息；&lt;br /&gt;广达LB4M能使用，无法查看模块信息。', 'H3C是典型的未写码，其他几个厂商暂时无法确定，根据经验判定也是需要写特殊兼容码。', '', '0', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('3131', '2015-12-25', 'Jonas', '印度OL', '无', 'SFP+ ER CWDM', 'Huawei', 'S5700-28X-LI-24S-AC', '1, DDMI information are not supported by SFP module randomly.&lt;br /&gt;2, In huawei switches, we are getting certification error logs for all ONPL CWDM SFP modules.', '1，可能是写码问题；&lt;br /&gt;2，华为设备是有警告信息，不过不影响使用。', '', '0', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('3132', '2016-01-12', 'Allen', 'MinusIT', '004-MinusiT-A', 'APS31253CDL20-10只/APS31013CDL20-20只', 'Alcatel-lucent', '1622/1678', '阿朗设备不能读取模块类型等信息，不能进行设置。客户使用的板卡是：3AG24175AA(1678)  3AL98038AD(1662)', '估计是写码不对，因为同一批次的622M 模块可是在客户设备上使用', '', '1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('3133', '2016-01-12', 'Allen', 'DPIT', '004-DPIT-A', 'APSP85B33CDL03', 'Arista', 'DCS-7050SX-64-F/DCS-7010T-48-F', '连接好两台设备后,Arista端口显示Err-disabled 以及错误信息：xcvr-unsupported.  Arista 交换机的软件版本是4.14.7m', '初步估计是码的问题，但是Arista比较奇怪因为尝试过源码拷入还是不能兼容', '', '0', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('3134', '2016-01-05', 'Jonas', 'Netpatible', '398-ATOPUS-A', 'SFP+ LR', 'HP', '5406zl', 'These units were originally installed while switch was running.After the switch rebooting, it failed to come up and provided an error on the 10 gigabit transceiver all fail the self-test.', '一开始正常工作，设备重启后，提示自检失败。猜测是重启时初始化时序问题。', '60pcs', '1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('3135', '2016-01-14', 'henry', 'S韒af閘agi', '458-ATOPEU-A', 'XFP ZR 80km多速率', 'Alcatel', 'Alcatel 7210 SAS-T,  7210 SAS-M', 'XFP ZR在Alcatel 7210 SAS-M上能工作，但在7210 SAS-T上不能识别。', '怀疑是硬件方面的问题。', '出过几次类似问题，都还未解决', '1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('4135', '2016-02-24', 'Allen', 'JPC', '014-JPC-A', 'APSC47253CDL80', 'Dowslake', 'CLCT', 'CLCT是DOWSLAKE的网卡，插上模块检测不到。但是1G的模块可以使用，确认是没有码的设备。', '初步认定是芯片方案问题，2.5G CWDM 用的是95方案，1G是91方案。', '', '1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('4136', '2016-03-02', 'Bob', 'ASONE', '无', 'SFP+ LR 130pcs', 'Juniper', 'EX8208, EX3300', '据客户反馈有50～70pcs 随机出现link down 1秒，然后又up，重复出现。', '情况不明，怀疑是长纤导致收光临界。', '', '1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('4137', '2016-03-10', 'jiqi', '世纪互联', '无', 'SFP+ SR', 'H3C', '未知', 'ordering name显示SFP-GE-LX-SM1310-A', 'H3C兼容需要写入A2H0，不同的产品类型A2H0也不同，目前手上只有SFP LX的A2H0，所以一直出货都是写的这个，以前出货的客户也并未关系这里，以至于现在重要客户出货时就疏忽了。需要从原厂模块或者其他厂商的兼容模块拷码即可解决。', '', '-1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('4138', '2016-03-15', 'Jonas', '印度Optilink', '无', 'SFP+ ER CWDM', 'Optilink', '未知', '[2016-03-15 18:13:01] vinit.savla1: at clients location we have given them 4 pairs 1490-1470 nm&lt;br /&gt;[2016-03-15 18:13:21] vinit.savla1: it works well for a while when temperature is 40-50 degrees&lt;br /&gt;[2016-03-15 18:13:42] vinit.savla1: but after a while it shoots upto 60-70 degrees and ping drop starts', '可能是功耗太大，导致温度上升过快挂掉', '', '1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('4139', '2016-02-19', 'Jonas', 'Bezeq(以色列电信)', '无', 'XFP LR', 'Alcatel', '1830-PSS', '在设备上能读到模块信息，无法link', '根据Jonas的邮件描述，“当时客户要的是850 2km的产品，我接了订单才意识到850做不到2km，于是就出的1310的产品写的2km的EEPROM，可是发过去不能用”。不确定LR在多模光纤上传输是否能link。', '', '1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('4140', '2016-04-07', 'jiqi', '无', '无', 'SFP+ ZR DWDM CH32 2pcs', 'H3C', 'S12508', '1，在设备上无法读取DDM信息；&lt;br /&gt;2，写码后发现DDM显示温度125度，Bias电流和Tx_PWR为0，Rx_PWR显示-5dBm。', '不能读取DDM是因为下单时没有要求写H3C码，出货写的是T码。', '', '1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('4141', '2016-04-13', 'pangkunyang', '北亿纤通', '无', 'XFP ER DWDM CH23', 'ZTE', 'ZXONE8300', '设备显示“非特定波长”', '可能对码有特殊定制', '', '1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('4142', '2016-04-09', 'lvjianqiao', '光润通', '无', 'SFP+ SR', 'Huawei', 'S5720', '客户反馈不能使用，后来经过验证，应该是有告警信息。', '光润通苗总发回的码显示，A2H0有大量加密信息，初步判定是有加密要求。', '', '-1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('4143', '2016-02-19', 'Daniel', 'Denmark television', '无', 'SFP+ LW 8G FC', 'Cisco', 'DS-X9448-768K9', 'Daniel反馈3pcs SFP+ LW模块，序列号分别是STC31152000344、STC31152000392和STC31152000314，其中44提示“sfp read error”。', '需要更多信息分析', '', '1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('4144', '2016-04-22', 'Jonas', 'ATG', '无', 'SFP+ LR', 'Juniper', '主机MX960，板卡MPC4E-3D-2CGE-8XGE', '1，插入超过6pcs LR模块后，板卡停止工作；&lt;br /&gt;2，插入6pcs ATOP的LR和另外2pcs原装LR，一切正常；&lt;br /&gt;3，插入8pcs原装LR，一切正常。', '怀疑是功耗或者I2C上拉电阻的问题。', '', '1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('4145', '2016-04-28', 'pangkunyang', '成都艾普', '20140603ZHTX', 'XFP BIDI 40km', 'Cisco', 'ASR 9000', '客户反馈不能使用。', '估计是写码，前期已出现过类似问题。', '客户退回5pcs，标签序列号如下，括号内是E方SN。&lt;br /&gt;XF32444800001 (1410291385)&lt;br /&gt;XF23442300010 (XF9633D53)&lt;br /&gt;XF23441300005 (XF9627U45)&lt;br /&gt;XF32442300004 (XF9627U54)&lt;br /&gt;XF32442300007 (XF9627U60)', '1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('4146', '2016-06-06', 'Jonas', 'carelink', '无', '155M SFP BIDI 20KM', 'Alcatel Lucent', 'OmniSwitch 6450', '设备读出来端口速率显示1G', '可能是写错码导致', 'S0AL53261300171', '0', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('4147', '2016-06-28', 'Henry', 'Optocon', '663-ATOPEU-A', '8G SFP+ CWDM40km', 'Brocade', '6510/5000', '显示不兼容', '可能是码写错', '1511nm/1531nm 各2pcs', '1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('4148', '2016-07-07', 'Jonas', '未知', '548-ATOPUS', '2.5G DWDM 80km', 'Cisco', 'ASR9001等', '21pcs中有9pcs在ASR9001上自环测试失败，其中有两支在所有设备都测试fail。', '客户提供的信息较少，暂时无法分析', '设备型号很多，详见客户发回的表格截图。', '1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('4149', '2016-07-06', 'Henry', 'Levira', '699-ATOPEU-A', 'XFP CWDM 1570NM 40km 2支', 'Transmode', 'TM301', '&quot;The inserted transceiver does not have a legal manufacturer code. / Non-qualified transceiver/&quot;.&lt;br /&gt;XFPs do not provide any information about the Tx and Rx levels.', '初步分析是码的原因导致没有通过设备验证。', '', '0', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('4150', '2016-07-15', 'Jonas', 'FURUKAWA', '未知', 'APXD21HM0CDL80', 'FURUKAWA', 'CMTR10', '1, Stabilisation time during the star extrema high and invading adjacent bands.&lt;br /&gt;2, Did not respond to DDM.', '1，客户反馈模块上电后到发光稳定的时间太长，这个可以更改为快发光模式；&lt;br /&gt;2，无法读取DDM信息，可能是MOD_DESEL管脚上拉电阻的问题，需要进一步确认。', '', '1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('4151', '2016-07-14', 'lvjianqiao', '鹏博士江门分公司', '20160615PBS-JM-CS', 'XFP ER', '格林伟迪', 'GFA6900', '1，SFP+ ER用在华为设备上，XFP ER用在GFA6900上对传，不通；&lt;br /&gt;2，XFP ER在GFA6900上自环测试不通；&lt;br /&gt;3，在GFA6900上读取DDM信息，显示一直是40度、3.3V、15mA、-5dBm、-5dBm不变。', '需要到现场具体测试才能分析。', 'SFP+ ER和XFP ER各两只', '0', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('4152', '2016-07-19', 'lvjianqiao', '浩瀚深度', '20160614HHSD-CS', 'LX/SX', '浩瀚深度', '无', 'LX和SX模块在设备上读出来的监控都是发光：1.18dbm，温度：67.68度。', '初步怀疑是EEPROM被写乱了，需要拿写码板到现场分析。', 'LX和SX各2pcs', '0', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('4153', '2016-07-15', 'jiqi', '观云网络', '未知', 'SFP+ ZR', 'H3C', 'S5820-32QF', '一开始使用正常，晚上突然down，客户描述的现象是：就是A端有发光，B端也收的到，但是B端没有发光，A端收不到光，然后B端模块插拔就恢复了。B端设备型号：H3C S5820-32QF。A端设备型号：锐捷RG6220', '暂不清楚是否模块出现了告警导致端口down掉。', '', '1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('4154', '2016-07-18', 'jiqi', '世纪互联', '20160606SJHL-SH', 'SFP+ ZR', 'H3C', '12508X-AF', '1，C3机柜的12508X-AF的2/0/1端口出现不断翻转，更换模块后恢复。&lt;br /&gt;2，C4机柜的12508X-AF的2/0/1端口出现发光功率低导致端口down，插拔模块后恢复，但是时常无法读取光功率。', '查看日志发现在1秒内频繁up down，需要进一步分析。', '', '1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('4155', '2016-08-08', 'jiqi', '旦瑞电信', '20160801DRDX', 'APSPC53WM3CDL70和APSPC55WM3CDL70各2pcs', 'Huawei', 'S5700', '设备读取模块监控信息，门限都是0', '可能I2C时序出现问题，或者模块的EEPROM被误修改。', '之前也出现过SFP+长距产品在H3C和Huawei设备上信息错误的问题，写保护后正常。这次可以通过这个事情测试一下SFP+长距产品在H3C和Huawei设备上的时序。', '1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('4156', '2016-08-19', 'Nick', 'GoIP', '010-GoIP-A', 'DWDM SFP+  40km / 80km', 'Huawei', 'S6720', 'DDM监控值很大', '怀疑是和前期出现的DDM监控跳变一样，由于APD电压串扰影响MCU的ADC。', '', '0', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('4157', '2016-08-26', 'Nick', 'Microscan', '003-Microscan-AB', 'SFP+ ZR DWDM', 'Ciena', '5160', 'Many Times Link went down due to SFP’s failure, but same SFP’s start working after cooling them for some time. SFP’s are heating Too High.', '可能是前期产品散热不好，高温不良导致', '', '0', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('4158', '2016-08-23', 'lvjianqiao', '北京浩瀚深度信息技术股份有限公司', '20160805HHSD-CS(没录单，杨培云领料制作)', 'APSP31HM3CDL10', '浩瀚深度', '--', '客户对我司8只模块做级连测试，不通，报LOS。', '对比了WTD的模块，初步怀疑是收端输出幅度和预加重不够导致传输丢包。', '--', '0', '0', 'Y', 'new', '8', '3', '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('4159', '2016-09-18', 'Bob', '以色列代理', '007-BYNET-A', '10G SFP+ SR 和SGMII 电口模块', 'Cisco', 'Nexus 9000 switch and Nexus 3000 switch', '读取到ATOP模块是 type unknown。', '可能是没有写C码', '', '-1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('4160', '2016-09-23', 'Gary', 'VPLS', 'PO 537-ATOPUS', '10G SFP+ DWDM 40KM 80KM', '--', '--', '模块可以被设备识别，但是部分模块不发光。', '怀疑是EML TEC失锁导致不出光。', '', '0', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('4161', '2016-09-21', 'Jonas', 'ATG', '126-ATG-A', 'SFP 1.25G 1550nm 120KM EE写160KM', '--', '--', '客户对一些模块信息有疑问', '暂不确定客户截图的来源，需要进一步沟通', '', '0', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('4162', '2016-09-15', 'Jacob', 'SIP', '799-ATOPEU-A', '1pair XFP BIDI 40KM', 'ALCATEL', '--', '对传不通，出现link flapping现象。', '这批模块有两个问题，一是TX极性设置反了，二是TO有用海光芯创的会有性能问题。但是针对你flapping情况，应该是有误码丢包，怀疑是第二种原因。', '', '0', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('4163', '2016-10-08', 'allen', 'JPC', '017-JPC-A', 'APX31HM0CDL10', 'ALCATEL-LUCENT', '1626LM, 167MCC', '阿朗设备不能识别模块，不兼容', '估计是兼容码的问题。', '', '1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('4164', '2016-10-08', 'Allen', 'PBT', '004-PBT-A', 'AP-ST2', 'Cisco', '4507R+E', '模块插入设备可以识别找到，但是连接电脑后用命令查看端口显示未连接。', '暂时不能确定是兼容码还是其他问题', '', '1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('4165', '2016-10-08', 'allen', 'CO', '031-CO-A', 'APXB32B30CDL20', 'Cisco', 'ASR', 'ASR设备不能识别模块。', '有可能是码的问题，也有可能是发端反向的问题。需要和客户进一步确认', '', '0', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('4166', '2016-09-21', 'Jonas', 'Archion', '476-ATOPUS-A', 'QSFP+ SR4 cosemi方案', 'Chelsio', 'T580-CR', 'We have inserted the QSFP+ in dual Chelsio 40gb card in a client and in our storage and connected with 40gb cable and it does not link. We remove one of the QSFP+ and reseated it and then it linked. Once it is linked it will stay that way until the system is shutdown.  On a cold start the QSFP+ sometimes will link and sometimes it doesn’t.', '可能是上电初始化时序或者driver初始化不正常', '4pcs', '-1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('4167', '2016-10-25', 'jiqi', '世纪互联', '20151016SJHL', 'APSP55HM3CDL80', 'Huawei', '9703', '读取模块信息显示乱码', '初步判定是和之前Huawei 6700类似，设备没有按照协议要求来访问I2C，老版本固件在150ms内未完成初始化，所以造成时序混乱EEPROM被误修改。', '20pcs，其中一支序列号为STT55854100002，模块日期显示2015-10-20', '1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('4168', '2016-10-19', 'Henry', 'Lightron', '015-LIGHTRON-A', '10G CWDM SFP+ 1471/1511/1531/1551/1571nm', '--', '--', '1, TX RX不工作，DDM正常;&lt;br /&gt;2, CWDM波长偏移过大，超过6.5nm;&lt;br /&gt;3, 端面刮花。', '1, DDM正常是因为FW是以寄存器输入的DAC值做推算，TX RX不工作可能是光器件损坏；&lt;br /&gt;2, 波长测试不一致可能是客户的测试仪器有误差；&lt;br /&gt;3, 因为做了加测，怀疑是加测后漏掉了端面清洁。', '', '0', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('4169', '2016-10-10', 'liudongfang', '一通光电', '无', 'APXD32HM0CDL40', 'Huawei', 'S5624F', '能读到A0信息，无法读取DDM监控', '暂不清楚是否这款Huawei设备有特殊的兼容要求', '1pc', '0', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('4170', '2016-10-24', 'jiqi', '铜牛信息', '20161008TNXX', 'SFP+ ER', 'Cisco', 'WS-C3750X-12S, C3KX-NM-10G', '用show int status命令显示端口err-disabled', '可能是模块未写Cisco码导致', '2pcs', '1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('5166', '2016-10-11', 'Henry', 'VS', '571-ATOPEU-A', 'APSB35123CDS40 APSB53123CDS40', 'Cisco', 'WS-X4612-SFP-E, IOS 15.2(2)E5', 'tx power -2.4dbm，tx power warning -3dbm，触发报警', '模块是40km的模块，发端出光-2.4dbm，但是tx power warning 报警门限被设备定为-3dbm，而不是EE里设定的1dbm。', '--', '0', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('5167', '2016-11-14', 'Allen', '马来西亚DGB', '007sample-DGB-A', 'SFP 1511nm CWDM 40KM', 'Ciena', 'Ciena OSC card', 'RXDDMI上报比真实收到的光小10dbm。', 'code不支持，导致ciena设备会改写我司模块上报的值。', '', '-1', '0', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('5168', '2016-11-16', 'lvjianqiao', '格林威尔', '20160927GLWE-CS', 'APS31063CDL20', '格林威尔', '--', 'IIC低电平电压太高', '芯片内部有上拉电阻，客户是满载测试，电阻并联减小后导致上拉太强。', '', '1', '0', 'N', 'new', null, '3', '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('5169', '2016-10-19', 'lvjianqiao', '江门鹏博士', '--', 'APSP55HM3CDL40-HW  APX55HM0CDL40-HW', '格林伟迪', 'GFA6900', '无法识别我司模块', 'code不对或者硬件上mod_del设置不对', '', '0', '32', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('5170', '2016-11-16', 'henry', 'Veracomp', '未知', 'AP-ST2', 'Fortigate', 'Fortigate 300D', 'AP-ST2不工作，不兼容', '可能是设备只能识别AP-ST1纯千兆电口，发纯千兆电口过去测试', '', '0', '42', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('5171', '2016-11-29', 'henry', 'Lightron', '015-LIGHTRON-A', 'APSPC51HM3CDL40', 'N/A', '--', '发端眼图测试太毛', '光器件本身性能导致', '', '1', '32', 'Y', 'new', '8', '3', '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('5172', '2016-11-11', 'mitty', '孟加拉Bangladesh', '--', 'QSFP 40G APQPLR4CL1AA and XFP ZR', '--', '--', 'QSFP&nbsp;40G&nbsp;RXDDM没有上报；<br />XFP&nbsp;ZR传输不通。', 'QSFP&nbsp;40G&nbsp;怀疑是没有做收端校准；<br />XFP&nbsp;ZR可能是器件问题，TEC失锁导致。', '', '1', '32', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('5173', '2016-12-06', 'jiqi', '安畅网络', '20161130ACWL-CS', 'APSP85B33CDL03', 'H3C', '路由器SR8803-X-S，单板SR07SRPUD3', '无法连接，LED灯不亮，但是在其他业务板上正常，不能使用的这个是主引擎。', '如果在其他H3C设备能用，只在这个单板不能用，可能H3C在主引擎上有不同于其他设备的兼容要求。', 'STHC85S64600001-8', '0', '30', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('5174', '2016-12-13', 'jonas', 'Lightem', '128-129-132-134-Lightem RMA', 'APSD36123CDL80', 'Juniper', 'Unkown', '此客诉为退换货再次客诉，原单客诉原因是批次模块在交换机上持续运行48小时候，在温度达62度后发端停止运行。客户退回3pcs我司检测并发起FAR（1606001），发现3pcs确实如客户反馈并得出结论为TEC高温失锁，根源原因分析是产品散热不良，导致TEC高温失锁，造成内部组件损坏。解决措施是更换新结构件并验证了散热效率的提升。<br />客户收到此FAR，再三犹豫后，更换了所有采购的产品，而我司也于10月底补货完成。<br />客户收到在替代过程中发现一只36chn（S1JR36B63700001），一只28chn（暂时不明）.&nbsp;皆为新外壳产品，failing，无更详细原因。', '业务分析高温失锁问题仍未解决', '', '1', '41', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('5175', '2016-12-06', 'jonas', 'Spirent', '--', 'CFP2 ', 'unknow', 'unknow', '1，温度DDM太高；<br />2，冷启动失效；<br />3，发端出光偏小。', '1，温度校准问题；<br />2，待定，需要客户配合提供失效时是否能读取模块信息；<br />3，正常，在要求范围内。', '', '1', '32', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('5176', '2016-11-15', 'jonas', 'AddOn', '无', 'APSP85B33CDL03', 'Brocade', 'ICX6610', '在ICX6610上提示“error&nbsp;in&nbsp;clearing&nbsp;up&nbsp;9548#0”，在其他的Brocade设备上正常。', '我们的Brocade码实际上只在Brocade&nbsp;300这台设备测试过，这是用在存储网络中的，是FiberChannel类型。而ICX6610我查了下，是一台普通的园区交换机，应该是以太网类型。<br />&nbsp;<br />我看了下Patrick发的测试log，显示能识别到模块插入和拔出，在初始化阶段显示“error&nbsp;in&nbsp;clearing&nbsp;up&nbsp;9546#0&nbsp;”没看懂啥意思。<br />我认为可能有如下两方面原因：<br />1，这个设备可能和300的兼容规则有区别；<br />2，不排除有其他时序匹配的可能性。', '具体数量没说', '1', '30', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('5177', '2016-12-20', 'jonas', 'primuscable', '--', 'AP-ST2', '--', '--', '客户测试10M/100M/1000M，在500M之后出现丢帧。<br />&nbsp;some&nbsp;reason&nbsp;these&nbsp;units&nbsp;are&nbsp;ok&nbsp;until&nbsp;500,&nbsp;but&nbsp;after&nbsp;that&nbsp;there&nbsp;is&nbsp;frame&nbsp;loss.&nbsp;We&nbsp;tried&nbsp;it&nbsp;on&nbsp;2&nbsp;units&nbsp;already,&nbsp;will&nbsp;try&nbsp;on&nbsp;one&nbsp;more。<br />they&nbsp;just&nbsp;said&nbsp;had&nbsp;frame&nbsp;loss&nbsp;after&nbsp;500M', '初步怀疑的失效可能性三个：<br />1，器件的速率支持不支持失效时的速率；<br />2，失效时的速率出现谐振；<br />3，客户测试环境问题。', '', '1', '32', 'N', 'old', null, null, '1');
