INSERT INTO `atop_oacustomercomplaint` VALUES ('5188', '2017-01-20', 'jiqi', '北京京东尚科信息技术有限公司', '20161213JDSK-CS', 'APCO01-SSC030/APCO01-SSC050/APCO01-SSC070', 'Dell.HUAWEI.Inspur（浪潮）.H3C', 'Dell-R630.HUAWEI-1288V3.Inspur（浪潮）.H3C-S5820V2', '司5M的AOC线缆通过HUAWEI-1288V3链接H3C-S5820V2在链接3M的AOC线缆到Dell-R630，按照客户要求测试方法测试吞吐量数值，均在5000+左右的数值，而且，数值跳动的频率很大，数值很不稳定，后续本人通过模块互联，模块2支为我司多模模块，2支为intel原厂多模模块，外加两根千兆多模跳线互联，测试的吞吐量数值均在8500-9000以上（如果服务器A与服务器B单独互联，使用原厂模块，数值均在9000以上，如果使用我司AOC单独互联，数值均在7000左右）。<br /><br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;', '京东的测试负责人沟通，目前京东测试的国内两家AOC线缆，数值均在9000以上，京东的测试人员很肯定的告诉我司，所有的线缆吞吐量必须在9000以上', '', '1', '45', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('5189', '2017-02-06', 'jonas', 'Adtran', '--', 'APXC47HM0CDL70', 'N/A', '--', 'XFP&nbsp;CWDM&nbsp;70KM，客户在做自环测试时加衰减器没有问题，但是带纤测试发现有小误码，而且低温下（-25度）模块没有眼图。', '小误码可能是因为光器件性能临界，没有眼图可能是失锁。', '', '1', '32', 'N', 'new', null, '4', '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('5190', '2017-02-08', 'jonas', 'ATOPUS- Tioptics/Integra RD', '507-ATOPUS', 'APCS43123CDL20', 'ZHONE OPTICS', ' MXK-AEX20-FE/GE-CSFP card', '1)&nbsp;it&nbsp;can&nbsp;not&nbsp;be&nbsp;used&nbsp;in&nbsp;any&nbsp;redundant&nbsp;configuration&nbsp;because&nbsp;there&nbsp;is&nbsp;no&nbsp;pull-up&nbsp;on&nbsp;the&nbsp;TX-DIS_n&nbsp;pin,&nbsp;so&nbsp;it&nbsp;is&nbsp;not&nbsp;operable&nbsp;at&nbsp;present.&nbsp;It&nbsp;may&nbsp;be&nbsp;possible&nbsp;to&nbsp;fix&nbsp;this&nbsp;in&nbsp;a&nbsp;long&nbsp;list&nbsp;of&nbsp;FPGAs&nbsp;to&nbsp;support&nbsp;redundancy.&nbsp;Or&nbsp;it&nbsp;may&nbsp;be&nbsp;necessary&nbsp;to&nbsp;add&nbsp;external&nbsp;pull-ups&nbsp;to&nbsp;the&nbsp;various&nbsp;cards&nbsp;via&nbsp;rework.<br />&nbsp;<br />2)&nbsp;it&nbsp;can&nbsp;not&nbsp;be&nbsp;used&nbsp;on&nbsp;the&nbsp;MXK-AEX20-FE/GE-CSFP&nbsp;card&nbsp;because&nbsp;there&nbsp;is&nbsp;no&nbsp;pull-up&nbsp;on&nbsp;the&nbsp;TX-DIS_n&nbsp;pin&nbsp;which&nbsp;is&nbsp;required&nbsp;to&nbsp;recognize&nbsp;that&nbsp;the&nbsp;SFP&nbsp;has&nbsp;be&nbsp;inserted.&nbsp;It&nbsp;is&nbsp;possible&nbsp;to&nbsp;revise&nbsp;the&nbsp;-CSFP&nbsp;FPGA&nbsp;to&nbsp;accommodate&nbsp;this&nbsp;Titan&nbsp;error,&nbsp;but&nbsp;with&nbsp;a&nbsp;lot&nbsp;of&nbsp;effort.<br />&nbsp;<br />The&nbsp;MSA&nbsp;spec&nbsp;requires&nbsp;an&nbsp;internal&nbsp;pull-up&nbsp;on&nbsp;the&nbsp;TX-DIS_n&nbsp;pin,&nbsp;so&nbsp;Titan&nbsp;is&nbsp;in&nbsp;violation&nbsp;of&nbsp;the&nbsp;spec.<br />', 'no&nbsp;pull-up&nbsp;on&nbsp;TX-DIS_n&nbsp;PIN<br /><br />感觉这个是客诉关键，上述原文没有翻译', '507-ATOPUS&nbsp;200pcs,', '0', '41', 'N', 'old', null, null, '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('5191', '2017-02-08', 'henry', 'Holland Hardware', '--', '', 'Juniper and Cisco', '--', 'SFP+&nbsp;SR&nbsp;&nbsp;(APSP85B33CDL03)&nbsp;coded&nbsp;for&nbsp;Cisco&nbsp;and&nbsp;Juniper<br />When&nbsp;the&nbsp;transceivers&nbsp;is&nbsp;plugged&nbsp;in&nbsp;the&nbsp;switch&nbsp;they&nbsp;are&nbsp;not&nbsp;always&nbsp;detected.<br />The&nbsp;issue&nbsp;appears&nbsp;in&nbsp;several&nbsp;switches,&nbsp;both&nbsp;Juniper&nbsp;and&nbsp;Cisco.<br />&nbsp;When&nbsp;they&nbsp;put&nbsp;the&nbsp;non-detected&nbsp;transceivers&nbsp;in&nbsp;to&nbsp;another&nbsp;card/switch&nbsp;they&nbsp;can&nbsp;sometimes&nbsp;be&nbsp;detected!', '初步怀疑是physical&nbsp;connection&nbsp;issue。<br />金手指端的厚度太薄，金手指金属部分太短。', '', '-1', '32', 'N', 'old', null, null, '1');
