INSERT INTO `atop_oacustomercomplaint` VALUES ('5195', '2017-03-27', 'henry', 'Levira', '无', 'APSD34LM3CDLB2 , APSD35LM3CDLB2', 'Netinsight', 'Nimbra', 'I&nbsp;have&nbsp;plugged&nbsp;in&nbsp;the&nbsp;NetInsight&nbsp;coded&nbsp;SFPs&nbsp;to&nbsp;the&nbsp;Nimbra&nbsp;device,&nbsp;but&nbsp;they&nbsp;are&nbsp;not&nbsp;recognised&nbsp;at&nbsp;all..&nbsp;&nbsp;I&nbsp;have&nbsp;also&nbsp;tried&nbsp;with&nbsp;different&nbsp;cards&nbsp;(STM1,&nbsp;STM4,&nbsp;STM16)&nbsp;and&nbsp;in&nbsp;different&nbsp;devices,&nbsp;and&nbsp;the&nbsp;same&nbsp;outcome..<br /><br />When&nbsp;they&nbsp;were&nbsp;plugged&nbsp;in&nbsp;into&nbsp;the&nbsp;Ethernet&nbsp;slot&nbsp;in&nbsp;Nimbra,&nbsp;then&nbsp;the&nbsp;„NetInsight“&nbsp;coded&nbsp;device&nbsp;was&nbsp;reported&nbsp;to&nbsp;be&nbsp;1000Base..&nbsp;type&nbsp;and&nbsp;basic&nbsp;parameters&nbsp;were&nbsp;also&nbsp;given&nbsp;(e.g.&nbsp;they&nbsp;(ch&nbsp;34&nbsp;and&nbsp;35&nbsp;transceivers&nbsp;are&nbsp;with&nbsp;different&nbsp;vendor&nbsp;name&nbsp;etc))..<br /><br />Also,&nbsp;when&nbsp;it&nbsp;comes&nbsp;to&nbsp;Cisco&nbsp;SFPs,&nbsp;then&nbsp;when&nbsp;I&nbsp;plugged&nbsp;it&nbsp;in&nbsp;to&nbsp;Nimbra&nbsp;device&nbsp;(NetInisght),&nbsp;then&nbsp;in&nbsp;the&nbsp;beginning&nbsp;no&nbsp;DDM&nbsp;readings&nbsp;were&nbsp;given..&nbsp;then&nbsp;we&nbsp;tried&nbsp;in&nbsp;Cisco&nbsp;switch,&nbsp;and&nbsp;it&nbsp;started&nbsp;to&nbsp;report&nbsp;the&nbsp;temperature&nbsp;values.&nbsp;After&nbsp;re-inserting&nbsp;to&nbsp;Nimbra&nbsp;device&nbsp;the&nbsp;DDM&nbsp;readings&nbsp;were&nbsp;also&nbsp;there..<br /><br />I&nbsp;hope&nbsp;that&nbsp;the&nbsp;transceivers&nbsp;are&nbsp;physically&nbsp;OK,&nbsp;but&nbsp;we&nbsp;need&nbsp;to&nbsp;start&nbsp;checking&nbsp;the&nbsp;code&nbsp;then&nbsp;at&nbsp;least&nbsp;for&nbsp;NetInsight-coded&nbsp;things..', '暂时无法确定是否是对码有要求', 'D34是Cisco码，D35是T码，各17pcs', '-1', '30', 'N', 'old', null, null, '1');
