INSERT INTO `atop_oacustomercomplaint` VALUES ('5222', '2017-05-30', 'doris', 'Sensa', 'Not sure', 'AP-ST1', 'Cisco', 'UCS, Nexus 7000 and 9000,  4500x', 'One&nbsp;of&nbsp;the&nbsp;problems&nbsp;text&nbsp;from&nbsp;one&nbsp;of&nbsp;my&nbsp;tech&nbsp;guys:<br />We&nbsp;have&nbsp;seen&nbsp;issues&nbsp;amongst&nbsp;most&nbsp;of&nbsp;our&nbsp;customers&nbsp;who&nbsp;are&nbsp;using&nbsp;the&nbsp;ATOP&nbsp;rj45,&nbsp;most&nbsp;noticeable&nbsp;is&nbsp;that&nbsp;SFP&nbsp;works&nbsp;fine&nbsp;until&nbsp;a&nbsp;box&nbsp;is&nbsp;rebooted&nbsp;and&nbsp;comes&nbsp;up&nbsp;again,&nbsp;then&nbsp;the&nbsp;SFP&nbsp;reports&nbsp;the&nbsp;interface&nbsp;as&nbsp;not&nbsp;connected.&nbsp;The&nbsp;other&nbsp;end&nbsp;however&nbsp;shows&nbsp;as&nbsp;the&nbsp;interface&nbsp;is&nbsp;up.&nbsp;We&nbsp;need&nbsp;to&nbsp;reseat&nbsp;the&nbsp;SFP&nbsp;in&nbsp;the&nbsp;newly&nbsp;booted&nbsp;box&nbsp;to&nbsp;get&nbsp;it&nbsp;working&nbsp;again.&nbsp;So&nbsp;basicly&nbsp;SFP&nbsp;don´t&nbsp;come&nbsp;up&nbsp;unless&nbsp;it’s&nbsp;seated&nbsp;after&nbsp;the&nbsp;box&nbsp;is&nbsp;up.<br />&nbsp;<br />We&nbsp;have&nbsp;seen&nbsp;this&nbsp;in&nbsp;several&nbsp;types&nbsp;of&nbsp;Cisco&nbsp;boxes,<br />&nbsp;<br />UCS<br />Nexus&nbsp;7000&nbsp;and&nbsp;9000<br />&nbsp;4500x<br />&nbsp;<br />Also&nbsp;we&nbsp;have&nbsp;seen&nbsp;the&nbsp;same&nbsp;behaviour&nbsp;in&nbsp;other&nbsp;vendor&nbsp;like&nbsp;Fortinet.<br />&nbsp;<br />Second&nbsp;problem&nbsp;we&nbsp;have&nbsp;seen&nbsp;is&nbsp;that&nbsp;we&nbsp;had&nbsp;UCS&nbsp;box&nbsp;connected&nbsp;to&nbsp;a&nbsp;Nexus&nbsp;9000&nbsp;in&nbsp;a&nbsp;port-channel&nbsp;if&nbsp;one&nbsp;link&nbsp;whent&nbsp;down&nbsp;we&nbsp;got&nbsp;just&nbsp;some&nbsp;of&nbsp;the&nbsp;traffic&nbsp;over&nbsp;the&nbsp;second&nbsp;link,&nbsp;not&nbsp;all.&nbsp;When&nbsp;we&nbsp;changed&nbsp;to&nbsp;genuine&nbsp;Cisco&nbsp;SFP&nbsp;everything&nbsp;worked&nbsp;fine.', '初略分析为硬件问题', '', '1', '90', 'N', 'new', null, '3', '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('5223', '2017-06-09', 'henry', 'Module fiber', 'NA 技术问题咨询', 'APSPB23B33CDL10', 'Cisco', 'SUP6T board of a 6800 chassis', '&quot;I\'m&nbsp;looking&nbsp;for&nbsp;the&nbsp;following&nbsp;Cisco&nbsp;compatible&nbsp;<br />module&nbsp;(10&nbsp;Gbps&nbsp;monomode&nbsp;single-strand&nbsp;10&nbsp;km):&nbsp;1&nbsp;x&nbsp;SFP-10G-BXU-I&nbsp;1&nbsp;x&nbsp;<br />SFP-10G-BXD-I&nbsp;I&nbsp;would&nbsp;like&nbsp;to&nbsp;point&nbsp;out&nbsp;the&nbsp;following&nbsp;2&nbsp;points:&nbsp;-&nbsp;One&nbsp;of&nbsp;<br />the&nbsp;two&nbsp;modules&nbsp;must&nbsp;be&nbsp;integrated&nbsp;into&nbsp;a&nbsp;SUP6T&nbsp;board&nbsp;of&nbsp;a&nbsp;6800&nbsp;chassis.&nbsp;The&nbsp;<br />other&nbsp;end&nbsp;is&nbsp;a&nbsp;SUP7L-E&nbsp;board&nbsp;of&nbsp;a&nbsp;4500&nbsp;chassis.&nbsp;-&nbsp;This&nbsp;type&nbsp;of&nbsp;module&nbsp;exists&nbsp;at&nbsp;<br />Cisco&nbsp;but&nbsp;is&nbsp;not&nbsp;compatible&nbsp;with&nbsp;this&nbsp;SUP6T&nbsp;Supervisory&nbsp;Board.&nbsp;-&nbsp;No&nbsp;need&nbsp;to&nbsp;<br />worry&nbsp;about&nbsp;SUP7L-E,&nbsp;the&nbsp;module&nbsp;is&nbsp;supported&nbsp;by&nbsp;Cisco.<br />I&nbsp;do&nbsp;not&nbsp;know&nbsp;if&nbsp;it&nbsp;is&nbsp;possible&nbsp;to&nbsp;integrate&nbsp;this&nbsp;<br />type&nbsp;of&nbsp;module&nbsp;in&nbsp;compatibility&nbsp;in&nbsp;this&nbsp;SUP6T&nbsp;supervision&nbsp;card&nbsp;knowing&nbsp;that&nbsp;the&nbsp;<br />manufacturer&nbsp;does&nbsp;in&nbsp;his&nbsp;catalog&nbsp;the&nbsp;module&nbsp;but&nbsp;does&nbsp;not&nbsp;validate&nbsp;with&nbsp;this&nbsp;card&nbsp;', 'Codes&nbsp;issue&nbsp;by&nbsp;Tangzhiqiang&nbsp;comment.', '', '1', '42', 'Y', 'new', '8', '3', '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('5224', '2017-06-09', 'henry', 'FOTTU', 'Sample087-FOTTU-A', 'APS85013CDL2', 'Ubiquoss', 'E3224E', 'APS85013CDL2用在Ubiquoss设备上，显示工作速率是1G，而APS31013CDL20是显示100M。', '昨天跟Tom远程，经过多次测试排除了EEPROM的问题，杨培云初步判断是寄存器配置的原因，使模块RX能在1G工作。<br />', '', '1', '42', 'Y', 'new', '7', '3', '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('5225', '2017-06-12', 'jiqi', '上海科光通信技术有限公司', '20170608KGTX', 'APSPD32HM3CDL80 , APSPD31HM3CDL80', 'N/A', '无', '客户的设备，读取DDIM信息，封装类型，有部分错误。<br />错误的DDIM显示：0b<br />正确的DDIM显示：SFP', '通过与李平初步沟通：<br />协议规定A0的00字节代表模块类型，看下面这个表格，03代表SFP，0B是代表DWDM-SFP。客户的设备应该是没有根据最新的协议来做解析，所以直接显示的0B。<br />', '客户要求改成SFP的封装类型显示', '1', '45', 'Y', 'new', '7', '3', '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('5226', '2017-06-12', 'jiqi', '上海旦瑞电信科技有限公司', '20170317DRDX', 'APS55123CDLB2', 'N/A', 'MTS180和MTS1080   ', '1）100M单纤：有部分模块跑一段时间后，设备有光，互联设备对方MAC也能看到，但是数据不通。光模块插拔一下，业务恢复。<br />请供应商分析下啥问题引起的？<br />2）另外，GE，120km（SFP-55-12-120)用在MTS180和MTS1080互联，出现问题现象：工作后，客户拔下模块后，再插上不工作了，检查光功率正常！<br />请分析下可能是什么原因？', '有待于研发确认', '尽快安排与客户对接，给出解释答复！', '1', '45', 'N', 'new', null, '3', '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('5227', '2017-06-19', 'henry', 'Mila', '1083A-ATOPEU-A-MILA', 'APCS34123IDL20', 'Alcatel-Lucent', 'Alcatel/Nokia 7330', '模块信息无法显示', '&nbsp;&nbsp;&nbsp;客户由于端口没有开电，系统不能读取&nbsp;SFP&nbsp;和CSFP，导致误判仪器端口位&nbsp;&nbsp;option&nbsp;1&nbsp;&nbsp;CSFP.&nbsp;&nbsp;现在客户仪器端口上电后能读取模块，但是还存在兼容问题。', '等待客户原装模块', '1', '42', 'N', 'new', null, '3', '1');
INSERT INTO `atop_oacustomercomplaint` VALUES ('5228', '2017-03-28', 'nick', 'TEJAS', 'Sample010-TEJAS-A', 'APX85B30CDL03 , APX31HM0CDL10 , APX55HM0CDL40 , APX55HM0CDL80', 'N/A', '', 'On&nbsp;one&nbsp;of&nbsp;our&nbsp;card&nbsp;where&nbsp;the&nbsp;XFP&nbsp;port&nbsp;is&nbsp;bit&nbsp;stressed,&nbsp;test&nbsp;XFP&nbsp;is&nbsp;giving&nbsp;packet&nbsp;drop&nbsp;continuously&nbsp;(while&nbsp;other&nbsp;make&nbsp;XFPs&nbsp;works&nbsp;error&nbsp;free&nbsp;for&nbsp;the&nbsp;same&nbsp;port).&nbsp;', 'Do&nbsp;pre-emphasis&nbsp;and&nbsp;equalization&nbsp;to&nbsp;improve,&nbsp;send&nbsp;our&nbsp;new&nbsp;XFP&nbsp;sample&nbsp;with&nbsp;plateform&nbsp;2044,&nbsp;2044&nbsp;plateform&nbsp;has&nbsp;better&nbsp;transmission&nbsp;performance&nbsp;and&nbsp;lower&nbsp;power&nbsp;consumption&nbsp;than&nbsp;2010E&nbsp;plateform.', '', '1', '51', 'N', 'new', null, '2', '1');
