INSERT INTO `atop_oacustomercomplaint` VALUES ('5231', '2017-08-09', 'katherine', 'DataOne Asia (Thailand) Company Limited', '003-DATA1-A  (APCP04QQC010-30)', 'APCA04-QQCxxx', 'N/A', 'unknown', 'Can&nbsp;you&nbsp;tell&nbsp;me&nbsp;what&nbsp;is&nbsp;the&nbsp;meaning&nbsp;of&nbsp;&quot;interface&nbsp;always&nbsp;up/down&nbsp;every&nbsp;minute&quot;,&nbsp;<br />Ans&nbsp;&nbsp;&nbsp;&nbsp;I&nbsp;see&nbsp;in&nbsp;the&nbsp;device&nbsp;log&nbsp;and&nbsp;customer&nbsp;report&nbsp;network&nbsp;intermittent&nbsp;down.&nbsp;<br /><br /><br /><br />It&nbsp;mean&nbsp;the&nbsp;transmission&nbsp;link&nbsp;up&nbsp;and&nbsp;link&nbsp;down&nbsp;very&nbsp;minute&nbsp;or&nbsp;the&nbsp;Cables&nbsp;transmission&nbsp;have&nbsp;too&nbsp;many&nbsp;CRC&nbsp;error&nbsp;?&nbsp;<br />Ans&nbsp;&nbsp;&nbsp;There&nbsp;is&nbsp;no&nbsp;flapping&nbsp;found&nbsp;on&nbsp;this&nbsp;interface&nbsp;when&nbsp;we&nbsp;show&nbsp;interface&nbsp;status.&nbsp;There&nbsp;is&nbsp;no&nbsp;CRC&nbsp;error&nbsp;as&nbsp;well.&nbsp;<br /><br />And&nbsp;could&nbsp;you&nbsp;tell&nbsp;us&nbsp;what&nbsp;kink&nbsp;of&nbsp;instruments&nbsp;you&nbsp;use?&nbsp;<br />Ans&nbsp;&nbsp;&nbsp;&nbsp;I&nbsp;see&nbsp;in&nbsp;the&nbsp;device&nbsp;log&nbsp;and&nbsp;customer&nbsp;report&nbsp;network&nbsp;intermittent&nbsp;down.&nbsp;<br />', '&quot;We&nbsp;tested&nbsp;the&nbsp;transmission&nbsp;performance&nbsp;of&nbsp;the&nbsp;RMA&nbsp;modules&nbsp;at&nbsp;the&nbsp;factory&nbsp;and&nbsp;found&nbsp;no&nbsp;problems,&nbsp;<br />So&nbsp;this&nbsp;problem&nbsp;may&nbsp;be&nbsp;related&nbsp;to&nbsp;the&nbsp;instrument&nbsp;used&nbsp;by&nbsp;the&nbsp;customer.&nbsp;So&nbsp;far,&nbsp;we&nbsp;have&nbsp;failed&nbsp;to&nbsp;find&nbsp;out&nbsp;the&nbsp;root&nbsp;cause&nbsp;due&nbsp;to&nbsp;the&nbsp;lack&nbsp;of&nbsp;the&nbsp;same&nbsp;instrument&nbsp;as&nbsp;the&nbsp;customer,&nbsp;so&nbsp;we&nbsp;only&nbsp;replace&nbsp;the&nbsp;problematic&nbsp;module.&quot;', '', '1', '102', 'N', 'new', null, '4', '1');
