INSERT INTO `atop_oacustomercomplaintlog` VALUES ('47', '38', '2014-11-14', '[evan.lee]等待Jonas和客户安排远程。', 'NULL', 'NULL', 'evan.lee', '2015-06-12 14:25:15', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('48', '38', '2014-11-28', '[evan.lee]11-24~11-28多次远程，写了各种AL码，都无法兼容。经Cade修改固件远程升级测试，基本确认是I2C问题，MCU能正常初始化，但是I2C未启动。', 'NULL', 'NULL', 'evan.lee', '2015-06-12 14:26:27', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('49', '38', '2014-12-05', '[evan.lee]周会上决定下周验证是否是I2C上拉电阻过大的问题，按照I2C协议，400K的速率需要大概2K的上拉，目前的上拉是10K。', 'NULL', 'NULL', 'evan.lee', '2015-06-12 14:26:52', '0', '1', 'old', null);
