INSERT INTO `atop_oacustomercomplaintlog` VALUES ('301', '83', '2015-06-23', '[evan.lee]和客户远程，分别检查了155M 40km，622M 80km和622M 120km的码和DDM监控，均未发现异常。&lt;br /&gt; &lt;br /&gt;结合客户的反馈信息，总结如下：&lt;br /&gt;12 units 40km，6 units 80km 不被设备识别，确定是F330+NT25L91方案，固件版本0090_V25&lt;br /&gt;5 units  120km正常识别，是GN25L95方案。&lt;br /&gt; &lt;br /&gt;初步猜测是由于客户的设备I2C速率过高，F330无法支持导致，具体原因还需要进一步分析。', '155m_40km_f4.jpg,622m_80km_f4.jpg,622m_120km_a2h2.jpg', '155m_40km.bin,622m_80km.bin,622m_120km.bin,tv_chathistory_2015-06-23_11.26.36.txt', 'evan.lee', '2015-06-23 13:12:21', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('302', '83', '2015-06-23', '[evan.lee]和Jim、杨培云讨论的结果，初步认定是F330 I2C速率达不到客户设备的要求导致的不识别，暂时无法解决，由于客户反馈的数量并不多，可安排退货，重新补发25L95方案的模块即可。', 'NULL', 'NULL', 'evan.lee', '2015-06-23 18:21:13', '0', '1', 'old', null);
