INSERT INTO `atop_oacustomercomplaintlog` VALUES ('317', '88', '2015-07-09', '[yangpeiyun]从库存领取2pcs AP-ST1模块在我司itester和思科3750上做流量测试，速率设置到1000M,数据帧64和1518交替发送，工作10h无丢包', 'NULL', 'NULL', 'yangpeiyun', '2015-07-10 10:23:41', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('318', '88', '2015-07-10', '[yangpeiyun]从王立处收到客户给的测试报告，大概问题点如下：&lt;br /&gt;1.自适应AP-ST2模块，在ATN910上可以识别千兆速率能传输其余速率不能通，其它设别均不能正常识别&lt;br /&gt;2.千兆AP-ST1在所有设备上均能识别和通数据，只是存在少量丢包工作15小时丢几十个包&lt;br /&gt;3.AP-ST1、AP-ST2插上华为S2300有一定几率导致设别无法正常运行，AP-ST1测试10次出现7次、AP-ST2测试10次出现1次', 'NULL', 'NULL', 'yangpeiyun', '2015-07-10 10:46:22', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('319', '79', '2015-07-10', '[cade.chen]再次电话咨询华为FAE，对方给出的答复是：5000E 和NE40分别是V8和V5平台，不同的平台针对不同的模块会有不同的识别处理方式。', 'NULL', 'NULL', 'cade.chen', '2015-07-10 11:42:58', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('320', '88', '2015-07-10', '[jim,luke]周会讨论，猜想2种可能如下：&lt;br /&gt;1，LOS管脚接地，交换机以LOS信号作为LINK条件，可能需要将LOS通过0欧姆电阻跳接到真实的LOS管脚；&lt;br /&gt;2，电口模块PCB改过一次板，优化了高速走线，可能发成了老版本，需要客户发照片确认一下。', 'NULL', 'NULL', 'evan.lee', '2015-07-10 15:53:23', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('321', '88', '2015-07-14', '[jim.hou]王立：“目前客户已将模块拿到外地的项目上去测试了。等客户拿回模块，后面我将相关信息反馈给你们”。', 'NULL', 'NULL', 'jim.hou', '2015-07-14 15:11:36', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('322', '84', '2015-07-14', '[linpeng]由于我司不知晓cisco 891 router关于模块特殊字节的定义。而关于此款路由器对于模块信息的定义并非按照协议定义，无法解决。', 'NULL', 'NULL', 'linpeng', '2015-07-14 15:42:19', '0', '1', 'old', null);
