INSERT INTO `atop_oacustomercomplaintlog` VALUES ('325', '89', '2015-07-15', '[evan.lee]经过和客户交流，5pcs SFP+ LR和4pcs SFP用在S12708上，插上设备后，没有任何提示信息。另外2pcs SFP用在华为6800设备上，一切正常。', 'NULL', 'NULL', 'evan.lee', '2015-07-16 15:09:00', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('326', '89', '2015-07-16', '[evan.lee]吕剑桥去客户现场，远程改了4pcs SFP+ LR，测试OK，具体记录如下：&lt;br /&gt;1，STT31152600020/22直接写入华为LR源码（A0L0+A2H0），不更改任何信息，测试通过。&lt;br /&gt;2，STT31152600018在ATOP T码基础上写入华为LR的A2H0，STT31152600021写入华为LR源码（A0L0+A2H0），更改厂商为ATOP，测试通过。&lt;br /&gt;3，STT31152600020/22写入在ATOP T码基础上写入华为LR的A2H0，序列号还原，测试通过。&lt;br /&gt;结论是12700和93采用了相同的写码方式，只需要写入A2H0即可，后续华为93出货可采用这个方式做一下验证。', 'NULL', 'NULL', 'evan.lee', '2015-07-16 15:15:24', '0', '1', 'old', null);
