INSERT INTO `atop_oacustomercomplaintlog` VALUES ('344', '91', '2015-08-04', '[yangpeiyun]sophia已安排重新寄2pcs新版模块测试，等待测试结果', 'NULL', 'NULL', 'yangpeiyun', '2015-08-04 11:03:47', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('345', '98', '2015-08-05', '新客诉。', 'NULL', 'NULL', 'evan.lee', '2015-08-07 10:56:13', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('346', '98', '2015-08-06', '[evan.lee]和客户去三台县古井镇和西平镇现场测试，确认第一批次和第三批次正常link，第二批次53异常，通过设备读取DDM，Rx_PWR在-15dBm左右，35的一切正常。&lt;br /&gt;现场把三个批次的53都看了下：&lt;br /&gt;第一批正常，序列号SG53243401117，NT25L91方案，固件版本0090_V25；&lt;br /&gt;第二批异常，序列号S1T53251002110/09/07，NT25L91方案，固件版本0090_V25，多次插拔测试有一次1pc link成功；&lt;br /&gt;第三批正常，序列号S1T53252400002，GN25L95方案。&lt;br /&gt;基本确认是BOSA的原因，和客户商量换货后，先带回7对。', 'NULL', 'NULL', 'evan.lee', '2015-08-07 11:05:05', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('347', '98', '2015-08-07', '[evan.lee]7对模块拿回公司测试，经光谱仪验证，7pcs 53均使用了FP的激光器，属于生产混料，已退回给仓库，重新安排给客户发货。', 'NULL', 'NULL', 'evan.lee', '2015-08-07 11:06:48', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('348', '98', '2015-08-07', '[evan.lee]状态更改为[已处理]。', 'NULL', 'NULL', 'evan.lee', '2015-08-07 11:06:48', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('349', '99', '2015-08-07', '新客诉。', 'NULL', 'NULL', 'linpeng', '2015-08-07 11:25:20', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('350', '97', '2015-08-11', '[yangpeiyun]客户退回4pcs模块，常温测试3.072G速率下传纤，与客户测试结果基本相同，10km光纤存在小误码，5km光纤测试正常。正在准备MAX3738+MAX3747+DS1856方案模块样品做后续验证。', 'NULL', 'NULL', 'yangpeiyun', '2015-08-11 15:16:39', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('351', '97', '2015-08-11', '[jim.hou]根据培云的测试结论，的确在3G下无法正常通讯。目前在紧急选用3G方案进行补货。对于客诉的答复，“CPRI业务的码型和我司BERT的PRBS码型测试有所差异导致，我司已选用更高带宽的激光器和更严格的测试码型进行测试”。&lt;br /&gt;本次客诉部分处理完毕。', 'NULL', 'NULL', 'jim.hou', '2015-08-11 17:08:48', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('352', '97', '2015-08-11', '[jim.hou]状态更改为[已处理]。', 'NULL', 'NULL', 'jim.hou', '2015-08-11 17:08:48', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('353', '94', '2015-08-11', '[jim.hou]经沟通，客户使用的是ACTERNA的SDH网络分析仪，ANT-20SE。因此测试差异是很正常的。由于客户下单数量很少，暂时不进行方案的切换，使用安利BERT挑选灵敏度良好的模块进行发货和补货。胡磊已下工程通道订单。', 'NULL', 'NULL', 'jim.hou', '2015-08-11 17:10:48', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('354', '100', '2015-08-11', '新客诉。', 'NULL', 'NULL', 'jim.hou', '2015-08-12 09:55:29', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('355', '99', '2015-08-12', '[evan.lee]Allen反馈客户有原装的思科兼容模块，准备发写码板给客户远程拷码测试。', 'NULL', 'Test 1 & 2-LX.txt,Test 1 & 2-ZX.txt', 'evan.lee', '2015-08-14 10:29:39', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('1352', '101', '2015-08-26', '新客诉。', 'NULL', 'NULL', 'jim.hou', '2015-08-26 10:17:04', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('1353', '95', '2015-08-27', '[evan.lee]和客户远程确认，使用Juniper的EX4550-32F交换机，插了一张QSFP的板卡（EX4500-EM-2QSFP）。尝试用console口读取模块信息，6条cable均不能被交换机识别，写码板改码后现象一致，查看固件版本为0211_V11，和Jim确认，猜测可能是F330 I2C速率不够的原因。已回复客户等待第二天和工程师的分析结果，只能换成F396的版本进行测试。', 'QQ截图20150827224218.jpg,QQ截图20150827230040.jpg,QQ截图20150827233302.jpg,QQ截图20150827233732.jpg', 'QSFP+ Cable_EX4300.txt', 'evan.lee', '2015-08-27 23:52:30', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('1354', '102', '2015-08-24', '新客诉。', 'NULL', 'NULL', 'yangpeiyun', '2015-08-28 13:26:32', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('1355', '97', '2015-08-28', '[yangpeiyun]更换MAX3738+MAX3747+DS1856方案送样4pcs，客户反馈第一次测试几分钟有2pcs能用、2pcs不能用，第二次打算长时间测试，结果4pcs业务都不能起来。另外客户还反馈发端光功率不稳定，有波动。', 'NULL', 'NULL', 'yangpeiyun', '2015-08-28 13:36:07', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('1356', '100', '2015-09-01', '[jim.hou]经出差与客户沟通，因结果已成定居，因此不再追溯', 'NULL', 'NULL', 'jim.hou', '2015-09-01 17:26:56', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('1357', '100', '2015-09-01', '[jim.hou]状态更改为[已处理]。', 'NULL', 'NULL', 'jim.hou', '2015-09-01 17:26:56', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('1358', '103', '2015-08-31', '新客诉。', 'NULL', 'NULL', 'jim.hou', '2015-09-02 09:34:57', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('1359', '104', '2015-09-01', '新客诉。', 'NULL', 'NULL', 'evan.lee', '2015-09-02 13:41:47', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('1360', '104', '2015-09-01', '[evan.lee]从客户的邮件回复来看，DDM监控如下。&lt;br /&gt;Received Power    : -3.19 dBm   &lt;br /&gt;Transmitted Power : -2.45 dBm  &lt;br /&gt;LBC               : 5 mA &lt;br /&gt;Laser Temperature : 34 C     &lt;br /&gt;和肖艾佑确认，XFP SR的收发端告警范围分别是[-14, 1]和[-6, 0]，-2 -3的光不会引起告警。还在和客户继续沟通中。', 'NULL', 'NULL', 'evan.lee', '2015-09-02 13:44:49', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('1361', '105', '2015-09-01', '新客诉。', 'NULL', 'NULL', 'evan.lee', '2015-09-02 13:48:15', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('1362', '105', '2015-09-02', '[evan.lee]从思科官网查到，GLC-GE-100FX和GLC-FE-100FX的解释如下：&lt;br /&gt;GLC-GE-100FX = 100BASE-FX SFP module for Gigabit Ethernet ports, 1310 nm wavelength, 2 km over MMF&lt;br /&gt;GLC-FE-100FX = 100BASE-FX SFP module for 100-MB ports, 1310 nm wavelength, 2 km over MMF&lt;br /&gt;公司只有FE的码，所以要么用百兆模块写千兆码，要么直接出千兆模块写千兆码代替，等Thomas和客户沟通结果。', 'NULL', 'NULL', 'evan.lee', '2015-09-02 13:50:48', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('1363', '106', '2015-09-02', '新客诉。', 'NULL', 'NULL', 'evan.lee', '2015-09-02 13:53:36', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('1364', '107', '2015-09-02', '新客诉。', 'NULL', 'NULL', 'evan.lee', '2015-09-02 13:56:54', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('1365', '107', '2015-09-02', '[evan.lee]和客户远程，只有1pc模块，确认是25L95方案，在写码板上确认A0/A2均正常，DDM显示发光正常，A2H0未写。但是不写A2H0按理不会影响发光，尤其是3750这种设备，不过还是写入A2H0后等待客户到最终客户处测试，并提供更详细的结果再分析。', 'QQ截图20150902131725.jpg,QQ截图20150902131712.jpg', 'SFP-GE-Z_A2H0.bin', 'evan.lee', '2015-09-02 13:59:25', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('1366', '106', '2015-09-02', '[evan.lee]和Daniel沟通中，需要更详细的信息进行分析。', 'NULL', 'NULL', 'evan.lee', '2015-09-02 14:01:52', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('1367', '105', '2015-09-06', '[evan.lee]Daniel担心写1G的码不好给客户解释，他准备从Xgiga购入GLC-GE-100FX的模块，拷码看看。', 'NULL', 'NULL', 'evan.lee', '2015-09-06 17:05:01', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('1368', '108', '2015-09-01', '新客诉。', 'NULL', 'NULL', 'evan.lee', '2015-09-06 17:25:49', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('1369', '108', '2015-09-02', '[evan.lee]Skype和Hristo沟通，对方无写码板，并且没有其他能正常工作的模块。通过发回的序列号查询写码记录正常（除了QRSR...这个未查询到）。', 'NULL', 'NULL', 'evan.lee', '2015-09-06 17:28:57', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('1370', '103', '2015-09-08', '[jim.hou]经现场测试，更换为LR方案后，全部测试正常。', 'NULL', 'NULL', 'jim.hou', '2015-09-08 13:29:34', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('1371', '103', '2015-09-08', '[jim.hou]状态更改为[已处理]。', 'NULL', 'NULL', 'jim.hou', '2015-09-08 13:29:34', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('1372', '109', '2015-09-09', '新客诉。', 'NULL', 'NULL', 'evan.lee', '2015-09-09 13:21:39', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('1373', '110', '2015-09-10', '新客诉。', 'NULL', 'NULL', 'yangpeiyun', '2015-09-10 15:53:15', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('1374', '110', '2015-09-11', '[yangpeiyun]经分析在内部设备仅千兆收发器上存在相同现象，link指示为直接检测LOS信号电平，由于AP-ST1  LOS管脚直接接到地，模块接入收发器link灯会亮。将AP-ST1 LOS管脚跳接至link1000，模块插入收发器时link闪一下即灭，不存在插入模块link灯就一直亮的情况，且在交换机及网络分析仪上验证传输均正常。怀疑客户处设备与千兆收发器类似，link指示检测LOS电平，已送将LOS接至link1000样品4pcs,待验证。', 'NULL', 'NULL', 'yangpeiyun', '2015-09-14 16:23:20', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('1375', '109', '2015-09-09', '[evan.lee]和汇信特蒲工远程，2pcs异常模块未发现有问题，码也是正常的。给客户的建议是远程再写一遍H3C码，然后送到客户测试，蒲工坚持要退回工厂分析。和王立确认后，决定先退回。', '_GM-2015-08-28 18-31-37.jpg,_GM-2015-08-28 18-32-05.jpg,QQ截图20150909160819.png,QQ截图20150909160856.png,QQ图片20150914172501.jpg', 'NULL', 'evan.lee', '2015-09-14 17:20:45', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('1376', '111', '2015-09-14', '新客诉。', 'NULL', 'NULL', 'evan.lee', '2015-09-14 17:56:39', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('1377', '111', '2015-09-14', '[evan.lee]远程给客户改码后，在博达交换机上ping包测试（有10dB左右衰减），结果如下：&lt;br /&gt;1，28和29对连，不通；&lt;br /&gt;2，28和1pc 40km模块对连，正常；&lt;br /&gt;3，29和1pc 40km模块对连，不通。&lt;br /&gt;基本确认29这支模块是出现性能故障，和纪绮确认后，安排退换货，返厂分析。', 'QQ截图20150914102513.png,QQ截图20150914102920.png', 'NULL', 'evan.lee', '2015-09-14 18:00:08', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('1378', '112', '2015-09-06', '新客诉。', 'NULL', 'NULL', 'evan.lee', '2015-09-15 09:38:43', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('1379', '112', '2015-09-06', '[evan.lee]Nick反馈客户有Finisar的模块正常工作，但是客户没有写码板，Nick还在和客户沟通中。', 'NULL', 'KACHARE_LONAVALA.txt', 'evan.lee', '2015-09-15 09:39:16', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('1380', '106', '2015-09-02', '[evan.lee]根据Daniel的反馈，总结如下：&lt;br /&gt;1，QSFP+ SR4大概数量在10pcs左右，具体数量不明；&lt;br /&gt;2，这些SR4全部都能在老版本9.6上工作，全部都不能在新版本9.8上工作；&lt;br /&gt;3，客户手上还有我司的SFP+ CWDM和DWDM，都能在老版本和新版本上正常工作。&lt;br /&gt;根据这些信息初步猜测，9.8版本的firmware升级了兼容算法，并且仅升级了QSFP+模块的兼容算法。Daniel在尝试能否找到能在新版本9.8上正常工作的QSFP+模块。', 'NULL', 'NULL', 'evan.lee', '2015-09-15 10:15:35', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('1381', '113', '2015-09-17', '新客诉。', 'QQ图片20150923111459.jpg', '20150915_124502.mp4', 'evan.lee', '2015-09-23 11:10:15', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('1382', '107', '2015-09-15', '[evan.lee]Jim接到科光另一位工程师反馈，沟通后确定是同一个客诉，换人处理了，远程查看码是正常的。将模块码拷出后，在品质的WS-C3750-24P上测试，一切正常。已和客户沟通，需要检查一下客户的系统版本。', 'QQ截图20150915103113.png', 'atop_cisco_3750_sfp_120km_test.txt,KG_11_S1C55B53300001.bin,kg_cisco_3750_sfp_120km.bin', 'evan.lee', '2015-09-16 13:46:02', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('1383', '114', '2015-09-16', '新客诉。', 'QQ图片20150916162708.jpg', 'NULL', 'evan.lee', '2015-09-16 16:41:56', '0', '1', 'old', null);
