INSERT INTO `atop_oacustomercomplaintlog` VALUES ('2411', '1120', '2015-10-14', '[jim.hou]根据客户的反馈，是采用Smart-bit进行的测试，但不是自发自收的回环。客户发现TX和RX都存在CRC错误。一般情况下，CRC错误是小误码造成的。我认为，必须使用带CDR的模块才能满足该客户需求。如果需要送样，可以先外购带CDR的模块进行送样，通过后我司再单独开发或继续外购来满足交货。', 'NULL', 'NULL', 'jim.hou', '2015-10-14 14:03:19', '0', '1', 'old', null);
