INSERT INTO `atop_oacustomercomplaintlog` VALUES ('2436', '1123', '2015-11-12', '[xiaoaiyou]改模块已经退回，在我司EVB上测试均功能正常；另外将退回的模块插入到H3C交换机上挂了一个白天，均可以link上；不存在客户反馈的无法up的问题。此时模块的温度监控为68°C。由于我司的H3C设备上只有两个SFP+口 并且还是并排的非背靠背的，这样温度都达到了68°C。&lt;br /&gt;         而jiqi本人在散热较好的客户设备上测试，也无问题，有问题的是插在客户背靠背的设备上出的问题，温度应该远远超过68°C，TEC失锁，所以无法link。&lt;br /&gt;         建议后续给客户发Gn2044s的低功耗的模块给客户进行测试，应该可以解决散热的问题！', '', '', 'xiaoaiyou', '2015-11-12 11:36:33', '0', '1', 'old', null);
