INSERT INTO `atop_oacustomercomplaintlog` VALUES ('2441', '1127', '2015-11-11', '[evan.lee]和客户沟通，他们手上有ETU-LINK的SFP+ SR和Gigalight的Cable，都可以正常工作，拷码之后发现，SR是08版，Cable仅仅是个T码，96-127字节并无加密。&lt;br /&gt;由于客户有规定不能远程，让客户自己把Gigalight的码写入我们的Cable，测试正常。', '', 'worked code in 3600X.zip,', 'evan.lee', '2015-11-12 15:29:35', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('2442', '1127', '2015-11-12', '[evan.lee]仔细对比了我们的Cable码和Gigalight的码，3-10字节我们有很多定义，后者只有A0[08]=04，其他全为00，是否是这个原因需要验证。用Gigalight的码重新生成两个新码，一个1m，另一个3m，发给Dominic测试看看。', '', '3600x test cable.zip,', 'evan.lee', '2015-11-12 15:33:07', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('2443', '79', '2015-11-16', '[evan.lee]Cade更改固件，重新准备5pcs XFP ZR到成研所测试，编号A1/B1/B2/C1/C2，依然全是FF。记下了设备单板和背板型号，以及另外几个端口能正常识别的模块信息：1pc WTD的LR（RTXM226-408）和1pc Opnext的LR（TRF5015FN-GA420）。', 'IMG_20151117_093712.jpg,IMG_20151117_093719.jpg,', '', 'evan.lee', '2015-11-17 09:44:43', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('2444', '1127', '2015-11-13', '[evan.lee]Dominic回复都能在3600X上正常工作，确认的确是3-10字节定义的问题，cable只需要8字节定义active或passive即可。', '', '', 'evan.lee', '2015-11-20 10:23:01', '0', '1', 'old', null);
