INSERT INTO `atop_oacustomercomplaintlog` VALUES ('4455', '1124', '2015-11-30', '[evan.lee]纪绮反馈，客户发现一支模块（SN: STT33453500003）提示告警，从客户发回来的log文件来看，A2阈值范围和出厂不符，暂不清楚是在何处被更改。', '', '20151130_12点05分-1550.918nm.zip,', 'evan.lee', '2015-12-01 11:51:06', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('4456', '104', '2015-09-18', '[henry]这个out of range的是Alcatel 8G 兼容问题，客诉系统里面写成了思科，是Alcatel的设备哈。', '', '', 'henry', '2015-12-09 13:44:41', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('5455', '1124', '2015-12-10', '[evan.lee]客户退回3pcs模块，2pcs 32通道（STT32453500013和STT32453500014）和1pc 33通道（STT33453500003），经检查checksum字节不正确，确有改动的痕迹。另外，之前提到的A2阈值范围不符的情况并未发现。&lt;br /&gt;已和纪绮沟通，重新写码，并更新到最新固件，将A0/A2进行写保护，重新发给客户测试。', '', '', 'evan.lee', '2015-12-11 10:24:33', '0', '1', 'old', null);
