INSERT INTO `atop_oacustomercomplaintlog` VALUES ('6459', '3131', '2015-12-28', '[evan.lee]和Vinit远程，结果如下：&lt;br /&gt;1，显示DDM不支持的模块，检查发现A0[92]已从0x68改为0x02，并且是随机出现，初步判断是交换机修改了该字节，原因未知。已将异常的模块全部修改为0x68。&lt;br /&gt;2，交换机的警告信息一直存在，除非所有模块都写一个序列号，但是并不现实，Vinit已和终端客户沟通，保留现状。&lt;br /&gt;后续需要对该客户的模块进行A0/A2写保护操作，防止交换机误修改。', '', '', 'evan.lee', '2016-01-05 15:28:51', '0', '1', 'old', null);
