INSERT INTO `atop_oacustomercomplaintlog` VALUES ('6465', '2133', '2016-01-08', '[evan.lee]刘东芳到客户现场，远程写码后H3C已解决，其他设备和产品，详见http://61.139.89.33:8088/customer-complaint/item.html?id=2131', '', '', 'evan.lee', '2016-01-09 09:47:51', '0', '1', 'old', null);
