INSERT INTO `atop_oacustomercomplaintlog` VALUES ('6467', '2131', '2016-01-08', '[evan.lee]刘东芳到客户现场，远程结果如下：&lt;br /&gt;1，QSFP+ SR4已能兼容IBM G8316，该设备现在只能写源码，序列号等信息无法修改。&lt;br /&gt;2，QSFP+ SR4在Ruijie S6220上识别有异常，具体表现为模块插入设备后，如果能读到模块信息，则一直能读到，反之如果第一次读不到，则一直无法读到。经过分析和讨论，有可能是这2pcs SR4的金手指被划伤（前期工厂采用的QSFP座子有问题，有金手指被划伤的先例）。已和客户沟通，需要重新给客户发几只SR4样品测试，这2pcs SR4退回工厂分析。&lt;br /&gt;3，SFP+ Passive Cable在H3C设备上提示非原厂模块，检查发现是ATOP码，重写H3C码后正常。', 'QQ截图20160108144108.jpg,QQ截图20160108144626.jpg,Ruijie version.jpg,', 'original codes.zip,', 'evan.lee', '2016-01-09 09:50:08', '0', '1', 'old', null);
