INSERT INTO `atop_oacustomercomplaintlog` VALUES ('7473', '3135', '2016-01-18', '[evan.lee]和之前的Alcatel设备客诉（ID：38和1130）很类似，怀疑是同样的问题，由于无设备进行验证，暂时无法解决。', '', '', 'evan.lee', '2016-01-18 14:11:57', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8471', '3133', '2016-02-19', '[evan.lee]和客户远程，拷了原装SFP+ SR的码，经过多次尝试，需要写厂商为Arista Networks、OUI写成001C73、并且需要写入A0[96-127]和A2[128-255]才能完全兼容。已给客户更改了4pcs，测试通过。给了客户改码说明，剩下的50+pcs他说自己修改。', 'QQ截图20160219142057.jpg,QQ截图20160219142210.jpg,QQ截图20160219153854.jpg,', 'original code.zip,', 'evan.lee', '2016-02-19 17:13:49', '0', '1', 'old', null);
