INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8476', '4135', '2016-02-24', '[evan.lee]和客户远程，客户手上有正常工作的ATOP 1G SFP（InnerSN: 2506429 ，91方案），插上设备后显示Inserted，能读取模块信息；异常的2.5G CWDM模块（InnerSN: 3286071，95方案）插上设备后显示Removed，如下图。交叉写入两个模块的码，情况依旧。经过查询序列号，初步判定为95方案兼容问题，需重新送91方案测试。', 'QQ截图20160224152527.jpg,QQ截图20160224152816.jpg,', '', 'evan.lee', '2016-02-24 18:06:03', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8477', '4136', '2016-03-02', '新客诉。', 'NULL', 'NULL', 'evan.lee', '2016-03-03 10:50:35', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8478', '4136', '2016-03-02', '[evan.lee]和客户远程，客户使用的3米跳线对连测试，DDM监控显示发光在-3dBm左右，收光在-5dBm～-3dBm，测试过程并未重现现象，客户说是随机出现的。暂时未找到原因，怀疑是设备配置问题，客户继续测试中。', '', '', 'evan.lee', '2016-03-03 10:52:34', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8479', '4136', '2016-03-03', '[bob]今天客户用了JUNIPER，ATOP, 旭创 三个品牌模块重新测试。结果是只有我们ATOP模块出现这样问题，基本排除交换机设置问题。目前采取弥补措施是 全部换货130只。', '', '', 'bob', '2016-03-03 15:13:38', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8480', '4136', '2016-03-07', '[evan.lee]补3月3日远程截图。', 'QQ截图20160302115824.jpg,QQ截图20160302115925.jpg,QQ截图20160302120825.jpg,QQ截图20160302121010.jpg,', '', 'evan.lee', '2016-03-07 11:34:02', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8481', '4137', '2016-03-10', '新客诉。', 'NULL', 'NULL', 'evan.lee', '2016-03-11 14:00:05', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8482', '4137', '2016-03-10', '[evan.lee]客户发回的截图。', 'QQ图片20160310112228.jpg,QQ图片20160310112249.jpg,', '', 'evan.lee', '2016-03-11 14:00:27', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8483', '4137', '2016-03-11', '[evan.lee]从王立那儿得知，之前在网宿科技有拷贝SFP+ SR和LR的H3C码，上午到品质的H3C交换机上验证OK，SR显示为SFP-XG-SX-MM850-A，LR显示为SFP-XG-LX-SM1310。等待纪绮和客户的沟通结果，随时可以给客户改码或者退换货。', '', '', 'evan.lee', '2016-03-11 14:02:20', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8484', '4138', '2016-03-15', '新客诉。', 'NULL', 'NULL', 'evan.lee', '2016-03-18 14:51:20', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8485', '4138', '2016-03-15', '[evan.lee]和Vinit远程确认，模块工作几分钟后，温度上升到60-70度，然后出现down/up现象，初步分析是温度过高导致发端TEC失锁，从而使得Tx_PWR不稳出现丢包掉线。', 'QQ截图20160315182717.jpg,', '', 'evan.lee', '2016-03-18 14:53:41', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8486', '4138', '2016-03-16', '[evan.lee]再次和Vinit远程，在写码板上自环测试，刚上电时DDM显示Tx_PWR=0.5dBm，Rx_PWR=-0.2dBm。工作几分钟后，温度上升到接近70度，Rx_PWR开始跳动，在-2.5dBm到0dBm之间跳动，证实了TEC失锁导致功率不稳的猜想。&lt;br /&gt;从客户处得知，模块是14年9月份出厂的，一直在客户仓库未使用，最近才开始使用并发现异常，已告知Vinit和Jonas，需要退回工厂分析。', '', '', 'evan.lee', '2016-03-18 14:57:42', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8487', '4139', '2016-02-19', '新客诉。', 'NULL', 'NULL', 'evan.lee', '2016-03-30 16:45:55', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8488', '4139', '2016-03-30', '[evan.lee]和Eduard B远程，结果如下：&lt;br /&gt;1，客户使用的设备是Alcatel 1830 PSS；&lt;br /&gt;2，客户实际上想要的是XFP SR，据客户说是要工作在8G和10G速率下，传输距离最远300-500米；（我们的SR在OM3光纤能达到300米）&lt;br /&gt;3，我们之前发出去的模块是XFP LR，写的也是LR的码；（以下是从客户设备读出来的截图，1/14/C1是原装，1/14/C2是ATOP模块）&lt;br /&gt;4，客户用XFP LR使用多模光纤传输，不能link up；&lt;br /&gt;5，用XFP LR自环模式下（1米跳线），一直处于up down状态，监控显示tx：-2dBm左右，rx：-5dBm左右；&lt;br /&gt;6，客户的写码板不能识别任何模块，包括ATOP和原装；&lt;br /&gt;7，客户手上只有ATOP和原装的XFP，没有其他家的模块。&lt;br /&gt;综上，我认为重新发SR模块给客户也不一定能传通，这个设备似乎跟其他其他设备有很大不同，14年Orienta的这个设备曾出过XFP ZR的客诉没解决，链接：http://61.139.89.33:8088/customer-complaint/item.html?id=38 ，目前暂时没有解决办法，讨论中。', 'QQ截图20160330140714.png,QQ截图20160330144221_ATOP LR.png,QQ截图20160330144244_原装模块.png,QQ截图20160330144554_ATOP LR.png,QQ截图20160330151124_LOG.png,', '', 'evan.lee', '2016-03-30 17:11:34', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8489', '4137', '2016-03-30', '[evan.lee]纪绮反馈，模块已经在跑业务了，无法更换。并且小米要求世纪互联今后的供货不能采用第三方的模块，这个客诉基本告一段落。', '', '', 'evan.lee', '2016-03-30 17:52:15', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8490', '4137', '2016-03-30', '[evan.lee]状态更改为[无法处理]。', 'NULL', 'NULL', 'evan.lee', '2016-03-30 17:52:15', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8491', '4140', '2016-04-07', '新客诉。', 'NULL', 'NULL', 'evan.lee', '2016-04-08 13:35:15', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8492', '4140', '2016-04-07', '[evan.lee]纪绮到客户现场，在写码板上查看监控和设备显示一致，初步判定为模块外壳有和PCBA上某根管脚短路（如LD+-）导致Driver损坏或电路损坏，需要退回工厂分析。下午开会讨论，认为是PCBA上的元件和结构件的距离过小（杨培云确定在8mil左右）导致，后续会进行PCB改版，旧版本需要贴绝缘胶并在产线做短路检查。', 'QQ截图20160407154832.jpg,QQ截图20160407154915.jpg,QQ截图20160407154928.jpg,QQ截图20160407155019.jpg,', '', 'evan.lee', '2016-04-08 13:38:47', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8493', '4141', '2016-04-13', '新客诉。', 'NULL', 'NULL', 'evan.lee', '2016-04-13 13:44:19', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8494', '4141', '2016-04-13', '[evan.lee]从客户发回来的图片看，原装模块多显示了一条“WDM Metro”，并且原装模块显示的波长为1560.61和1559.79，而根据协议规定，A0中的波长只能精确到0.05nm，因此判定该设备有自己的定义，需要拿到原厂模块的码来分析。', 'mmexport1460525909696.jpg,mmexport1460525923590.jpg,mmexport1460525934375.jpg,', '', 'evan.lee', '2016-04-13 13:48:01', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8495', '4142', '2016-04-09', '新客诉。', 'NULL', 'NULL', 'evan.lee', '2016-04-13 13:56:59', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8496', '4142', '2016-04-09', '[evan.lee]中午光润通苗总发回一个原装模块的码，经分析A2H0有加密信息，尝试远程写入两支模块，A模块写源码，B模块写源码后更改序列号，测试结果显示A正常，B现象依旧。当时判定是5720的加密规则比9300系列还要更加严格。', 'QQ截图20160409122131.png,', 'hw2.zip,', 'evan.lee', '2016-04-13 13:59:39', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8497', '4142', '2016-04-11', '[evan.lee]周一到公司的S5700上测试，写T码一样有警告信息（如下图），由此判断，华为并非采用了新的规则，而是一直都有这个规则。只是由于经验主义导致我们一直认为华为设备就是用的通用码。&lt;br /&gt;&lt;br /&gt;另外，去年从马丽马总那里拷贝的华为93系列的源码，也会有这个告警信息。很奇怪的是，之前有客户要求写93码，就是按照马总的源码来改的，改了客户就说可以用了，现在想起来很费解。&lt;br /&gt;&lt;br /&gt;现在初步的结论是，所有的华为设备都有加密要求，如果不按规则写码，就会有上述的警告信息。&lt;br /&gt;但也仅是出现警告信息而已，读取模块信息、读取DDM和传输业务均不会受到影响。&lt;br /&gt; &lt;br /&gt;至于破解，目前暂时没有办法，仅知道A2那一串数字是华为内部PN，其余的无从下手，难度不下于思科。', 'CatchF8DB(04-13-13-57-12).jpg,', '', 'evan.lee', '2016-04-13 14:02:20', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8498', '4142', '2016-04-11', '[evan.lee]状态更改为[无法处理]。', 'NULL', 'NULL', 'evan.lee', '2016-04-13 14:02:20', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8499', '4136', '2016-04-22', '[bob]目前换货的130只 模块，工作正常。 下周客户会寄1只好的和一只坏的回来给我们研究。', '', '', 'bob', '2016-04-22 11:24:28', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8500', '4143', '2016-02-19', '新客诉。', 'NULL', 'NULL', 'evan.lee', '2016-04-27 20:38:58', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8501', '4143', '2016-02-19', '[evan.lee]从Daniel发回的3pcs模块码来看，写的是8G LW的Cisco码，并未发现异常。Daniel安排将这3pcs模块发回工厂分析。&lt;br /&gt;另外，Daniel告知另一个信息：optics starts working after they reboot the linecards。', '', 'DR.rar,', 'evan.lee', '2016-04-27 20:44:04', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8502', '4143', '2016-03-03', '[evan.lee]3pcs模块到厂，在写码板和公司的Nexus 3K上测试均正常，未发现异常现象。', '', 'AP-DS-SFP-FC8GLW tested on Cisco Nexus 3K.txt,', 'evan.lee', '2016-04-27 20:46:17', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8503', '4143', '2016-03-03', '[evan.lee]从Jim那儿了解到，去年生产的SFP+ LR的外壳有和交换机接触不良的风险，建议重新给客户发新版本的LR测试。', '', '', 'evan.lee', '2016-04-27 20:49:20', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8504', '4143', '2016-03-10', '[evan.lee]和Jim、肖艾佑讨论，老版本的LR还有电源电路失效风险，在特定情况下MCU可能不工作。还是建议重新发新版本给DR测试。', '', '', 'evan.lee', '2016-04-27 20:52:07', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8505', '4144', '2016-04-22', '新客诉。', 'NULL', 'NULL', 'evan.lee', '2016-04-28 13:36:42', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8506', '4143', '2016-04-25', '[evan.lee]Daniel反馈重新送样的新版本依然有问题，显示”sfp read error” or ”sfp not present”.', '', '', 'evan.lee', '2016-04-28 13:38:03', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8507', '4144', '2016-04-26', '[evan.lee]杨培云从仓库领去LR TI 3.0模块在Cisco Nexus 3K上测试，插入10pcs并与其他交换机对连，所有端口都是up状态。由于我们没有客户的设备，需要从其他销售联系设备现场测试。', '', '', 'evan.lee', '2016-04-28 13:40:52', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8508', '4143', '2016-04-28', '[evan.lee]Dainel回复客户使用的设备是Cisco的8G FC设备，型号是 DS-X9448-768K9，属于MDS 9700 series，官网链接如下：http://www.cisco.com/c/en/us/products/collateral/storage-networking/mds-9700-series-multilayer-directors/data_sheet_c78-727817.html', '', '', 'evan.lee', '2016-04-28 13:43:53', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8509', '4143', '2016-03-15', '[yangpeiyun]Daniel又提供了4pcs LR的SN，经杨培云确认和之前退回工厂的3pcs都属于老版本（APSP31B33CDL10-TZ），而新版本应该是APSP31B33CDL10-T3Z', '', '', 'evan.lee', '2016-05-03 16:36:27', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8510', '4145', '2016-04-28', '新客诉。', 'NULL', 'NULL', 'evan.lee', '2016-05-04 09:54:50', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8511', '4145', '2016-04-29', '[evan.lee]电话和对方工程师肖进联系，回复当时测试的是另外的同事，只说了不能使用，并未说明详细的不良现象，只能先退回来分析。', '', '', 'evan.lee', '2016-05-04 09:58:07', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8512', '4145', '2016-05-03', '[evan.lee]拿到模块后读码分析，XF32444800001 (1410291385)这支写的是Juniper码，其余4pcs没发现异常，尝试改码失败，仔细观察像是Xgiga的产品。和陈艳萍沟通让帮忙查查，暂未回复。', '', '', 'evan.lee', '2016-05-04 10:01:51', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8513', '4143', '2016-04-29', '[evan.lee]Daniel发回来8个SN，4pcs能用，4pcs异常，分别如下：&lt;br /&gt;异常：（012-ATOPW2-A）&lt;br /&gt;STCO31160200400&lt;br /&gt;STCO31160200965&lt;br /&gt;STCO31160200966&lt;br /&gt;STCO31160200982&lt;br /&gt;正常：（292-ATOPEU-A）&lt;br /&gt;STC31152000520&lt;br /&gt;STC31152000820&lt;br /&gt;STC31152000715&lt;br /&gt;STC31152000716&lt;br /&gt;查询得知，异常模块集中在15年10月份生产，正常模块集中在15年上半年，并且都是老版本（-TI，-TZ）而不是TI 3.0版本（-T3Z）。', 'Catch(05-03-18-2(05-04-09-42-08).jpg,', '', 'evan.lee', '2016-05-04 10:15:40', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8514', '4146', '2016-06-06', '新客诉。', 'NULL', 'NULL', 'evan.lee', '2016-06-23 16:03:39', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8515', '4146', '2016-06-06', '[evan.lee]客户发回的错误现象', 'QQ截图20160623143849.jpg,', '', 'evan.lee', '2016-06-23 16:04:05', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8516', '4146', '2016-06-07', '[evan.lee]通过品质查询写码记录，AL PN写的是3HE00027AA，这个是1000BASE-SX的AL PN，猜测可能是这里导致，重新给客户发了码测试，AL PN改为3HE04524AA，对应100BASE-FX。', '', '100BX-20-D55_S0AL53261300101_100.zip,', 'evan.lee', '2016-06-23 16:07:25', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8517', '4146', '2016-06-21', '[evan.lee]客户反馈新编的码依旧显示1G。', '', '', 'evan.lee', '2016-06-23 16:14:10', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8518', '4146', '2016-06-23', '[evan.lee]和客户远程，客户手上并没有其他正常显示百兆的模块，只能盲改。多次试验后发现byte6需要改成10h，即100BASE-FX才行，可能是AL设备不识别BASE-BX这种类型。已重新给Geoge生成了新的100pcs码，测试通过。', '', '100BX-20-D55_S0AL53261300101_300.zip,', 'evan.lee', '2016-06-23 16:20:35', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8519', '4146', '2016-06-23', '[evan.lee]状态更改为[已处理]。', 'NULL', 'NULL', 'evan.lee', '2016-06-23 16:20:35', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8520', '4147', '2016-06-28', '新客诉。', 'NULL', 'NULL', 'evan.lee', '2016-07-08 17:27:29', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8521', '4147', '2016-06-28', '[evan.lee]从品质找到的写码截图显示，A0[10]字节是0x80，显然是错的，Brocade要求这个字节必须包含800M速率。和包装确认是的确是写码错误，重新编码发给客户。', 'Catch(07-08-15-44-24).jpg,', 'Brocade.zip,', 'evan.lee', '2016-07-08 17:34:23', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8522', '4147', '2016-06-29', '[evan.lee]客户反馈可以工作了，需要做更多其他的测试。', '', '', 'evan.lee', '2016-07-08 17:34:55', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8523', '4147', '2016-07-05', '[evan.lee]客户反馈重写码后能识别了，但是设备显示速率为4G。', 'image005(07-05-1(07-08-15-40-06).jpg,image009(07-06-1(07-08-15-40-06).jpg,', '', 'evan.lee', '2016-07-08 17:37:05', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8524', '4147', '2016-07-06', '[evan.lee]以前没有遇到过类似情况，猜想设备可能通过A0[10]字节Fiberchannel速率来做判断，把这个字节改成只支持800M速率再次发给客户测试。', '', 'Brocade_160706.zip,', 'evan.lee', '2016-07-08 17:38:56', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8525', '4148', '2016-07-07', '新客诉。', 'NULL', 'NULL', 'evan.lee', '2016-07-08 17:51:08', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8526', '4148', '2016-07-07', '[evan.lee]客户发回的测试数据表格。', 'QQ截图20160708160748.png,', '', 'evan.lee', '2016-07-08 17:51:32', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8527', '4148', '2016-07-07', '[evan.lee]查询写码截图，未发现异常（由于没有2.5G DWDM Cisco码，写的是SFP-GE-Z）。已建议回复客户自环测试fail的时候通过设备读取模块监控信息以供分析。', '_GM-2016-06-30 15-52-15.jpg,', 'APSD61253CDL80-CO.zip,', 'evan.lee', '2016-07-08 18:12:08', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8528', '4149', '2016-07-06', '新客诉。', 'NULL', 'NULL', 'evan.lee', '2016-07-15 12:48:45', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8529', '4149', '2016-07-06', '[evan.lee]1，客户发回来读取信息的截图；&lt;br /&gt;2，客户反馈“the link seems to come up, but we have not tested it in reality.”，说明模块已经正常工作，只是不能读取信息。&lt;br /&gt;3，和胡磊讨论后，改了OUI和Vendor Name发给客户测试。', 'TM301-fault-XFP 交换机读取结果.png,', 'APXC57HM0CDL40_S1607060001_2.zip,', 'evan.lee', '2016-07-15 12:53:01', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8530', '4149', '2016-07-06', '[evan.lee]客户还发了一个inventory的结果。', 'tm301-inventory-2016-07-05.jpg,', '', 'evan.lee', '2016-07-15 12:59:04', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8531', '4148', '2016-07-14', '[evan.lee]客户提供的最新的测试报告，同样的模块多次测试结果不一致。', '', 'Test Report On 7-12-2016 SFPEZX-DW61-CCCMG (ATOP).zip,', 'evan.lee', '2016-07-15 13:04:38', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8532', '4148', '2016-07-14', '[evan.lee]附件是工厂查询的测试报告，没有发现异常。', '', 'LS38-C3M-TI-N-D3.zip,', 'evan.lee', '2016-07-15 13:05:39', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8533', '4148', '2016-07-14', '[yangpeiyun]从数据库信息及产品BOM信息，此批次出货用的是GN2044S+7023的方案，PCBA料号为1.13.EL10D26-D00，以下是数据库中查询的信息。', 'Catch(07-15-11-17-20).jpg,', '', 'evan.lee', '2016-07-15 13:07:01', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8534', '4150', '2016-07-15', '新客诉。', 'NULL', 'NULL', 'evan.lee', '2016-07-15 13:18:02', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8535', '4150', '2016-07-15', '[evan.lee]客户发回的详细测试报告。', '', 'XFP DWDM ATOP.zip,', 'evan.lee', '2016-07-15 13:18:57', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8536', '4151', '2016-07-14', '新客诉。', 'NULL', 'NULL', 'evan.lee', '2016-07-20 15:55:30', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8537', '4151', '2016-07-20', '[evan.lee]吕剑桥去客户现场测试，在格林伟迪上自环测试的确不通，读出来的DDM信息如图“华拓XFP ER.jpg”，正常的模块如图“吉讯LR.jpg”。', '华拓XFP ER.jpg,吉讯LR.jpg,', '', 'evan.lee', '2016-07-20 15:59:06', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8538', '4151', '2016-07-20', '[evan.lee]重新找了一台Juniper交换机，自环依然不通，但是能读取到信息，DDM监控值更符合在写码板上读到的值，和GFA6900不同。&lt;br /&gt;在写码板上和在设备上用功率计分别测试，发端功率均在-5dBm左右，不确定是否端面脏污或者发端异常，和吕剑桥商量后决定退回工厂分析。', 'Juniper监控.jpg,写码板监控.jpg,', '', 'evan.lee', '2016-07-20 16:20:10', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8539', '4152', '2016-07-19', '新客诉。', 'NULL', 'NULL', 'evan.lee', '2016-07-20 17:00:30', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8540', '4152', '2016-07-20', '[evan.lee]纪绮去客户现场，测试如下：&lt;br /&gt;1，异常模块在我们的写码板上显示一切正常，EEPROM没有被修改，DDM也正常。&lt;br /&gt;2，异常模块上设备读取信息，显示异常。&lt;br /&gt;3，带了两支25L91方案的模块，在客户设备上能正确读出信息。&lt;br /&gt;4，交换91和95模块，情况依旧。', '上面91，下面95.jpg,上面95，下面91.jpg,', '', 'evan.lee', '2016-07-20 17:29:53', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8541', '4152', '2016-07-20', '[evan.lee]初步怀疑是I2C速率或者上拉电阻匹配问题。和对方技术工程师谢工沟通，结果如下：（附件是客户发回的设备的模块处理电路部分）&lt;br /&gt;1，设备对模块I2C速率没有要求；&lt;br /&gt;2，设备的SCL和SDA都有4.7K的上拉电阻到VCC。&lt;br /&gt;经杨培云确认，95B芯片内部有10K上拉电阻，而91方案模块内部是没有上拉电阻的，可能是这个问题导致的。', '', 'ATOP的GE光模块的诊断说明.zip,', 'evan.lee', '2016-07-20 17:34:34', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8542', '4153', '2016-07-15', '新客诉。', 'NULL', 'NULL', 'evan.lee', '2016-07-21 13:39:48', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8543', '4154', '2016-07-18', '新客诉。', 'NULL', 'NULL', 'evan.lee', '2016-07-21 13:39:57', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8544', '4153', '2016-07-15', '[evan.lee]从客户发回的几张截图可以得出如下几个信息：&lt;br /&gt;1，端口down掉后模块被disable，bias电流为0；&lt;br /&gt;2，重新插拔模块后发光了，但是alarm和warning范围变了；&lt;br /&gt;3，第三张图显示连A0的内容也变了，说明重新插拔的过程中EEPROM可能被设备误修改。', '端口down掉后没插拔之前的状态.jpg,插拔后发光的状态.jpg,插拔后过了几小时的状态.jpg,', '', 'evan.lee', '2016-07-21 13:51:15', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8545', '4153', '2016-07-15', '[evan.lee]和客户沟通了几个问题，客户分别作了回复，如截图。&lt;br /&gt;目前的情况我认为无法分析出确切的原因，建议是：&lt;br /&gt;1，重新写H3C码，然后设置写保护。&lt;br /&gt;2，如果客户担心影响业务，可以先换一支给客户使用。如果没有关系，就继续使用再观察。', 'QQ图片20160721115832.png,', '', 'evan.lee', '2016-07-21 13:54:40', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8546', '4154', '2016-07-18', '[evan.lee]附件是客户发回的log记录。', '', 'log记录.zip,', 'evan.lee', '2016-07-21 13:59:01', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8547', '4149', '2016-08-02', '[evan.lee]Daniel外购了一支XFP SR的Transmode兼容模块，根据这个码重新编了一个新码给客户测试。', '', 'Transmode.zip,', 'evan.lee', '2016-08-02 18:10:07', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('8548', '4148', '2016-08-08', '[cade.chen]客户现场简单分析发现部分模块TEC损坏，导致不发光， 回成都测试后部分模块发端损坏，部分收端损坏，已交由品质分析', '', '', 'cade.chen', '2016-08-08 13:23:15', '0', '1', 'old', null);
