INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9548', '4155', '2016-08-08', '[evan.lee]4pcs模块退回工厂，在品质检查发现3pcs的确EEPROM信息被改乱了，重新写码并做了写保护后发给客户测试。附件是从品质拷贝的写码截图信息。', '', '20160801DRDX-RMA.zip,', 'evan.lee', '2016-08-11 11:14:20', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9549', '4155', '2016-08-10', '[evan.lee]客户反馈重新发给客户的信息依旧有门限为0的情况，附件是详细测试报告。正好客户有借给我们一台S6700，可以和绵阳工厂的S5700一起做一下全面的测试。', '', '四川华拓光模块测试.zip,', 'evan.lee', '2016-08-11 11:16:06', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9550', '4152', '2016-08-01', '[evan.lee]从吕剑桥了解到，客户不想继续测试了，客诉关闭。', 'QQ图片20160812132934.jpg,', '', 'evan.lee', '2016-08-12 13:30:14', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9551', '4152', '2016-08-01', '[evan.lee]状态更改为[已处理]。', 'NULL', 'NULL', 'evan.lee', '2016-08-12 13:30:14', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9552', '4155', '2016-08-19', '[evan.lee]在Huawei S6700上测试现有固件，EEPROM被修改的情况已重现，经分析原因是固件中初始化顺序不对导致，修改固件后已解决。&lt;br /&gt;但是模块监控门限显示为0的问题在公司的S5700和借的S6700上均为重现，分析可能的原因也是固件初始化时序不对导致。', '', '', 'evan.lee', '2016-08-22 17:31:48', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9553', '4155', '2016-08-26', '[evan.lee]已修改措辞后回复客户。', '', '', 'evan.lee', '2016-08-26 15:28:00', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9554', '4149', '2016-08-19', '[evan.lee]客户反馈写了新发的码可以识别了，但是transceiver class显示为300m。', 'QQ截图20160826153111.jpg,', '', 'evan.lee', '2016-08-26 15:46:31', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9555', '4149', '2016-08-19', '[evan.lee]和Aleksandr远程，正常的CWDM模块显示如下图，但是这个模块正在使用中，无法拔下来拷码。', 'QQ截图20160819154207.png,', '', 'evan.lee', '2016-08-26 15:49:24', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9556', '4149', '2016-08-22', '[evan.lee]盲改了一些码发给Aleksandr，其中S005测试通过。', 's005.png,', 'Transmode测试.zip,', 'evan.lee', '2016-08-26 16:00:18', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9557', '4149', '2016-08-23', '[evan.lee]至此问题已解决，但是Janno疑惑为什么ATOP的模块不显示Laser temperature，但是别家的显示是正常的。经确认，公司的XFP长距模块AUX1和AUX2固定监控的是5V和3.3V，是前期给fibcom出货时客户要求的，所以一直保留到现在。已经回复客户如果需要的话可以通过修改固件实现。', '', '', 'evan.lee', '2016-08-26 16:16:18', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9558', '4149', '2016-08-23', '[evan.lee]状态更改为[已处理]。', 'NULL', 'NULL', 'evan.lee', '2016-08-26 16:16:18', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9559', '4156', '2016-08-19', '新客诉。', 'NULL', 'NULL', 'evan.lee', '2016-08-26 16:22:32', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9560', '4156', '2016-08-19', '[evan.lee]附件是客户发回来的错误log', 'error log.jpg,', 'dwdm sfp log.zip,', 'evan.lee', '2016-08-26 16:25:21', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9561', '4156', '2016-08-26', '[evan.lee]和Brijesh远程，现象重现，但是和之前国内出现的客诉不同，这次不是随机出现，而是每次读取都是很大的值，如图1。&lt;br /&gt;客户没有我司的写码板，找了一块别家的写码板读取A2发现外部校准系数全被修改了，还是属于华为交换机的I2C访问问题，如图2。&lt;br /&gt;尝试改回正确的校准系数后，设备读取正常，如图3。&lt;br /&gt;但是这只是临时解决办法，后续插拔过程中也有被修改的风险，已告知Nick发一块写码板给客户，到时候远程设置EEPROM写保护。', '图1.jpg,图2.jpg,图3.jpg,', '', 'evan.lee', '2016-08-26 16:29:46', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9562', '4157', '2016-08-26', '新客诉。', 'NULL', 'NULL', 'evan.lee', '2016-08-29 14:58:11', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9563', '4157', '2016-08-29', '[evan.lee]和客户（Niwant）远程，客户在一台测试用的ciena上演示，6只模块两两对接（有10dB衰减），都处于link down状态，如图1端口7-12。图2是端口7和8的DDM信息。客户反馈已经有接近10pcs出现类似的故障，并且是已经在正常传输业务，模块重新插拔后恢复。', '图1.jpg,图2.jpg,', '', 'evan.lee', '2016-08-29 15:06:08', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9564', '4157', '2016-08-30', '[sunbin]和客户（Niwant）远程，20只模块两两对接（有10dB衰减），都能连通，如截图1和2。发现我司模块EE异常，如图ATOP EE issue，在我司提供的EVB上double check，EE的确被修改。客户反应工作一段时间会出现问题，但当前测试暂时OK。从上一条记录来看，失效现象和北京世纪互联有些类似，建议参考做debug，并升级FW去处理EE被误修改的问题。', 'ATOP EE issue.png,截图1.PNG,截图2.PNG,', '', 'sunbin', '2016-08-30 16:14:27', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9565', '4158', '2016-08-23', '新客诉。', 'NULL', 'NULL', 'sunbin', '2016-08-30 16:46:27', '0', '1', 'new', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9566', '4158', '2016-08-24', '[sunbin]进到客户公司，现场实测发现有一只模块出光有跳，得到客户批准，先取走这只模块，另外7只做级连测试。跑了两小时无丢包。客户工位紧张，暂时没有做长时间测试。', '', '', 'sunbin', '2016-08-30 16:52:04', '0', '2', 'new', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9567', '4158', '2016-08-26', '[sunbin]8月25号，客户对7只模块做级连测试一整天没有发现问题。8月26号早上，客户对码型做切换时发现我司模块上报LOS，通信断掉。初步怀疑是上电时序导致或者是电源缓起电路出现异常导致模块不能正常工作。得到客户允许，将7只模块带回公司做更多测试。', '', '', 'sunbin', '2016-08-30 16:58:46', '0', '2', 'new', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9568', '4158', '2016-08-30', '[sunbin]协同研发杨培云一起分析，发现上电时模块上报TX FAULT并锁存在fault状态，咨询了客户LOS机制，怀疑是由fault和LOS或触发，当前先把fault锁存解除。结合之前客户对我司模块收端DDMI的疑问，减小收端采样电阻增加监控上限。一只模块出光跳动问题目前发现可能是芯片的一个bug，培云已经在追供应商解决，见附件。后续培云会重新调测这批模块，然后送样给客户。', '', '回复_ MO2190问题.rar,', 'sunbin', '2016-08-30 17:08:21', '0', '2', 'new', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9569', '4158', '2016-09-09', '[sunbin]客户对我司重新送样的7只样品测试通过。', '', '', 'sunbin', '2016-09-13 13:39:14', '0', '2', 'new', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9570', '4158', '2016-09-09', '[sunbin]状态更改为[已处理]。', 'NULL', 'NULL', 'sunbin', '2016-09-13 13:39:14', '0', '2', 'new', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9571', '4159', '2016-09-18', '新客诉。', 'NULL', 'NULL', 'sunbin', '2016-09-19 16:38:50', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9572', '4159', '2016-09-19', '[sunbin]从客户设备反馈的信息来看，我司模块信息被设备读取出现了移位，所以设备判定为type unknown，后续需要通过写码板读取模块EE信息来确认是否是EE出错，如果EE没有问题，怀疑是思科设备在读取模块时做了算法处理导致。', 'type unknown SR.png,', '', 'sunbin', '2016-09-19 16:42:00', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9573', '4160', '2016-09-23', '新客诉。', 'NULL', 'NULL', 'sunbin', '2016-09-23 13:46:42', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9574', '4160', '2016-09-23', '[sunbin]目前需要和客户确认失效模块的SN，然后和我司内部调测数据作对比，以此确认下一步动作。', 'PO 537-ATOPUS.jpg,', '', 'sunbin', '2016-09-23 13:48:01', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9575', '4161', '2016-09-21', '新客诉。', 'NULL', 'NULL', 'sunbin', '2016-09-23 13:58:26', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9576', '4161', '2016-09-23', '[sunbin]如图，是客户有疑问的模块信息，但是不确定客户的信息是怎么读取的。', '客户有疑惑的信息.PNG,', '', 'sunbin', '2016-09-23 13:59:39', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9577', '4161', '2016-09-23', '[sunbin]如图，是QA EE截图，没有看出问题，需要与客户沟通确认。', 'EE.jpg,', '', 'sunbin', '2016-09-23 14:00:56', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9578', '4160', '2016-09-28', '[sunbin]和客户远程完了，确定了一些基本信息，40km ER 的没有问题，80km ZR 的就只有一端可以连通，请查看附件的图片，设备把模块都识别为10GE ER 40KM SFP+，我们可以从SN上分别。&lt;br /&gt;[9:00:38] bin sun: so now it is the ER can up, ZR only one side can up&lt;br /&gt;[9:00:43] Bao Nguyen: yes&lt;br /&gt;&lt;br /&gt;1，首先两只ZR对传，DDM都正常（客户给了15db衰减），有一个通道可以up，另外一个down；&lt;br /&gt;2，和别家的模块对传，ATOP ZR 的RX POWER -31db，偏小，down；&lt;br /&gt;3，两只别家模块对传没问题。&lt;br /&gt;&lt;br /&gt;综合分析，APD应该没有因为过载损坏，客户说很注意大光输入到收端的问题，而且互换模块可以发现up，说明APD是好的。比较怀疑是APD纹波问题，可能和设备上电源匹配的关系，在通道2/3上就容易出现down的情况，通道7/1虽然有出现，但是没有2/3这么容易发生。', '', '', 'sunbin', '2016-09-28 10:35:55', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9579', '4161', '2016-09-28', '[sunbin]客户检测到RX POWER LOW 报警，读到报警阈值是-25db，模块灵敏度是-30db，客户觉得不合理。从品质EE截图和研发确认，此型号模块的RX POWER LOW alarm和warning的阈值是-34db和-33db。和客户读到的阈值差异较大，怀疑EE被修改。目前在等客户拿到模块，用写码板确认EE是否正确。', '', '', 'sunbin', '2016-09-28 14:24:43', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9580', '4161', '2016-09-28', '[sunbin]客户检测到RX POWER LOW 报警，读到报警阈值是-25db，模块灵敏度是-30db，客户觉得不合理。从品质EE截图和研发确认，此型号模块的RX POWER LOW alarm和warning的阈值是-34db和-33db。和客户读到的阈值差异较大，怀疑EE被修改。目前在等客户拿到模块，用写码板确认EE是否正确。', '', '', 'sunbin', '2016-09-28 14:24:43', '0', '1', 'old', null);
