INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9582', '4162', '2016-09-19', '[sunbin]和客户远程发现EE有问题，同时看到了客户说说的flapping情况，和销售Jacob商量给客户送一块写码板，以对EE寄存器做修改。', '', '', 'sunbin', '2016-09-30 13:40:26', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9583', '4162', '2016-09-29', '[sunbin]客户拿到写码板，查看TX极性寄存器发现一个是对的，一个是错的，手动更改正确。同时修改了之前EE PN出错的部分。但是之后客户做对传还是有flapping问题，已经告知Jacob做返退。目前初步定位为海光芯创TO的那只TX眼图不良导致的失效，待拿到模块做进一步分析。', '', '', 'sunbin', '2016-09-30 13:43:19', '0', '1', 'old', null);
