INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9587', '4165', '2016-10-08', '[evan.lee]从写码截图来看，是写的XFP LR的Cisco码没错，需要进一步确认', 'QQ图片20161008132713.jpg,QQ图片20161008132543.jpg,', '', 'evan.lee', '2016-10-08 13:27:45', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9588', '4161', '2016-09-30', '[sunbin]客户拿到写码板，确认模块EE没有问题；客户提供了几个疑似可以在华为PTN上工作的模块的EE，截取部分信息到我司模块EE，待客户上线测试。', '', '', 'sunbin', '2016-10-08 14:02:23', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9589', '4161', '2016-10-08', '[sunbin]客户反馈问题依旧，收端输入光-30.4，系统就报警（应该在-33时报警），和RXDDMI调测数据（调测时用输入光是-32时校准为-33.01）对比分析，-30.4如果是客户用光功率测到的值，在插拔误差和测试误差共同影响的情况下，到达收端的光小于-32，也就是调测时对应的-33.01就会导致RX LOW POWER warning。待客户确认-30.4这个值是否是用光功率计测量得到。', '', '', 'sunbin', '2016-10-08 14:06:14', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9590', '4157', '2016-10-12', '[sunbin]正在返修：&lt;br /&gt;        1. max15059 芯片要换；&lt;br /&gt;        2. 采样电阻要换 ，限流电阻要换，DC-DC电源纹波磁珠需要更换成5欧姆电阻；&lt;br /&gt;        3.TEC 温度锁定低于40度的不要发货；&lt;br /&gt;        4.装壳的时候一定要使用AB垫胶垫好，因为客户有投诉散热问题；', '', '', 'sunbin', '2016-10-12 12:55:52', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9591', '4161', '2016-10-12', '[sunbin]把校准从Internal calibration改成External calibration(客户指定要外校准)，待客户验证结果。', '', '', 'sunbin', '2016-10-12 16:46:11', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9592', '4160', '2016-10-14', '[sunbin]正在安排RMA。销售邮件“They need these fixed and sent back ASAP but we need to make sure they are good.”', '', '', 'sunbin', '2016-10-14 14:06:41', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9593', '4162', '2016-10-14', '[sunbin]计划重新送样一对XFP BIDI样品，明确标明不要海光芯创的TO，研发确认TX极性正确。', '', '', 'sunbin', '2016-10-14 14:09:17', '0', '1', 'old', null);
