INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9595', '4166', '2016-09-22', '[cade]Cade到绵阳工厂测试，在Cisco N3K和HP 5900上多次插拔、冷启动都未出现客户的现象，建议客户在另一个订单622-ATOPUS-A到货后再测试确认下。', '', '', 'evan.lee', '2016-10-17 13:54:42', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9596', '4166', '2016-10-07', '[evan.lee]Gary回复：I sent the new 40G SRs to Archion as was told they would be ok but still issues.', '', '', 'evan.lee', '2016-10-17 13:56:05', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9597', '4166', '2016-10-13', '[evan.lee]1，从绵阳带回4pcs相同方案的模块，在QSFP评估板上测试插拔、冷启动都无异常。&lt;br /&gt;2，固件检查初始化状态，tx-fault标志在I2C初始化之前有清空。可以排除tx-fault标志的问题。&lt;br /&gt;3，从MCU上电初始化到while循环之前的初始化时间约80ms，远小于协议要求的2s。排除初始化时间的问题。&lt;br /&gt;4，据Cade说，之前调试样品时有在思科设备上无法link的情况，和客户远程时可尝试修改固件，看看是否driver未成功初始化导致。', '', '', 'evan.lee', '2016-10-17 16:04:41', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9598', '4161', '2016-10-21', '[sunbin]把模块信息改为120KM，PTN可以识别为100KM，报警门限正常。客户目前可以接受这样改动。', '', '', 'sunbin', '2016-10-21 14:25:28', '0', '1', 'old', null);
