INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9602', '4167', '2016-10-25', '[evan.lee]经查询，该批次产品是GN2010E方案，之前修复2044方案固件的时候考虑到2010E方案已经淘汰，没有进行修改。所以需要修改一版2010E方案的固件，优化一下初始化代码。', '', '', 'evan.lee', '2016-10-25 10:56:09', '0', '1', 'old', null);
