INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9604', '4168', '2016-10-26', '[sunbin]1，待收到模块后确认；&lt;br /&gt;2，已经确认客户那边的仪器有0.6nm的校准误差，导致测试结果超过spec要求范围；&lt;br /&gt;3，端面问题是我司加测后没有做端面清洁，属于流程疏忽。&lt;br /&gt;2和3已经提供FAR给客户。', '', '', 'sunbin', '2016-10-26 10:36:06', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9605', '4165', '2016-10-12', '[evan.lee]从客户发回的结果来看，模块能正确识别，监控显示tx正常发光，rx无监控，可能是光路上的问题，需要客户再排查一下光路情况。', 'QQ图片20161027094033.jpg,QQ图片20161027094039.jpg,', 'XFP.TXT,', 'evan.lee', '2016-10-27 09:43:49', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9606', '4149', '2016-10-28', '[evan.lee]客户退回给Daniel的两支模块，已经远程升级修改完毕，等待重新发给客户测试。', 'QQ截图20161028164703.jpg,QQ截图20161028164724.jpg,', '', 'evan.lee', '2016-10-28 17:37:51', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9607', '4169', '2016-10-10', '新客诉。', 'NULL', 'NULL', 'evan.lee', '2016-10-31 09:38:49', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9608', '4169', '2016-10-10', '[evan.lee]最终客户发回的错误信息。', 'QQ图片20161031093758.jpg,', '', 'evan.lee', '2016-10-31 09:39:47', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9609', '4169', '2016-10-14', '[evan.lee]和最终客户远程，确认如下：&lt;br /&gt;1，客户只有1pc XFP，现在已经在另外的地方使用中，没办法取下来改码；&lt;br /&gt;2，客户手上有其他厂商的XFP，但是加密了不知道密码没法改码测试；&lt;br /&gt;3，我们手上只有SFP+ 的H3C码和HUAWEI码，没有XFP的，如果改码只能用SFP+的来试，成功率不能保证；&lt;br /&gt;4，客户手上也没有正常能读取DDM的XFP模块；&lt;br /&gt;5，客户的意思是从我们这里再买一只XFP，然后到了过后改码测试。&lt;br /&gt;已把这些信息发给刘东方，等待和一通光电协商如何处理。', '', '', 'evan.lee', '2016-10-31 09:43:11', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9610', '4169', '2016-10-14', '[evan.lee]补一下远程图片。', 'huawei version.jpg,huawei.jpg,', '', 'evan.lee', '2016-10-31 09:46:00', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9611', '4170', '2016-10-24', '新客诉。', 'NULL', 'NULL', '', '2016-11-01 10:52:53', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9612', '4170', '2016-10-24', '[evan.lee]客户发回的错误信息截图。', 'QQ图片20161101105309.jpg,', '', 'evan.lee', '2016-11-01 10:55:36', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9613', '4170', '2016-10-25', '[evan.lee]客户反馈SFP+ LR的模块工作正常，附件是读出来的SFP+ LR的信息。', '', 'log.txt,', 'evan.lee', '2016-11-01 10:57:46', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('9614', '4170', '2016-11-01', '[evan.lee]从SFP+ LR的测试情况来看，我们的Cisco码没有问题，并且从QA查到到写码截图显示是写的正确的SFP+ ER的Cisco码。&lt;br /&gt;让客户用show version命令读取设备信息，发现系统版本是12.2(58)SE2，在思科官网搜索了一下，支持SFP-10G-ER至少需要15.0(2)SE，由此可知，是系统版本太低不支持ER产品。&lt;br /&gt;http://www.cisco.com/c/en/us/td/docs/interfaces_modules/transceiver_modules/compatibility/matrix/10GE_Tx_Matrix.html#_Toc458157339', 'QQ截图20161101110035.jpg,', '', 'evan.lee', '2016-11-01 11:06:08', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10591', '5166', '2016-10-11', '新客诉。', 'NULL', 'NULL', 'sunbin', '2016-11-09 11:23:35', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10596', '5166', '2016-10-19', '[sunbin]客诉信息，tx power -2.4dbm 超过tx power warning -3dbm，触发报警。根据我司保存的EE，我们模块内部的tx power warning 为 1dbm。', 'FAIL IMAGE.JPG,EE save2.JPG,', '', 'sunbin', '2016-11-09 14:01:48', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10597', '5166', '2016-11-09', '[sunbin]采取把传输距离从40km改为80km的办法，看是否能把报警阈值提高达到不报警的效果，Henry今天下单。', 'EE改成80km PO.JPG,', '', 'sunbin', '2016-11-09 15:50:31', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10598', '4165', '2016-11-15', '[sunbin]客户反馈的信息前后有些不一致。之前说是SFP+没有问题，XFP发端正常收端不能接收；今天的邮件又说是SFP+发端no input traffic。&lt;br /&gt;目前要确认的是从SFP+出来的光是否正常，进到XFP的光是多大是否正常？？&lt;br /&gt;11月15日：FP module is in Cisco ASR9K and XFP module is in Cisco 7600, as you can see below there is no input traffic on SFP side (ASR9K).&lt;br /&gt;10月12日：Attached you can find an XFP “show inventory” file.&lt;br /&gt;We’re aware of one interesting thing ', '', '', 'sunbin', '2016-11-15 11:40:54', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10599', '5166', '2016-11-15', '[sunbin]今天做了一对，EE传输距离改成80km，研发控制出光小于-3dbm。准备发货。', '900-ATOPEU-A.jpg,', '', 'sunbin', '2016-11-15 15:25:43', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10600', '4168', '2016-11-09', '[sunbin]1,确认是bias pin被ESD损坏，IC EOS问题，已经把损坏IC寄回原厂请他们做进一步分析；&lt;br /&gt;2，客户确认他们测试WL的仪器有0.6nm的校准误差导致测试数据和我司的数据有差异，他们已经接受我们的WL数据；&lt;br /&gt;3，端面有问题的21片会返回我司，打磨测试后再发给客户。', '', '', 'sunbin', '2016-11-16 13:24:59', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10601', '5167', '2016-11-14', '新客诉。', 'NULL', 'NULL', 'sunbin', '2016-11-16 13:33:43', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10602', '5167', '2016-11-16', '[sunbin]和客户远程，用ciena原厂的两个系列模块（NTK592NV和NTK592NG）的code导入我司模块之后问题还是一样。从目前的情况来看，是Ciena设备对原厂模块的保护，发现不是原厂模块是会修改上报导致报警。目前正在寻找修改什么字节可以使我司模块兼容Ciena设备。', 'QQ图片20161116133442.jpg,', '', 'sunbin', '2016-11-16 13:37:11', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10603', '5168', '2016-11-16', '新客诉。', 'NULL', 'NULL', 'sunbin', '2016-11-16 15:24:30', '0', '1', 'new', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10604', '5168', '2016-11-16', '[sunbin]客户发现IIC低电平电压达到600多mV，超过协议400mV最大值。&lt;br /&gt;测试是满载测试，可能是因为芯片内部上拉电阻并联之后导致上拉太强，单个测试IIC低电平电压只有300mV，是满足要求的。', 'QQ图片20161116152458.jpg,QQ图片20161116152514.jpg,', '', 'sunbin', '2016-11-16 15:27:23', '0', '2', 'new', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10605', '5168', '2016-11-16', '[sunbin]培云会联系semtech FAE寻找解决办法，如果没有处理办法，就会涉及改版，需要销售去和客户沟通。', '', '', 'sunbin', '2016-11-16 15:28:46', '0', '2', 'new', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10606', '4168', '2016-11-16', '[sunbin]1，等IC厂商反馈FAR；&lt;br /&gt;2，已经解决；&lt;br /&gt;3，端面打磨后待客户确认是否OK。', '', '', 'sunbin', '2016-11-16 15:30:21', '0', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10607', '5167', '2016-11-16', '[sunbin]目前没有解决办法，属于设备兼容问题。现在除了RXDDMI有10dbm的误差，传输不受影响，也不会触发报警，模块是可以在客户设备上工作的。Allen会和客户沟通，看客户是否接受。', '', '', 'sunbin', '2016-11-16 15:32:48', '0', '1', 'old', null);
