INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10653', '4151', '2016-10-19', '[hawk]孙彬和杨培云确认了下，是mod_desel上拉电阻的问题，电阻太小导致插入设备时无法被拉到低电平，从而识别失败，取掉后正常。<br />详见：http://61.139.89.33:8088/customerDetails/5169', null, '', 'evan', '2016-11-29 10:30:03', '30', '1', 'old', null);
