INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10655', '5170', '2016-11-16', '新客诉。', null, null, 'henry', '2016-11-30 13:03:17', '42', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10656', '5170', '2016-11-25', '[evan]客户找到两个别家的能正常工作的模块，拷码发回来。经过分析，就是普通的T码，并没有相关兼容信息。<br />并且Grzegorz把这两个码写到我们的电口模块测试过，现象是一样的。原话是Port led is green but there is no link at all.  ', null, '[\"./Uploads/CustomerComplaintAttachment/2016-11-30/code.zip\"]', 'evan', '2016-11-30 13:59:43', '30', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10657', '5170', '2016-11-29', '[evan]从FortiGate官网找到datasheet查看，发现端口描述的是Ge SFP，可能是不支持10/100/1000BAET-T模块。<br />https://www.fortinet.com/content/dam/fortinet/assets/data-sheets/FortiGate_300D.pdf <br />胡磊已经安排Daniel重新发AP-ST1给客户测试。', null, '[\"./Uploads/CustomerComplaintAttachment/2016-11-30/Catch(11-30-13-56-29).jpg\"]', 'evan', '2016-11-30 14:00:37', '30', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10658', '113', '2016-11-30', '[evan]一年多前的客诉，黄勇提到，翻出来重新看了下，客户用的设备是5120-24G EI（JE068A）和1920-48G（JG927A），官网链接如下：<br />https://www.hpe.com/h20195/v2/GetPDF.aspx/4AA3-0725ENW.pdf<br />https://www.hpe.com/h20195/v2/GetPDF.aspx/4AA5-4095ENW.pdf<br />从datasheet来看，端口模式是10/100/1000BASE自适应，应该没有发错。但是从客户发回来的截图和视频来分析，可以得出以下几个关键点：<br />1，模块是写的HP 电口码（这个码实际上在HP 2190上是不兼容的，后来发现的，这里相当于T码）；<br />2，这两个设备都不是类似公司的那台HP 2190的兼容方式（2190会直接提示unsupported），更像HP 5900的风格；<br />3，模块能在5120上读到A0信息，但是不能link（LED不亮）；<br />4，模块在1920插入就亮灯，此时并没有接网线。<br />基于以上几点，决定先在公司的HP 5900（实际上是H3C规则）上分别测试T码和H3C码的现象。', null, '[\"./Uploads/CustomerComplaintAttachment/2016-11-30/5120.jpg\",\"./Uploads/CustomerComplaintAttachment/2016-11-30/1920.jpg\"]', 'evan', '2016-11-30 14:36:54', '30', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10659', '5171', '2016-11-29', '新客诉。', null, null, 'hawk', '2016-12-02 11:13:18', '32', '1', 'new', null);
