INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10667', '5173', '2016-12-06', '[evan]从QA查到的写码记录显示是H3C码无误，和纪绮沟通，客户现场并没有原厂或者其他厂商的能正常工作的模块，初步判定是H3C在高端路由器的主引擎上有新的兼容限制，区别于普通的交换机规则。', null, '[\"./Uploads/CustomerComplaintAttachment/2016-12-06/QQ图片20161206160545.jpg\"]', 'evan', '2016-12-06 16:07:41', '30', '1', 'old', null);
