INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10670', '5175', '2016-12-13', '[hawk]目前1和3已经可以解决，冷启动问题需要客户提供失效时的具体信息，如失效时是否能访问模块信息。', null, '', 'hawk', '2016-12-13 13:18:59', '32', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10671', '5174', '2016-12-13', '[hawk]客户今天反馈目前模块失效状况是flapping，对模块按压会让link 重新建立，怀疑是和结构有关，接触不牢固。<br />Customer message :<br />The link started &quot;flapping&quot; a few hours after our tech left the installation site. My colleague initially reported that the only way to keep a link established was to press on the fiber patch cable.  Were swapped out two patch cables and finally determined that the link would establish when pressing downward on the bail of the SFP against the switch (no matter which patch cable was used).  We moved to the other SFP port in a Juniper EX2200C-12T and the symptom followed the SFP. ', null, '', 'hawk', '2016-12-13 16:36:58', '32', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10672', '5174', '2016-12-13', '[cade]建议考虑三个方面：<br />1、因为按压模块可以避免此问题，是否存在模块EMI屏蔽壳体突出高度不够。<br />2、是否存在金手指厚度不够，导致不能与connect 充分接触，需要外力按压使得金手指高速信号测接触根据良好<br />3、如果不是问题1，2 是否存在金手指上有残留的高温胶带粘合物，导致金手指与connect接触时存在不良，之前DAC 生产时遇到过此种问题。', null, '', 'cade', '2016-12-13 16:57:29', '31', '1', 'old', null);
