INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10688', '5172', '2016-12-06', '[hawk]远程之后的结论是怀疑XFP收端损坏，我司将会再发两只去换货，同时对客户手上的失效品做分析。', null, '', 'hawk', '2016-12-14 13:58:16', '32', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10689', '5173', '2016-12-14', '[evan]纪绮安排王立去客户现场，找到了几支能正常工作的原厂模块，远程拷码写入王立带的模块后能正常工作。初步判定是A2H0有别于之前从摩泰模块中拷贝的码。但是之前给客户的模块已经退回公司，暂时不用改码。', null, '[\"./Uploads/CustomerComplaintAttachment/2016-12-14/H3C_SFP_SR_161214.zip\",\"./Uploads/CustomerComplaintAttachment/2016-12-14/QQ图片20161214155218.jpg\",\"./Uploads/CustomerComplaintAttachment/2016-12-14/QQ图片20161214155222.jpg\"]', 'evan', '2016-12-14 15:54:18', '30', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10690', '5175', '2016-12-15', '[cade]工厂分析结果：<br />在金手指外部输入管脚配置为推挽方式时，模块VCC断开的情况下：<br />A，所有输入管脚为L情况下，模块VCC约为0.8V；<br />B:任何一个输入管脚为H，其它为L的情况下，模块内部VCC约2.3V；<br />C:三个及以上输入管脚为H，模块内部VCC约2.67V；<br />初步估计交换机在hard or soft boot 时 未对IO控制管脚进行处理，导致模块内部MCU工作异常。<br /><br />解决方案：输入管脚上串联500~1K 电阻，降低由输入管脚引入的电源。<br /><br />', null, '', 'cade', '2016-12-15 16:03:09', '31', '1', 'old', null);
