INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10697', '5178', '2016-12-22', '[evan]跟Lars远程，发现1590这支的确被修改，A0的92字节被修改成0x02，所以交换机显示不支持DDM，重新更改为0x68后正常。<br />客户用1590和Xgiga的80km模块对传，不能link up；<br />用1590自环测试，能link up；<br />用1590和Xgiga的40km模块对传，能link up。<br />客户认为Xgiga的80km模块broken了。<br />另外，1610客户测试发现一切正常，他怀疑终端客户误判。<br />Lars说需要做更多详细测试再回复我们，已和Lars约好圣诞后再升级firmware实现写保护功能。', null, '[\"./Uploads/CustomerComplaintAttachment/2016-12-22/修改EEPROM后的DDM截图.jpg\"]', 'evan', '2016-12-22 17:21:13', '30', '1', 'old', null);
