INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10701', '5179', '2016-12-17', '[hawk]和客户工程师Artem确认了具体细节，在常温时我司模块就发热过大，出现工作不稳定的情况。温度高一点就直接不能工作了。', null, '', 'hawk', '2016-12-22 17:43:10', '32', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10702', '5179', '2016-12-19', '[hawk]确认了两个PN（1310/1550和1550/1310）都有同样的问题。', null, '', 'hawk', '2016-12-22 17:44:11', '32', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10703', '5179', '2016-12-22', '[hawk]具体开会讨论了具体措施:<br />给客户的失效分析：示波器校准误差，导致消光比偏大，造成功耗过大，出现过热和工作不稳定的情况。<br />   待Jonas和客户沟通之后，如果需要重新送样：研发对每只样品做测试，提供详细的测试报告，并同时评估芯片更换的可靠性和光器件的优劣。<br />   后续改善措施：根据研发的测试结果，商定SFP 2.5G BIDI的整套方案，包括芯片，光器件用哪家供应商等。<br />', null, '', 'hawk', '2016-12-22 17:45:50', '32', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10704', '5180', '2016-12-21', '新客诉。', null, null, 'hawk', '2016-12-22 17:54:14', '32', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10705', '5180', '2016-12-22', '[hawk]客诉汇总，两个问题，华为设备的兼容问题是关键：<br />1，华为码不兼容导致的报警。不影响模块使用，但是因为另外两家竞争对手都可以兼容华为设备不报警，所以客户把我司优先级别排在另外两家后面。<br />      客户说另外两家是自己刷的华为码，我们在去拜访客户的时候是否有什么途径了解到竞争对手是如何取得华为码的。<br />2，客户抱怨我司模块出光不是很稳定的意思是有些模块出光大，有些出光小。这个已经解释并且得到客户理解，如果我们有第二次送样机会，我们也可以选取光功率在-2到-3dbm的，让客户知道我们也可以做到。<br />如果客户对出光范围有特别要求，我们需要考量一下生产良率，请知悉！！', null, '', 'hawk', '2016-12-22 17:55:18', '32', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10706', '5178', '2016-12-22', '[evan]补一个昨天远程读取的F4寄存器配置，固件版本是0010_V44。', null, '[\"./Uploads/CustomerComplaintAttachment/2016-12-23/f4.bin\"]', 'evan', '2016-12-23 10:33:02', '30', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10707', '5175', '2016-12-26', '[hawk]上周Cade把新做的样品寄出，此次样品更改是tx fault时对MCU做reset处理，目的是不让MCU工作在异常状态下。待客户测试结果。', null, '', 'hawk', '2016-12-26 17:28:27', '32', '1', 'old', null);
