INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10713', '5180', '2016-12-28', '[evan]到绵阳工厂S5700上测试，发现13个鼎频的码全部有告警，说明客户的设备并不是严格的华为兼容规则，初步估计是只需要写入华为的PN即可。', null, '[\"./Uploads/CustomerComplaintAttachment/2017-01-06/IMG_20161228_110521.jpg\",\"./Uploads/CustomerComplaintAttachment/2017-01-06/IMG_20161228_110536.jpg\"]', 'evan', '2017-01-06 09:44:09', '30', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10714', '5180', '2016-12-30', '[evan]王立第二次去客户现场，再次拷贝了一个鼎频的码，确认没有拷错。按照之前的猜想，将2pcs LR和2pcs SR分别写入T码和带有华为PN的码，等待客户测试。', null, '', 'evan', '2017-01-06 10:04:55', '30', '1', 'old', null);
