INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10716', '5182', '2017-01-06', '[hawk]和客户沟通过，模块在工作4小时后发端不出光，导致连接中断。模块已经退回绵阳，研发已经确认模块不发光，怀疑是TEC损坏，后续会把器件退回供应商分析。', null, '', 'hawk', '2017-01-06 17:51:58', '32', '1', 'old', null);
