INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10718', '5183', '2017-01-06', '[hawk]考虑到客户要应用在10M/100M/1000M上，不能直接用AP-ST1替换。<br />AP-ST2存在cable不插入也会显示link的问题，新的方案要在下半年才会推出。', null, '', 'hawk', '2017-01-06 17:57:33', '32', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10719', '5181', '2017-01-06', '[hawk]SFP 40KM用FP方案的确存在传纤40km会有误码，可以用DFB方案替换，目前内部已经协商一致，待销售和客户确认是否接受第三次送样。', null, '', 'hawk', '2017-01-06 18:00:17', '32', '2', 'new', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10720', '5182', '2017-01-09', '[纪绮]本人与客户沟通，建议，客户在S6720-30C-EI-24S设备上，在打个环路跑下（+10db），看看是否还会存在类似的问题断网，客户担心不带流量跑，无法付现出当时的问题，请研发给个确定的答复，谢谢!', null, '', 'jiqi', '2017-01-09 16:35:42', '45', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10721', '5178', '2017-01-10', '[evan]跟Lars远程，他回复说CWDM的问题已经解决了，不用升级firmware，另外给他改了个SFP BIDI的H3C兼容码。', null, '', 'evan', '2017-01-10 16:20:26', '30', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10722', '5178', '2017-01-10', '[evan]状态改为[已处理]。', null, '', 'evan', '2017-01-10 16:20:26', '30', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10723', '5184', '2016-10-07', '新客诉。', null, null, 'evan', '2017-01-11 14:04:50', '30', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10724', '5184', '2016-12-29', '[evan]很长时间没有反馈，Elliot最新邮件说&quot;The link is established but I am not able to send traffic over the link.&quot; 并且有很多关于I2C bus的错误提示：<br />THU DEC 29 07:19:07 2016    PRB-CHASSIS   error Error reading temperature sensor<br />THU DEC 29 07:19:10 2016         SYSTEM   alert i2cBusLock: I2c bus unlocked!<br />THU DEC 29 07:19:10 2016         SYSTEM    info i2cBusLock: Proceeding to recover I2C!!<br />THU DEC 29 07:19:10 2016         SYSTEM   error i2cBusLock: Failed to recover I2C after 3 retries!<br />问题不止一个，可能需要远程确认。', null, '', 'evan', '2017-01-11 14:13:14', '30', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10725', '5184', '2017-01-10', '[evan]和Elliot远程，详细了解了下情况，模块本身是写Alcatel码没有问题，有一支一直正常工作（包括反复插拔），另外的（没说具体有几支）一支能link up，但是ping包不通。联想到之前XFP BIDI有寄存器配错导致极性反了的问题，检查了一下F4[01]80字节，正常的那支是82，不正常的是C6，尝试将C6更改为C2后，让Elliot测试。', null, '[\"./Uploads/CustomerComplaintAttachment/2017-01-11/1_working one.jpg\",\"./Uploads/CustomerComplaintAttachment/2017-01-11/2_not working.jpg\",\"./Uploads/CustomerComplaintAttachment/2017-01-11/4_bad one register.jpg\",\"./Uploads/CustomerComplaintAttachment/2017-01-11/3_working one register.jpg\",\"./Uploads/CustomerComplaintAttachment/2017-01-11/5_bad one after changing.jpg\"]', 'evan', '2017-01-11 14:19:59', '30', '1', 'old', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10726', '5180', '2017-01-11', '[evan]毛工最新测试结果，改码后的模块警告大大减少，客户表示接受，要求重新送样测试，已联系纪绮重下样品单。<br />按我们的推断改了码后应该没有警告才对，这里警告变少很奇怪，不过不用深究了，毕竟深究到后面估计不会有什么进展，华为兼容始终是个短板。', null, '[\"./Uploads/CustomerComplaintAttachment/2017-01-11/QQ截图20170111175508.jpg\"]', 'evan', '2017-01-11 18:00:40', '30', '1', 'old', null);
