INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10738', '5187', '2017-01-19', '[hawk]我司AP-ST2模块吞吐量测试不达标，测试数据客户觉得很不理想。<br />They are having some issues with them.  As follows – customer is asking how these were tested – see their results above :<br /> <br />I tested two 3rd party SFPs, and a result looks terrible.<br />For the test, I used EXFO tester FTB-1 and ran the RFC-2544 test.<br />The RFC-2544 attached for:<br /> <br />-              SFP 10/100/1000BASE-T SFP SN: SGDGT44400116<br />-              SFP 10/100/1000BASE-T SFP SN: SGDGT44400117<br /> <br />To compare I attached RFC-2544 test for other SFP which we are using:<br />-              Integra - SFP 10/100/1000 SFP TXM<br />-              Worldwide Supply Optics – GLC-T-W 1000BASE-T SFP copper<br />-              HP J8177C 1000BASE-T', null, '', 'hawk', '2017-01-20 11:21:55', '32', '1', 'old', null);
