INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10826', '5212', '2017-05-11', '[xiaoaiyou]Dear cole,<br /><br />       1.       Sensitivity at lot Temp. : out of Spec.<br />                  As you said,Maybe APD Biase LUT setting have some problem at -20 ~ -40 degree.<br />2.       Current consumption at high Temp. : out of Spec.<br />        From the data, our test temperature is not as strict as yours which leads to differences.<br />3.       D.P ( &lt; 3 ) : out of Spec.<br />        Our DP is  a little critical,but we test the 80km fiber use SDH analyzer.<br />4.       Your test report shows DDM Temp : -24 ~ -27C<br />-&gt; when measuring, we saw Ta-30/Tc-20.2 C at DDM Temp -25.<br />-&gt; It seems the temp condition has not been properly set up thus, the current consumption is also low, and TEC current is also changed.<br />Calibration for matching Tc and Tddm does have problem.We use Linear calibration model which make High temperature calibration is more accurate than low temperature calibration.<br />5. EEPROM Data : most of values are differently filled in from the original specification.<br />          Do you mean A0 3F&amp;5F and A2 5F are different from the original specification?', null, '', 'xiaoaiyou', '2017-05-12 09:32:02', '53', '2', 'new', null);
