INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10858', '5221', '2017-05-25', '[hawk]和Evan一起与客户远程分析了一下问题原因，客户设备ME3600在读取SFP PID时是读取的A2的高半区，但是在读取SFP+ PID时是读取的A0的高半区。我司SFP+ A0高半区是存的配对信息，所以设备无法读取到PID信息，不能识别模块。<br />这种情况比较特殊，但是可以操作处理，待客户收到我司写码板后，远程把A2高半区信息拷贝到A0高半区来处理。', null, '[\"./Uploads/CustomerComplaintAttachment/2017-05-27/ACT.png\"]', 'hawk', '2017-05-27 09:50:09', '32', '2', 'new', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10859', '5221', '2017-05-26', '[hawk]补充一组客户设备ME3600读到的PID和我司模块EE的信息。', null, '[\"./Uploads/CustomerComplaintAttachment/2017-05-27/ACT1.png\",\"./Uploads/CustomerComplaintAttachment/2017-05-27/ACT2.png\"]', 'hawk', '2017-05-27 09:55:39', '32', '2', 'new', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10860', '5221', '2017-05-27', '[hawk]给客户远程时把A2高半区复制到A0高半区。<br />如图，主要是保证PID写入到A0高半区。', null, '[\"./Uploads/CustomerComplaintAttachment/2017-05-27/ACT3.png\"]', 'hawk', '2017-05-27 10:06:52', '32', '2', 'new', null);
