INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10864', '5221', '2017-06-07', '5月30日给客户更改了11片，客户测试OK。目前客诉处理结束，但是针对此类设备需要对写码做特别定制，邮件已经知会研发和销售，如下：<br />----------------------------------------------------------------------------------------------------------------------<br />印度重点客户ACT客诉：在思科设备ME3600上，我司SFP 1.25G模块工作正常，SFP+ 10G模块不能被识别。<br />和李平一起和客户远程发现，ME3600在读取SFP+ 模块信息时，PID是读取的A0高半区（ME3600读取SFP模块PID信息是读取的A2高半区，而且通常设备读取PID都是读取的A2高半区）。<br />昨天帮客户手上11片SFP+模块的A0高半区信息全部用A2高半区信息覆盖后在ME3600设备上可以工作。<br /><br />所以后续给ACT供货时（用在ME3600上）需要注意：写码时PID信息要存放在A0高半区，为了匹配不同设备建议在A0高半区和A2高半区都存放PID信息，但是我司本来在A0高半区存放的配对信息就需要再找地方存放或者删除，请研发讨论一下怎么处理。谢谢！', null, '', 'hawk', '2017-06-07 11:22:21', '32', '2', 'new', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10865', '5221', '2017-06-07', '销售在给ACT下单时，如果是用在思科ME3600设备上，请务必备注：<br />SFP+ 思科码，PID等相关信息需要存在A0H ！！！<br /><br />至少第一次需要知会李平生成给ACT SFP+产品定制的思科码！！！', null, '', 'hawk', '2017-06-07 11:27:29', '32', '2', 'new', null);
