INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10868', '5209', '2017-06-08', '6月7日研发确认了失效的rootcause，是driver IC的供电磁珠因为受力损坏导致无法给driver IC正常供电，使得模块工作不起来。<br />改进办法涉及重新制板（SFP/SFP+ ZR），所以周期会比较长（需要重新做PCB、SMT、FVT和EVT），预计能重新送样的时间是8月中旬。需要销售评估一下这个时间是否可以接受，研发再根据实际情况作出调整。', null, '', 'hawk', '2017-06-08 10:12:02', '32', '2', 'new', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10869', '5222', '2017-06-08', '客户发聩了2个问题；1，冷启动问题，模块和仪器同时上电后，我司模块link down。罗洋在我司设备上复现了此问题。 2， 模块传输问题， 两个 ATOP 模块在同一个以太网上传输，当其中一个模块断掉业务时，这个模块的业务不会转移到另一个模块上。我司不具备做这个实验的条件，不能提供相应的改善', null, '', 'tangzhiqiang', '2017-06-08 11:44:38', '86', '2', 'new', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10870', '5222', '2017-06-08', '远程无法解决客诉， 如果客户不接受此模块的两个问题，建议把模块退后研发分析。', null, '', 'tangzhiqiang', '2017-06-08 11:48:55', '86', '2', 'new', null);
