INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10885', '5209', '2017-06-15', 'FB3磁珠损坏导致Rx CDR supply 不能正常工作，从而影响到Driver I2C 正常通信；<br />模块插入座子，受到座子对金手指施加的垂直向下的压力，而PCB后半部分受结构外壳定位点的支撑，不允许形变，此时座子和金属外壳压点对PCB同时施加压力导致PCB表面形成翘曲张力。而磁珠是两端通过焊盘焊锡固定，当PCB翘曲张力大于磁珠所能承受的拉力，磁珠断裂；<br />临时改善措施:<br />将磁珠替换为电阻，由于磁珠材质较脆，在收到应力形变时有断裂风险，可以暂时用0 ohm电阻替代，但需要详细验证可行性；<br />长期改善措施:<br />使用新板PCB，新设计PCB已将磁珠位置放置到不容易受应力区域，同时需要调整结构件对pcb压点处的空间，减小模块在插入插座时，PCB所受的刚性形变。<br />', null, '', 'yubo', '2017-06-15 13:39:38', '57', '4', 'new', null);
INSERT INTO `atop_oacustomercomplaintlog` VALUES ('10886', '5209', '2017-06-15', '6月13日，根据各部门讨论，完成FAR报告，（报告内容与实际情况有改动）', null, '[{\"SourceName\":\"FAR1706001RMA（Menera）.doc\",\"SaveName\":\"FAR1706001RMA（Menera）.doc\",\"SavePath\":\"./Uploads/RMA/5209/FAR1706001RMA（Menera）.doc\"}]', 'yubo', '2017-06-15 13:43:22', '57', '4', 'new', null);
