INSERT INTO `atop_project` VALUES ('27', 'PLN-2017-A-002', '10G EPON 非对称  &amp;  XGPON  ONU', '黄正银', '', '马晓东', '罗洋', '陈卫', '刘燕', '陈卫', '李平', '唐治强', 'PON ONU', '新设计', 'APXEUSY25HCDSP3', '28L95/GN7355+F396', '$10M', 'TBD', '40', '在固网宽带建设中，EPON/GPON以其较高的性价比获得最为广泛的应用，然而在普及百兆、迈向千兆的今天， EPON/GPON不能满足未来面对每户100M-1G的带宽需求，PON网络迈向10G的趋势不可逆转，未来几年将是10G PON大规模商用的黄金时期。\n本项目采用我司开发的10G ONU BOSA，自主设计PCB和固件开发，完成设计开发和至少20只样品，通过客户样品验证。', '肖晓', '1481500800', '1508743821', 'project', '100', '99,81,59,79,70,79,30,86', '2016-12-12', '0', '0', '1');
INSERT INTO `atop_project` VALUES ('28', 'PLN-2017-A-002', '10G  EPON 对称', '黄正银', '肖晓', '马晓东', '罗洋', '陈卫', '刘燕', '陈卫', '李平', '唐治强', 'SFP+', '新设计', 'APXGUAS25HCDSN2', 'GN28L95', '$10M', 'TBD', '40', '在固网宽带建设中，EPON/GPON以其较高的性价比获得最为广泛的应用，然而在普及百兆、迈向千兆的今天， EPON/GPON不能满足未来面对每户100M-1G的带宽需求，PON网络迈向10G的趋势不可逆转，未来几年将是10G PON大规模商用的黄金时期。 本项目采用我司开发的10G ONU BOSA，自主设计PCB和固件开发，完成设计开发和至少20只样品，通过客户样品验证。', '肖晓', '1481500800', '1508744003', 'project', '100', '99,59,81,79,79,30,70,86', '2016-12-12', '1', '27', '1');
INSERT INTO `atop_project` VALUES ('30', 'PLN-2017-A-005', '40G CABLE优化项目', '陈实', '肖晓', '马晓东', '陈实', '陈卫', '马晓东', '陈卫', '李平', '唐治强', 'DAC', '提高良率优化性能', 'APCA04-QQCXXX-XX', 'EFM8BB21+SN65LVCP1412', '$2M', '京东 阿里巴巴', '35', '40G DAC CABLE优化项目，基于上一版40G 有源DAC在生产加工上的良率很低，制作困难，性能指标与无源产品相比提升不明显而进行的升级优化项目，目标是针对之前版本的缺陷处进行改良，以提升该产品的质量及生产良率，降低产品的总体成本，提升产品市场竞争力。\n本项目主要优化的是产品芯片方案及PCBA的焊接线序，芯片采用SILICON LABS的EFM8BB21+TI的SN65LVCP1412，线序与现有良率较高的无源DAC产品一致，并尽量优化PCB的尺寸外形以便于生产加工，产品加工良率达到90%以上。', '卞思伟', '1486339200', '1509436152', 'project', '100', '60,59,60,79,59,79,30,86', '2017-02-06', '0', '0', '1');
INSERT INTO `atop_project` VALUES ('31', 'PLN-2017-A-003', 'SFP28 LR项目 ', '陈实', '肖晓', '马晓东', '陈实', '陈卫', '刘燕', '陈卫', '李平', '唐治强', 'SFP28', '新设计', 'APSP831B53CDL10', 'M37030A+DS4834', '$5M', 'HP ERICSSON', '120', 'SFP28模块，基于SFP+的封装形式，支持25G以太网标准。SFP28能提供25Gb/s的无误码传输，应用于高密度的25G以太网交换机和网路接口中，促进数据中心的服务器连接。它采用如今流行的SFP+封装形式，为企业升级10G以太网连接，提供了一个更具成本效益的解决方案。\n本项目目前光器件采用AOI和MACOM的TO方案+SEMTECH的25G ROSA方案，主芯片采用MACOM的M37030A方案，由于该项目的模块芯片及光器件还未成熟，进一步的转产及量产还需根据物料的具体情况再做确定。', '卞思伟', '1490150909', '1508312709', 'project', '100', '60,59,60,79,70,79,30,86', '2016-12-16', '0', '0', '1');
INSERT INTO `atop_project` VALUES ('33', 'PLN-2017-A-001', ' CSFP+项目', '杨培云', '肖晓', '马晓东', '罗洋', '陈卫', '刘燕', '陈卫', '李平', '唐治强', 'CSFP+', '新设计', 'APCSxxB33CDL10', 'MAX24016+DS4834', '$3M', ' BKTEL', '60', 'CSFP+（Compact Small Form Factor Pluggable plus）是在SFP基础上发展的更为先进，更为紧凑的封装，能提供两通道Bidirection传输能力， 在兼容SFP+结构尺寸同时，提供两倍的数据传输能力。适用于高密度数据传输的6G/8G/10G应用，具有广泛的应用前景。\n本项目采用与厦门三优光电股份公司联合开发的mini BOSA，自主设计PCB和固件开发，完成客户样品认证，并发完成小批量试产，并转入量产 。', '卞思伟', '1490256337', '1509089368', 'project', '100', '52,59,81,79,70,79,30,86', '2016-11-11', '0', '0', '1');
INSERT INTO `atop_project` VALUES ('34', 'PLN-2017-A-004', 'SFP+ AOC优化项目            ', '肖艾佑', '', '马晓东', '肖艾佑', '陈卫', '刘燕', '陈卫', '李平', '唐治强', 'AOC', '提高良率优化性能', 'APCO01-SSCXXX-XX', 'DS4834+GN2044', '$5M', '世纪互联', '160', '数据中心/云计算系统在更高带宽和更低功耗上的需求越来越迫切，AOC有源光缆是满足此需求的最优解决方案之一。AOC有源光缆与互联铜缆相比拥有许多显著的优势, 比如在系统链路上的传输功率更低，重量仅为直连铜缆四分之一，体积略为铜缆的一半，并且在机房布线系统中具有更好的空气流动散热性，光缆的弯折半径比铜缆做得更小，传输距离更远(可以达到100~300米)，且产品传输性能的误码率也更优，BER可以达到10^-15。SFP+AOC 具有更加广泛的应用前景。\n本项目采用Luxnet的VCSEL激光器（非COB方案），自主设计PCB和固件开发，完成客户样品认证，并发完成小批量试产，并转入量产 。', '肖晓', '1490263452', '1508920873', 'project', '100', '53,59,53,79,79,30,70,86', '2016-11-11', '0', '0', '1');
INSERT INTO `atop_project` VALUES ('35', 'PLN-2017-B-013 ', 'SFP+ DAC ACTIVE CABLE 15M', '肖艾佑', '肖晓', '马晓东', '肖艾佑', '陈卫', '刘燕', '陈卫', '李平', '唐治强', 'DAC', '新设计', 'APCA01-SSC150-24', 'ONET8501V+GN2003S', '$1M', '数据中心', '40', '数据中心/云计算系统在更高带宽和更低功耗上的需求越来越迫切，cable有源光缆是满足此需求的最优解决方案之一。Cable更大优势便是其价格优势。随着客户对价格的敏感程度越来越高，传统设计的cable方案成本已经不能满足客户日益增长的需求，因此更低成本的cable显得尤为迫切。\n本项目核心采用850nm的驱动芯片替代之前方案的CDR芯片以及更换性价比更高的MCU，自主设计PCB和固件开发，完成客户样品认证，并发完成小批量试产，并转入量产 。', '卞思伟', '1490690852', '1506316362', 'project', '100', '53,59,53,79,70,79,30,86', '2016-11-11', '0', '0', '1');
INSERT INTO `atop_project` VALUES ('41', 'PLN-2017-B-013', 'SFP+ DAC ACTIVE CABLE 10M', '肖艾佑', '肖晓', '马晓东', '肖艾佑', '陈卫', '刘燕', '陈卫', '李平', '唐治强', 'DAC', '新设计', 'APCP01-SSC100-24', 'ONET8501V+ONET1151P', '$1M', '数据中心', '20', '数据中心/云计算系统在更高带宽和更低功耗上的需求越来越迫切，cable有源光缆是满足此需求的最优解决方案之一。Cable更大优势便是其价格优势。随着客户对价格的敏感程度越来越高，传统设计的cable方案成本已经不能满足客户日益增长的需求，因此更低成本的cable显得尤为迫切。 本项目核心采用850nm的驱动芯片替代之前方案的CDR芯片以及更换性价比更高的MCU，自主设计PCB和固件开发，完成客户样品认证，并发完成小批量试产，并转入量产 。', '卞思伟', '1490770936', '1506316420', 'project', '100', '53,59,53,79,70,79,30,86', '2016-11-11', '1', '35', '1');
INSERT INTO `atop_project` VALUES ('50', 'PLN-2017-B-008', 'GPON OLT项目', '黄正银', '肖晓', '马晓东', '罗洋', '陈卫', '刘燕', '陈卫', '李平', '唐治强', 'GPON OLT', '新设计', 'APGPL43ASLCDSC+', 'F396+GN25L95', '$ 10M', 'Nokia,中兴', '40', '在FTTx快速发展的今天，GPON OLT做为其重要的连接支点，为光网络的快速普及和发展发挥了重要作用。面对OLT市场的发展需求，持续加强对PON OLT的开发投入是明确的发展趋势。本项目采用现有的BOSA方案，自主设计PCB并进行固件开发，完成设计验证并送样，通过客户样品验证', '肖晓', '1500275820', '1509529028', 'project', '100', '99,99,81,79,30,70,79,86', '2017-07-14', '0', '0', '1');
INSERT INTO `atop_project` VALUES ('46', 'PLN-2017-A-017', 'XFP_ZR Low Power优化项目', '肖艾佑', '肖晓', '马晓东', '肖艾佑', '陈卫', '刘燕', '陈卫', '李平', '唐治强', 'XFP', '提高良率优化性能', 'APX55HM3CDL80', 'ADUC7023+Gn2044', '$1M', 'Tajas', '170', '随着客户对低功耗的要求越来越敏感，传统模块的功耗2.0W已经不能再满足客户日益增长的对低功耗的迫切需求。开发全温段&lt;1.6W功耗的模块已经是趋势；且低功耗在打开未来市场具有更加广泛的竞争力。本项目采用Sumitomo的EML激光器和SiFotonics的APD，自主设计PCB和固件开发，完成客户样品认证，并发完成小批量试产，并转入量产 。', '卞思伟', '1492585668', '1508920539', 'project', '100', '53,53,59,79,30,70,79,86', '2017-04-03', '0', '0', '1');
INSERT INTO `atop_project` VALUES ('48', 'PLN-2017-B-012', ' SFP+ ER/ZR低功耗优化项目', '肖艾佑', '肖晓', '马晓东', '肖艾佑', '陈卫', '刘燕', '陈卫', '李平', '唐治强', 'SFP+', '提高良率优化性能', 'APSP55HM3CDL80', 'DS4834+GN2044', '5M', 'Coriant，中兴', '170', '随着客户对低功耗的要求越来越敏感，传统模块的功耗2.0W已经不能再满足客户日益增长的对低功耗的迫切需求。开发全温段&lt;1.6W功耗的模块已经是趋势；且低功耗在打开未来市场具有更加广泛的竞争力。\n本项目采用Sumitomo的EML激光器和SiFotonics的APD，自主设计PCB和固件开发，完成客户样品认证，并发完成小批量试产，并转入量产 。', '卞思伟', '1494483508', '1508320308', 'project', '100', '53,59,53,79,70,79,30,86', '2016-11-11', '0', '0', '1');
INSERT INTO `atop_project` VALUES ('49', 'PLN-2017-B-010', 'SFP28 SR', '陈实', '肖晓', '马晓东', '陈实', '陈卫', '刘燕', '陈卫', '李平', '唐治强', 'SFP28 SR', '新设计', 'APSP8SRB53CDL01', 'DS4834+M37028', '$5M', 'AMAZON, ALIBABA', '60', 'SFP28模块，基于SFP+的封装形式，支持25G以太网标准。SFP28能提供25Gb/s的无误码传输，应用于高密度的25G以太网交换机和网路接口中，促进数据中心的服务器连接。它采用如今流行的SFP+封装形式，为企业升级10G以太网连接，提供了一个更具成本效益的解决方案。', '肖晓', '1497420739', '1508140977', 'project', '100', '60,60,59,79,30,70,79,86', '2017-05-08', '0', '0', '1');
INSERT INTO `atop_project` VALUES ('54', 'PLN-2017-A-018', 'SFP+ LR 12.5G MAX24016低功耗', '李川', '肖晓', '马晓东', '李川', '陈卫', '刘燕', '陈卫', '李平', '唐治强', 'SFP+', '新设计', 'APSP31HM3xDL10', 'DS4834+Max24016', '$ 10M', '中兴', '40', '本项目是为满足客户提出的需求，SFP+ LR 的模块支持到速率12.5G,功耗满足0.8W。基于平台DS4834+Max24016新开发的一款SFP+ LR 的产品', '肖晓', '1504775208', '1508835956', 'project', '100', '101,59,101,79,70,79,30,86', '2017-08-01', '0', '0', '1');
INSERT INTO `atop_project` VALUES ('55', 'PLN-2017-A-019', 'QSFP28 LWDM4(IO solution&amp;大连藏龙) 项目', '陈实', '', '马晓东', '陈实', '陈卫', '刘燕', '陈卫', '李平', '唐治强', 'QSFP28', '新设计', 'APQP2LRA3CDL10，APQP2LRA3CDL2', 'DS4830A+GN2104', '$ 10M', '中兴、亚马逊', '1500', 'QSFP28模块，基于QSFP28的封装形式，支持103G及112G以太网标准。QSFP28能提供4X25Gb/s或4X28Gb/s的无误码传输，应用于高密度的100G以太网交换机和网路接口中，促进数据中心的服务器连接。本项目目前光器件计划采用仕佳光子，大连藏龙，IOSolution等光器件方案+SEMTECH的100G CDR：GN2104方案，目前由于器件性能暂未评估，进一步的转产及量产的器件方案还需根据前期评估的具体情况再做确定。', '肖晓', '1505714306', '1509527895', 'project', '100', '60,60,59,79,30,70,79,86', '2017-07-10', '0', '0', '1');
INSERT INTO `atop_project` VALUES ('56', 'PLN-2017-A-019', 'QSFP28 CWDM4(仕佳光子) 项目', '陈实', '肖晓', '马晓东', '陈实', '陈卫', '刘燕', '陈卫', '李平', '唐治强', 'QSFP28', '新设计', 'APQP2LRA3CDL10，APQP2LRA3CDL2', 'DS4830A+GN2104', '$ 10M', '中兴、亚马逊', '1500', 'QSFP28模块，基于QSFP28的封装形式，支持103G及112G以太网标准。QSFP28能提供4X25Gb/s或4X28Gb/s的无误码传输，应用于高密度的100G以太网交换机和网路接口中，促进数据中心的服务器连接。本项目目前光器件计划采用仕佳光子，大连藏龙，IOSolution等光器件方案+SEMTECH的100G CDR：GN2104方案，目前由于器件性能暂未评估，进一步的转产及量产的器件方案还需根据前期评估的具体情况再做确定。', '肖晓', '1505716416', '1509527812', 'project', '100', '60,59,60,79,70,79,30,86', '2017-07-10', '1', '55', '1');
INSERT INTO `atop_project` VALUES ('57', 'PLN-2017-A-020', 'QSFP28 DD', '肖艾佑', '', '马晓东', '肖艾佑', '陈卫', '刘燕', '陈卫', '李平', '唐治强', 'QSFP28', '新设计', 'QSFP-DD', 'Gn2105+GN2147', '$10M', '中兴', '2000', 'QSFP28-DD模块，基于QSFP28的封装形式，支持200G以太网标准。', '肖晓', '1505983392', '1509527731', 'project', '100', '53,53,59,79,30,70,79,86', '', '0', '0', '1');
INSERT INTO `atop_project_discuss` VALUES ('1', '27', '&lt;p&gt;结构件：2016/12/20到2016/12/23进度：收端 发端FPC 以及对称非对称PCBA禁布图 已经发给硬件 现在硬件在确定layout空间 并反馈发热IC位置 结构件上设计热沉位置 出2D图纸&lt;br/&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 2017/01/02到2017/01/06进度：硬件请假了2天，昨天在开始移交工作；硬件延后给出确定的IC发热区，图纸待更新&lt;/p&gt;&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 2017/01/06到2017/01/13 因工作交接延误&lt;/p&gt;&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 2017/01/15完成设计图纸&lt;/p&gt;&lt;p&gt;PCB Layout：2016/12/23~2016/12/30进度1.10G EPON非对称&amp;nbsp; 由于工程师请假，导致进度有延期&lt;br/&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp; 2.10G EPON对称ONU 由于布板空间及接收柔板焊接方式，多次确认结构&lt;br/&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 2016/12/30~2017/01/06对称由于样品及试产优先，导致进度有耽搁&lt;/p&gt;&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;2017/01/13完成PCB Layout并投板&lt;/p&gt;&lt;p&gt;光器件，PCB和结构件等物料采购准备：&lt;/p&gt;&lt;p&gt;2017/01/13~2017/01/20 进度：1.PCB采购中 预计2月25号到厂，&amp;nbsp; &lt;br/&gt;&lt;/p&gt;&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 2.ONU结构件 采购还在和供应商商务洽谈，&lt;/p&gt;&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 3.ONU BOSA 已经外协制作中 发端10G 1270nm/收端SIF5颗&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 海光 2颗；非对称1310领拓创答应提供； 2.5G GPON ONU 发&amp;nbsp; 端 管芯还在寻找。&lt;br/&gt;2月17日更新：PCB采购中 预计2月25号到厂10G ONU采购还在确定供应商；10G&amp;nbsp; EPON ONU BOSA供应商（隔离器还未到货）&lt;br/&gt;2月24日更新： BOSA领拓创物料已经到期；答应下周二28号送样结构件 采购已经下单；供应商未回复交期，onu物料基本到齐，准备贴片了&lt;br/&gt;3月3日更新； 对称 非对称的pcb已贴好，对称pcba已发到成都调试固件中，非对称pcba调试中，组件预计本周完成 &lt;br/&gt;结构件&amp;nbsp; 现钣金EMI弹片现有供应商不做 已引入新的供应商 商务洽谈中&lt;br/&gt;3月10日更新：1、非对称ONU 寄存器配置已大致完成，发端眼形已调试完成，收端APD电压已调试出来，待光组件到后进一步试。&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 2、对称 ONU 固件调试ADP电压已正常，发端眼图还未看。 &amp;nbsp;&lt;br/&gt;3、4只对称（其中有2只是海光芯创的APD，有2只SI的APD），3只非对称今日已发往绵阳，3月13日收到后做验证。&lt;br/&gt;4、机加工今日发出一套样品，3月13日收到后做验证。&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '58', '1489727530', null, null);
INSERT INTO `atop_project_discuss` VALUES ('2', '27', '&lt;p&gt;&lt;span style=&quot;color: inherit ! important; background-color: transparent; font-family: 宋体; font-size: 10.5pt; line-height: 1.5;&quot;&gt;3月17日更新&lt;/span&gt;1.光组件管脚顺序有误，已经发回厂家修改，待厂家评估后回复返修交期。&lt;/p&gt;&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 2.非对称2.5G眼图差，需进一步调试。&lt;/p&gt;&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 3.结构件底座存在光器件卡槽尺寸问题，目前已修改图纸返修给厂家，预计3月21日交付给陈工后，再次验证。&lt;span style=&quot;color: inherit ! important; background-color: transparent; font-family: 宋体; font-size: 10.5pt; line-height: 1.5;&quot;&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '58', '1489736919', null, null);
