p;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\n 3.ONU BOSA 已经外协制作中 发端10G 1270nm/收端SIF5颗&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 海光 2颗；非对称1310领拓创答应提供； \n2.5G GPON ONU 发&amp;nbsp; 端 管芯还在寻找。&lt;br/&gt;2月17日更新：PCB采购中 预计2月25号到厂10G ONU采购还在确定供应商；10G&amp;nbsp; EPON ONU BOSA供应商（隔离器还未到货）&lt;br/&gt;2月24日更新： BOSA领拓创物料已经到期；答应下周二28号送样结构件 采购已经下单；供应商未回复交期，onu物料基本到齐，准备贴片了&lt;br/&gt;3月3日更新；&amp;nbsp; 非对称的pcb已贴好，对称pcba已发到成都调试固件中，非对称pcba调试中，组件预计本周完成 &lt;br/&gt;结构件&amp;nbsp; 现钣金EMI弹片现有供应商不做 已引入新的供应商 商务洽谈中&lt;br/&gt;3月10日更新：1、非对称ONU 寄存器配置已大致完成，发端眼形已调试完成，收端APD电压已调试出来，待光组件到后进一步试。&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;br/&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 2、3只非对称今日已发往绵阳，3月13日收到后做验证。&lt;br/&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 3、机加工今日发出一套样品，3月13日收到后做验证。&lt;br/&gt;&lt;/p&gt;&lt;p&gt;3月10日更新1.光组件管脚顺序有误，已经发回厂家修改，待厂家评估后回复返修交期。&lt;br/&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 2.非对称2.5G眼图差，需进一步调试。&lt;br/&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 3.结构件底座存在光器件卡槽尺寸问题，目前已修改图纸返修给厂家，预计下周2交付给陈工后，再次验证&lt;/p&gt;', '58', '1489737716', null, null);
INSERT INTO `atop_project_discuss` VALUES ('4', '27', '&lt;p&gt;1.10G非对称ONU灵敏度低问题已解决，确认为接收均衡设置不合理导致，常温3次方灵敏度可达-30.5dBm&lt;/p&gt;&lt;p&gt;2.后续需优化发端2.5G眼图及接收高低温评估&lt;/p&gt;', '52', '1490006635', null, null);
INSERT INTO `atop_project_discuss` VALUES ('5', '27', '&lt;p&gt;因为BOSA pin脚定义错误，领拓创需要对BOSA样品进行返工，与领拓创沟通，可以先提供低功率的样品用于验证和调试，后续再按标准功率要求提供样品。&lt;/p&gt;&lt;p&gt;今天检查发端眼图，经过优化能够满足10G EPON的非对称方案要求。明天安排发两对2.5G DFB和10G APD TO给领拓创，安排封XGPON BOSA。&lt;/p&gt;&lt;p&gt;初步确认非对称方案的收发端的功能正常，下周收到正常的BOSA样品后再详细EVT验证；&lt;/p&gt;&lt;p&gt;结构件本周收到样品发现尺寸有问题，已经发给供应商返工，预计下周能收到样品后验证装配是否有问题。&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '54', '1490178082', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('6', '33', '&lt;p&gt;2016-11-16~11-23进度更新：完成兼容现有结构件的PCB PS及柔板PS,并完成3D装配模拟图(文件如附件)&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_rar.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170323/1490262921322308.rar&quot; title=&quot;10G-CSFP.rar&quot;&gt;10G-CSFP.rar&lt;/a&gt;&lt;/p&gt;&lt;p&gt;2016-11-24~12-13进度更新：完成PCB及柔板初稿设计&lt;/p&gt;&lt;p&gt;2016-12-14~12-15进度更新：完成PCB及柔板设计规范自审及PCB、柔板最终评审（文件见附件）&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_rar.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170323/1490259997107846.zip&quot; title=&quot;PCB柔板自审文件.zip&quot;&gt;PCB柔板自审文件.zip&lt;/a&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_rar.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170323/1490259999104907.zip&quot; title=&quot;PCB制板文件.zip&quot;&gt;PCB制板文件.zip&lt;/a&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_rar.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170323/1490260607844455.zip&quot; title=&quot;原理图PCB首版终稿.zip&quot;&gt;原理图PCB首版终稿.zip&lt;/a&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_rar.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170323/1490260607814376.zip&quot; title=&quot;原理图PCB首版终稿1.zip&quot;&gt;原理图PCB首版终稿1.zip&lt;/a&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_rar.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170323/1490260614862701.zip&quot; title=&quot;原理图PCB首版终稿2.zip&quot;&gt;原理图PCB首版终稿2.zip&lt;/a&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;a style=&quot;font-size: 12px; background-color: rgb(255, 255, 255); color: rgb(0, 0, 0); text-decoration: none;&quot; href=&quot;/ueditor/php/upload/file/20170323/1490260614862701.zip&quot; title=&quot;原理图PCB首版终稿2.zip&quot;&gt;&lt;span style=&quot;background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);&quot;&gt;2016-12-16~2017-01-03：进度更新完成PCB投板及PCB加工&lt;/span&gt;&lt;/a&gt;&lt;/p&gt;', '58', '1490262959', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('7', '33', '&lt;p&gt;2017-01-06~01-13进度更新：板子都到绵阳库存，器件预计交期1月20号到1到两对，1.13.LL10-D00贴片预计交期为1月16号。&lt;br/&gt;&lt;br/&gt;2017-01-16~01-20进度更新:1对器件已寄出，预计1月23日收到。&lt;br/&gt;&lt;br/&gt;2017-01-20~02-17进度更新：CSFP+正在进行性能调试，发端眼图较差正在优化。&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_txt.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170324/1490321496284526.xlsx&quot; title=&quot;csfp+ 眼图.xlsx&quot;&gt;csfp+ 眼图.xlsx&lt;/a&gt;&lt;br/&gt;&lt;br/&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;CSFP+&amp;nbsp;BOSA硬件重新修正了参数，非绝缘尺寸已核实&amp;nbsp;，预计2月23日送样4对。&lt;br/&gt;&lt;br/&gt;2017-02-20~02-24进度更新：目前CSFP+&amp;nbsp;眼图问题正在找原厂FAE协助解决中。&lt;br/&gt;&lt;br/&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;FW进一步完善中，调整后的组件昨日已到达绵阳工厂并验证装配及长纤性能&amp;nbsp;结果：PASS。&lt;br/&gt;&lt;br/&gt;2017-02-24~03-03进度更新：目前csfp+&amp;nbsp;项目&amp;nbsp;&amp;nbsp;完整装配两套，基本时序测试完成，vcc采集，RSSI-AD采集功能已飞线验证。眼图问题原厂仿真还无结果。&lt;br/&gt;&lt;br/&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;待固件完善，进一步测试。&lt;br/&gt;&lt;br/&gt;2017-02-27~3-10进度更新：1，固件TX、RX校准验证完成，单通道固件已经验证。两个通道固件目前完善中。&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;br/&gt;&lt;br/&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;2，眼图问题原厂FAE已有结果，大致是高速线下需要挖空，高速线过孔周围需地过孔，完整的参考地等问题。着手准备改版下一版pcb。&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;br/&gt;&lt;br/&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;3，DCDC1.8v电压正常，3.0v电压有些异常，目前调试中。&lt;br/&gt;&lt;br/&gt;2017-03-13~3-17进度更新：1.CSFP+&amp;nbsp;dcdc问题已处理，dcdc输出功率以及效率做了测试，满足项目需求。&lt;br/&gt;&lt;br/&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp; 2.对模块关键时序作了测试，测试收端高低温串扰，通道1自身串扰大，后续改版需要改进。&lt;br/&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_txt.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170324/1490321471117855.xlsx&quot; title=&quot;CSFP+时序及灵敏度串扰测试结果.xlsx&quot;&gt;CSFP+时序及灵敏度串扰测试结果.xlsx&lt;/a&gt;&lt;/p&gt;&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 3.收端以及发端眼图差的问题通过仿真结果以及原厂的建议总结问题点，目前pcb改版进行中。&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '58', '1490322254', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('8', '34', '&lt;p&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt;2017-12-08进度更新： 结构件设计完成，评审完成；&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt;2017-12-26进度更新： 结构外壳由于销售引入新的需求未投出生产；&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt;2017-01-06～01-26进度更新：firmware修改完毕；初步验证没有问题；&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt;2017-01-26进度更新：光器件组件 Luxnet 组件备料完成；&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt;2017-02-10 进度更新：出差北京至JD 现场进行SFP+AOC 老外壳，老方案样品服务器模拟测试；&lt;br/&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 客户主要测试DELL 和 Huawei 服务+交换机吞吐量测试；测试结果，我们&lt;br/&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 的AOC 吞吐量达不到9G以上；而易飞扬和台达的均可以；经现场模拟验证&lt;br/&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Atop 第一代AOC 关闭rx de-emphasis有明显好转，可以达到9G以上；但是&lt;br/&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 还是需要进一步详细测试；&lt;br/&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 本次出差，JD又提出的新的外壳外观希望拉环像Finisar的意义，尾柄也是，&lt;br/&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 另外AOC线缆盘圈的模式需要更改；有报告（见附件）；&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_doc.gif&quot;/&gt;&lt;a style=&quot;color: rgb(0, 102, 204); text-decoration: underline; font-family: arial,helvetica,sans-serif; font-size: 14px;&quot; href=&quot;/ueditor/php/upload/file/20170324/1490333477216492.docx&quot; title=&quot;ATOP SFP+ AOC JD 出差测试报告.docx&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt;ATOP SFP+ AOC JD 出差测试报告.docx&lt;/span&gt;&lt;/a&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt; 2017-02-20 进度更新：结构召开外壳更改评审会议；确定了外壳的更改方案；&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt; 2017-02-24 进度更新：结构正式给出外壳加工图纸，外发加工；&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt;2017-02-27 进度更新：&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 15px;&quot;&gt;1.&lt;/span&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 15px; line-height: 1.5; background-color: window;&quot;&gt;定制AOC&amp;nbsp;Cable&amp;nbsp;结构件待样品开模和机加以后确认出图；&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 15px; line-height: 1.5; background-color: window;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 2. 采购正在与供应商协商&lt;/span&gt;&lt;span style=&quot;font-family: Verdana; font-size: 10.5pt; line-height: 1.5; background-color: window;&quot;&gt;结构件加工和尾套开模&lt;/span&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 15px; line-height: 1.5; background-color: window;&quot;&gt;价钱，模具周期从付50%模真费后25个工作日出样品；&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;line-height: 1.5; background-color: window; font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &amp;nbsp;&amp;nbsp; 3.服务器预计3月10号左右到厂；&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;line-height: 1.5; background-color: window; font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt;2017-02-28 进度更新：采购确力加工厂家为镇江盛地 开模制作尾柄；&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 15px; line-height: 1.5; background-color: window;&quot;&gt;2&lt;/span&gt;&lt;span style=&quot;font-size: 14px; font-family: arial,helvetica,sans-serif; line-height: 1.5; background-color: window;&quot;&gt;017-03-01进度更新：&lt;/span&gt;1.戴尔服务器已寄出；&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 2.开模供应商已确认，待明日准备开模；&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt;2017-03-02进度更新：&lt;span style=&quot;font-family: arial,helvetica,sans-serif; color: rgb(0, 0, 0); font-size: 15px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 22px; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline ! important; float: none;&quot;&gt;模具开始请款准备开模&lt;/span&gt;。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt;2017-03-03进度更新：&lt;span style=&quot;color: rgb(0, 0, 0); font-family: 微软雅黑; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 21px; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline ! important; float: none;&quot;&gt;目前&lt;/span&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: 微软雅黑; font-size: 10.5pt; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 1.5; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: transparent;&quot;&gt;供应商已与工程确认好了图纸数据 ，现在已进入了开模期。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 1.5; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: transparent; font-size: 14px; font-family: arial,helvetica,sans-serif;&quot;&gt;2017-03-06进度更新：&lt;/span&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-size: 10.5pt; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 1.5; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; back