INSERT INTO `atop_project_discuss` VALUES ('12', '34', '&lt;p&gt;由于&lt;span style=&quot;color: rgb(0, 0, 0); font-family: 微软雅黑; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 21px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;&quot;&gt;现SFP+AOC(京东)拉环产线在装配时有损坏情况，&lt;span style=&quot;color: rgb(0, 0, 0); font-family: 微软雅黑; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 21px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;&quot;&gt;请恒得再提供30件AOC&lt;span style=&quot;color: rgb(0, 0, 0); font-family: 微软雅黑; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 21px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;&quot;&gt;的解锁组合件&lt;/span&gt;，新制作的货需要恒得加强自检和质检。本次送到公司的解锁组合件钣金折弯处有裂痕，如附件图片，产线员工轻轻推动即断，比例高达30%。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_jpg.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170324/1490345733871264.jpg&quot; title=&quot;解锁组合件断裂图.jpg&quot;&gt;解锁组合件断裂图.jpg&lt;/a&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: 微软雅黑; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 21px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: 微软雅黑; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 21px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;&quot;&gt;&lt;/span&gt;&lt;/span&gt;&lt;br/&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: 微软雅黑; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 21px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: 微软雅黑; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 21px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;&quot;&gt;&lt;/span&gt;&lt;/span&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/themes/default/images/spacer.gif&quot;/&gt;&lt;/p&gt;', '58', '1490345778', '54,45', null);
INSERT INTO `atop_project_discuss` VALUES ('13', '27', '&lt;p&gt;10套结构件已进行验证，全部符合要求。&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;目前存在的问题：装配时弹簧易从解锁键掉出来，不易安装，解锁键需要更改设计。&lt;/p&gt;', '79', '1490692465', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('14', '35', '&lt;p&gt;&lt;span style=&quot;font-size: 14px; font-family: arial,helvetica,sans-serif;&quot;&gt;2017-01-04进度更新：PCB 评审完成，投板成功；&lt;br/&gt;2017-01-06&lt;span style=&quot;font-size: 14px; font-family: arial,helvetica,sans-serif;&quot;&gt;进度更新：&lt;/span&gt;Firmware 需求表发出；（文件见附件）&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_txt.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170328/1490692726775949.xlsx&quot; title=&quot;ATOP FirmwareRequirement for onet8501v+gn2003s.xlsx&quot;&gt;ATOP FirmwareRequirement for onet8501v+gn2003s.xlsx&lt;/a&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px; font-family: arial,helvetica,sans-serif;&quot;&gt;2017-01-09&lt;span style=&quot;font-size: 14px; font-family: arial,helvetica,sans-serif;&quot;&gt;进度更新：&lt;/span&gt;Bom制作完成，上传到系统；&lt;/span&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px; font-family: arial,helvetica,sans-serif;&quot;&gt;2017-01-20&lt;span style=&quot;font-size: 14px; font-family: arial,helvetica,sans-serif;&quot;&gt;进度更新：&lt;/span&gt;PCB申请10PCS 贴片；&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px; font-family: arial,helvetica,sans-serif;&quot;&gt; 2017-03-10&lt;span style=&quot;font-size: 14px; font-family: arial,helvetica,sans-serif;&quot;&gt;进度更新：&lt;/span&gt;基本功能调试完成，寄存器配置定稿，且由何松文完成firmware初值更新；（&lt;span style=&quot;font-size: 14px; font-family: arial,helvetica,sans-serif;&quot;&gt;文件见附件&lt;/span&gt;）&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px; font-family: arial,helvetica,sans-serif;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; firmware定初稿；&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_rar.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170328/1490692751257760.zip&quot; title=&quot;FIRM_0651_T03.zip&quot;&gt;FIRM_0651_T03.zip&lt;/a&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px; font-family: arial,helvetica,sans-serif;&quot;&gt;&lt;/span&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px; font-family: arial,helvetica,sans-serif;&quot;&gt; 2017-03-14&lt;span style=&quot;font-size: 14px; font-family: arial,helvetica,sans-serif;&quot;&gt;进度更新：&lt;/span&gt;在DVT，EVT还没制作的时候，销售特别要求15m cable94条试产；&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px; font-family: arial,helvetica,sans-serif;&quot;&gt;2017-03-16&lt;span style=&quot;font-size: 14px; font-family: arial,helvetica,sans-serif;&quot;&gt;进度更新：&lt;/span&gt;成本估算成功：&lt;br/&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 15m&amp;nbsp; cable&amp;nbsp; 旧PCBA&amp;nbsp; 128.7412/1.17=110.04 RMB X2PCS 加代工费&amp;nbsp; 131.95RMA&amp;nbsp;&amp;nbsp;&amp;nbsp; 成本&amp;nbsp; 未税： 352.03 RMB&lt;br/&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 15m cable&amp;nbsp; 新PCBA&amp;nbsp; 79.0446/1.17= 67.56 RMB X2PCS&amp;nbsp;&amp;nbsp; 加代工费 131.95RMA&amp;nbsp;&amp;nbsp;&amp;nbsp; 成本&amp;nbsp; 未税： 267.07 RMB&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px; font-family: arial,helvetica,sans-serif;&quot;&gt;2017-03-21&lt;span style=&quot;font-size: 14px; font-family: arial,helvetica,sans-serif;&quot;&gt;进度更新：&lt;/span&gt;发现Firmware bug 不支持H3C 和 Cisco A2H写入；&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px; font-family: arial,helvetica,sans-serif;&quot;&gt;2017-03-22&lt;span style=&quot;font-size: 14px; font-family: arial,helvetica,sans-serif;&quot;&gt;进度更新：&lt;/span&gt;15M cable DVT 11条从试产中跳出，发出DVT测试申请；&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px; font-family: arial,helvetica,sans-serif;&quot;&gt;2017-03-24&lt;span style=&quot;font-size: 14px; font-family: arial,helvetica,sans-serif;&quot;&gt;进度更新：&lt;/span&gt;15m 94条cable 试产报告发出；（&lt;span style=&quot;font-size: 14px; font-family: arial,helvetica,sans-serif;&quot;&gt;文件见附件&lt;/span&gt;）&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_doc.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170328/1490692380138949.docx&quot; title=&quot;15M 10G SFP+ active DAC cable 小批量试产报告.docx&quot;&gt;15M 10G SFP+ active DAC cable 小批量试产报告.docx&lt;/a&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px; font-family: arial,helvetica,sans-serif;&quot;&gt;&lt;/span&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px; font-family: arial,helvetica,sans-serif;&quot;&gt;2017-03-24&lt;span style=&quot;font-size: 14px; font-family: arial,helvetica,sans-serif;&quot;&gt;进度更新：&lt;/span&gt;EVT 测试完成；（&lt;span style=&quot;font-size: 14px; font-family: arial,helvetica,sans-serif;&quot;&gt;文件见附件&lt;/span&gt;，非最终版本）&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_txt.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170328/1490692426374634.xlsx&quot; title=&quot;15M 10G SFP+ active DAC cable EVT test.xlsx&quot;&gt;15M 10G SFP+ active DAC cable EVT test.xlsx&lt;/a&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px; font-family: arial,helvetica,sans-serif;&quot;&gt;&lt;/span&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px; font-family: arial,helvetica,sans-serif;&quot;&gt;2017-03-28&lt;span style=&quot;font-size: 14px; font-family: arial,helvetica,sans-serif;&quot;&gt;进度更新：&lt;/span&gt;等待永贵半自动化夹具制作的完成；为第二次试产准备；&lt;/span&gt;&lt;/p&gt;&lt;br/&gt;', '58', '1490693347', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('15', '35', '&lt;p&gt;由于RAM比较小，所以firmware没有开放A2 table 0的写入功能。后面可以把Cisco码的A2 table 0固化到firmware中，H3C码不用写A2 table 0不影响兼容。&lt;/p&gt;', '30', '1490695136', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('16', '34', '&lt;p&gt;3月28日下午6点，安杰讯制作的OM3 带尾柄跳线寄到绵阳公司；验证装配的时候出现问题，跳线无法正常装进底座外壳。&lt;/p&gt;&lt;p&gt;见附件。&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_jpg.gif&quot;/&gt;&lt;a href=&quot;/ueditor/php/upload/file/20170329/1490749957377130.jpg&quot; title=&quot;11.jpg&quot; style=&quot;line-height: 16px; font-size: 12px; color: rgb(0, 102, 204);&quot;&gt;11.jpg&lt;/a&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;3月29日，安排将OM3跳线安排退回安杰讯执行返工；主要原因是安杰讯未按照我司结构图纸进行制作。导致有误。&lt;/p&gt;', '53', '1490750241', '54,45,83', null);
INSERT INTO `atop_project_discuss` VALUES ('17', '34', '&lt;p&gt;安捷讯的光纤来料尺寸不符合设计要求，陶瓷插芯处长度尺寸短了约2mm，无法安装到产品上。&lt;/p&gt;&lt;p&gt;&lt;img width=&quot;1201&quot; height=&quot;1600&quot; title=&quot;1490750795102368.jpg&quot; src=&quot;/ueditor/php/upload/image/20170329/1490750795102368.jpg&quot;/&gt;&lt;/p&gt;&lt;p&gt;&lt;img title=&quot;1490750795675426.jpg&quot; src=&quot;/ueditor/php/upload/image/20170329/1490750795675426.jpg&quot;/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '79', '1490751068', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('18', '30', '&lt;p&gt;2017-2-23进度更新：&amp;nbsp; 关键芯片采购订单发出；&lt;/p&gt;&lt;p&gt;2017-2-27进度更新：&amp;nbsp; 改版PCB外形与永贵确认完成；&lt;/p&gt;&lt;p&gt;2017-3-10&amp;nbsp;进度更新： 关键芯片样品申请10PCS，预计2~3周到货；&lt;/p&gt;&lt;p&gt;2017-3-17进度更新：&amp;nbsp; PCB layout评审完成；（Checklist见附件）&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_xls.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170329/1490753229128484.xls&quot; title=&quot;Design&amp;nbsp;For&amp;nbsp;Manufacture&amp;nbsp;CheckList_1.12.HN40_X07.xls&quot;&gt;Design&amp;nbsp;For&amp;nbsp;Manufacture&amp;nbsp;CheckList_1.12.HN40_X07.xls&lt;/a&gt;&lt;/p&gt;&lt;p&gt;2017-3-20&amp;nbsp; PCB layout制板文件发出，预计4月10日回厂。&lt;/p&gt;', '58', '1490753400', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('19', '31', '&lt;p&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt;2016-10-15进度更新：项目准备阶段，美信MAX24033方案设计，并且寻找合适TO座子和管帽。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt;2016-11-29进度更新：SFP28测试板发出加工。自己封TO的物料由于没有找到合适的，暂停进行。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt;2016-11-15进度更新：SFP28更改为M37030方案，开始方案设计及PCBlayout，&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt;2016-12-13进度更新：SFP28 M37030方案的PCB Layout发出加工申请，预计2月5号到厂后开始进行PCBA贴片。&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_rar.gif&quot;/&gt;&lt;a style=&quot;color: rgb(0, 102, 204); text-decoration: underline; font-family: arial,helvetica,sans-serif; font-size: 14px;&quot; href=&quot;/ueditor/php/upload/file/20170329/1490756286645477.zip&quot; title=&quot;1.12.KL1D-D00加工文件.zip&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt;1.12.KL1D-D00加工文件.zip&lt;/span&gt;&lt;/a&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_rar.gif&quot;/&gt;&lt;a style=&quot;color: rgb(0, 102, 204); text-decoration: underline; font-family: arial,helvetica,sans-serif; font-size: 14px;&quot; href=&quot;/ueditor/php/upload/file/20170329/1490756090106757.zip&quot; title=&quot;1.13.KL1DD00-A00贴片文件.zip&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt;1.13.KL1DD00-A00贴片文件.zip&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/a&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_rar.gif&quot;/&gt;&lt;a style=&quot;color: rgb(0, 102, 204); text-decoration: underline; font-family: arial,helvetica,sans-serif; font-size: 14px;&quot; href=&quot;/ueditor/php/upload/file/20170329/1490757356103792.zip&quot; title=&quot;1.12.KL1D-D00设计文件.zip&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt;1.12.KL1D-D00设计文件.zip&lt;/span&gt;&lt;/a&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt;2016-12-15进度更新：SFP28 柔板加工文件发出加工申请。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt; 2016-12-26进度更新：SFP28插座由于之前选型物料无法采购，更换型号后发出采购申请。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt; 2017-02-10进度更新：收到贴片完成的SFP28 PCBA，及SFP28测试板。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt; 2017-02-23进度更新：收到SFP28插座，测试板完成焊接。 &lt;br/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt; 2017-03-03进度更新：由于固件开发受到其它项目的影响，模块调试时间推后。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt; 2017-03-10进度更新：开始SFP28固件开发。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt;2017-03-16进度更新：开始模块功能调试。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt;2017-03-17进度更新：向代理申请M37030评估板，预计本月底可以拿到。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt; 2017-03-28进度更新：M37030芯片LDO及DCDC功能正常工作，上电时序还是会影响芯片的工作，正在与MACOM技术直接沟通解决，现在光模块在开环状态下可以&amp;nbsp;&amp;nbsp; 正常发光，准备开始调试眼图。&lt;/span&gt;&lt;/p&gt;', '58', '1490758215', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('20', '35', '&lt;p&gt;思科的SFP+ Cable只有无源1/3/5米和有源7/10米，PID分别如下：&lt;br/&gt;&lt;/p&gt;&lt;p&gt;SFP-H10GB-CU1M&lt;/p&gt;&lt;p&gt;SFP-H10GB-CU3M&lt;/p&gt;&lt;p&gt;SFP-H10GB-CU5M&lt;/p&gt;&lt;p&gt;SFP-H10GB-ACU7M&lt;/p&gt;&lt;p&gt;SFP-H10GB-ACU10M&lt;/p&gt;&lt;p&gt;详见链接：&lt;a href=&quot;http://www.cisco.com/c/en/us/td/docs/interfaces_modules/transceiver_modules/compatibility/matrix/10GE_Tx_Matrix.html&quot;&gt;http://www.cisco.com/c/en/us/td/docs/interfaces_modules/transceiver_modules/compatibility/matrix/10GE_Tx_Matrix.html&lt;/a&gt; &lt;/p&gt;&lt;p&gt;15米Cable只能写PID为SFP-H10GB-ACU10M，附件是10米Cable的Cisco源码，请马晓东把A2H0部分固化到FLASH中，再测试一下。&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_rar.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170329/1490772553118380.zip&quot; title=&quot;SFP-H10GB-ACU10M.zip&quot;&gt;SFP-H10GB-ACU10M.zip&lt;/a&gt;&lt;/p&gt;', '30', '1490772594', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('21', '41', '&lt;p&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt;2016-12-12进度更新：原理图和PCB初稿设计完毕，待评审； &lt;br/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt;2016-12-16进度更新：PCB评审完成，制板文件生成，申请50PCS打样；&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt;2016-12-28进度更新：PCBA bom制作完成，并上系统；&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt;2017-01-04进度更新：PCB到厂，贴片文件制作完毕，申请50PCS贴片；&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt;2017-02-06进度更新：手工样品1PCS制作完毕，初步调试性能ok；&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt;2017-03-01进度更新：与永贵秦工商议外协加工10M cable的夹具工装事宜；完成初步构想，&lt;br/&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 并寄给秦工两PCS PCB进行定位参考；&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt;2017-03-02进度更新：永贵秦工确认，15M 10M cable 可以使用同一套半自动生产夹具；&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt;2017-03-24进度更新：永贵手工制作的10M cable 的EVT报告整理完毕；第一次手工生产的样品&lt;br/&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; DVT整理完毕；（有附件，非最终版，都还有问题需要二次试产解决）；&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_txt.gif&quot;/&gt;&lt;a style=&quot;color: rgb(0, 102, 204); text-decoration: underline; font-family: arial,helvetica,sans-serif; font-size: 14px;&quot; href=&quot;/ueditor/php/upload/file/20170329/1490775439257157.xlsx&quot; title=&quot;10M 10G SFP+ active DAC cable EVT test.xlsx&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt;10M 10G SFP+ active DAC cable EVT test.xlsx&lt;/span&gt;&lt;/a&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_txt.gif&quot;/&gt;&lt;a style=&quot;color: rgb(0, 102, 204); text-decoration: underline; font-family: arial,helvetica,sans-serif; font-size: 14px;&quot; href=&quot;/ueditor/php/upload/file/20170329/1490775441139960.xlsx&quot; title=&quot;DVT APCA01-SSC100-24.xlsx&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt;DVT APCA01-SSC100-24.xlsx&lt;/span&gt;&lt;/a&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt;2017-03-29进度更新：等待永贵工装夹具制作完成，进行第二次试产；&lt;br/&gt;&amp;nbsp;&amp;nbsp; &lt;br/&gt;&lt;/span&gt;&lt;/p&gt;', '58', '1490775637', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('22', '35', '&lt;p&gt;刚才和马晓东讨论了一下，现在可以采取这种方式：完全固化Cisco和H3C码的A2H0部分到FLASH，由firmware来判断当前是什么码，从而返回给设备不同的A2H0。判断的依据为A0[0x60~0x62]字节，Cisco是80 00 01，H3C是48 44 43，其他情况A2H0全返回00，如下图：&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;/ueditor/php/upload/image/20170329/1490776763981770.png&quot; title=&quot;1490776763981770.png&quot;/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;/ueditor/php/upload/image/20170329/1490776764340123.png&quot; title=&quot;1490776764340123.png&quot;/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_rar.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170329/1490776987404498.zip&quot; title=&quot;H3C_SFP+ Active Cable 10m.zip&quot;&gt;H3C_SFP+ Active Cable 10m.zip&lt;/a&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_rar.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170329/1490776987111960.zip&quot; title=&quot;SFP-H10GB-ACU10M.zip&quot;&gt;SFP-H10GB-ACU10M.zip&lt;/a&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '30', '1490776992', '54,74', null);
INSERT INTO `atop_project_discuss` VALUES ('23', '35', '&lt;p&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt;1.半自动化生产工装夹具已制作完毕到厂验证；&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt;2.提出第2次试产申请：安排15M 有源cable 试产100条； （8501+Gn2003s方案）&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp; &lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '58', '1490863502', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('24', '41', '&lt;p&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt;1.半自动化生产工装夹具已制作完毕到厂验证；&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt;2.提出第2次试产申请：&lt;span style=&quot;color: rgb(0, 0, 0); font-family: 微软雅黑; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 21px; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline ! important; float: none;&quot;&gt;安排10M 有源cable 试产100条；（8501+1151方案）&lt;/span&gt;；&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '58', '1490863574', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('25', '27', '&lt;p&gt;&lt;span style=&quot;font-family: &amp;quot;Helvetica Neue&amp;quot;, Helvetica, &amp;quot;PingFang SC&amp;quot;, 微软雅黑, Tahoma, Arial, sans-serif; background-color: rgb(255, 255, 255);&quot;&gt;领拓创BOSA 修改管脚顺序样品已经到，确认管脚顺序无误。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;对称ONU 收端灵敏度已调试完成，灵敏度满足要求，打开CDR电口眼图满足需求。发端眼图初步调试完成，需要进一步优化。&lt;/p&gt;&lt;p&gt;非对称ONU 2.5G眼图存在带宽问题需进一步优化，1.25G眼图已调试完成。&lt;/p&gt;', '81', '1491011249', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('26', '34', '&lt;ol class=&quot; list-paddingleft-2&quot; style=&quot;list-style-type: decimal;&quot;&gt;&lt;li&gt;&lt;p&gt;JD AOC 今天在制作过程中发现跳线特别容易出现折痕，见下图：&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_jpg.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170401/1491026172817474.jpg&quot; title=&quot;JD AOC 2.jpg&quot;&gt;JD AOC 2.jpg&lt;/a&gt;&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_jpg.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170401/1491026172124430.jpg&quot; title=&quot;JD AOC.jpg&quot;&gt;JD AOC.jpg&lt;/a&gt;&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;JD AOC 昨天下午测试的时候 DELL 发，Huawei 收，可以达到9G以上；但是Huawei发，DELL 收就达不到9G，一直是8G左右跳动；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;今天早上叫李平过来更换Huawei的原装网卡，试了一下，效果一致，跟X520网卡没有关系；重新配置Huawei CPU工作模式为performance，&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;Huawei 发 ，DELL 收，可以达到9G以上吞吐量，基本满足要求；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;由于底座一共只有30套，发给2套给安杰讯做OM3光纤跳线；另外陈工这边拿走2套有问题的结构件；&lt;span style=&quot;color: rgb(255, 0, 0);&quot;&gt;&lt;strong&gt;所以产线最多产出13条AOC；&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;昨天裸AOC 在高温70度烤了&amp;gt;1小时后，今天早上拿出观察外观，未发现异常；使用通光笔测试，光纤良好；&lt;/p&gt;&lt;/li&gt;&lt;/ol&gt;', '53', '1491026673', '54,55', null);
INSERT INTO `atop_project_discuss` VALUES ('27', '34', '&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_txt.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170406/1491468152508635.xlsx&quot; title=&quot;JD 样品测试数据 - 标准发行版.xlsx&quot;&gt;JD 样品测试数据 - 标准发行版.xlsx&lt;/a&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_rar.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170406/1491468152399636.rar&quot; title=&quot;20161213JDSK-CS-RMA.rar&quot;&gt;20161213JDSK-CS-RMA.rar&lt;/a&gt;&lt;/p&gt;&lt;ol class=&quot; list-paddingleft-2&quot; style=&quot;list-style-type: decimal;&quot;&gt;&lt;li&gt;&lt;p&gt;按照销售要求第二代JD样品制作完成，并于2017年4月5日发出；&lt;br/&gt;&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;吞吐量模拟JD测试要求均达到9.4G，以上，请知悉，谢谢！&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;如上附件是本次内部测试数据；&lt;/p&gt;&lt;/li&gt;&lt;/ol&gt;', '53', '1491468295', '54,43,45,55', null);
INSERT INTO `atop_project_discuss` VALUES ('28', '34', '&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_txt.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170406/1491468387638247.xlsx&quot; title=&quot;Finisar与ATOP  5M SFP+  AOC 样品对比测试.xlsx&quot;&gt;Finisar与ATOP &amp;nbsp;5M SFP+ &amp;nbsp;AOC 样品对比测试.xlsx&lt;/a&gt;&lt;/p&gt;&lt;ol class=&quot; list-paddingleft-2&quot; style=&quot;list-style-type: decimal;&quot;&gt;&lt;li&gt;&lt;p&gt;附件是Finisar 和 Atop 的 5M AOC样品对比测试，供大家参考；&lt;br/&gt;&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;其中Finisar的收端电口眼图明显优于我司AOC 产品；&lt;br/&gt;&lt;/p&gt;&lt;/li&gt;&lt;/ol&gt;', '53', '1491468443', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('29', '35', '&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_txt.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170406/1491468551978542.xlsx&quot; title=&quot;金鑫诺与ATOP  3M SFP+ Passive DAC Cable样品对比测试.xlsx&quot;&gt;金鑫诺与ATOP &amp;nbsp;3M SFP+ Passive DAC Cable样品对比测试.xlsx&lt;/a&gt;&lt;/p&gt;&lt;ol class=&quot; list-paddingleft-2&quot; style=&quot;list-style-type: decimal;&quot;&gt;&lt;li&gt;&lt;p&gt;附件是金鑫诺和 我司自制的无源3M cable 样品对比测试数据；&lt;br/&gt;&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;从数据来看，目前暂时看不出什么差异；&lt;/p&gt;&lt;/li&gt;&lt;/ol&gt;', '53', '1491470113', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('30', '31', '&lt;p&gt;SFP28最新进度如下：&lt;/p&gt;&lt;p&gt;目前已经能够实现收发的CDR锁定功能，模块基本已经调通，眼图见下面，后续还需详细优化和测试。&lt;/p&gt;&lt;p&gt;初步常温测试接收端灵敏度~-12dBm，&lt;/p&gt;&lt;p&gt;目前的方案如下：MCU：DS4834+ LDD：Macom M037030； 光器件：TOSA：AOI 成品TOSA &amp;nbsp; &amp;nbsp;ROSA：Semtech成品 ROSA；&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;目前问题：&lt;/p&gt;&lt;p&gt;1. 模块上电时序还有点问题，还需要和Firmware再调整一下初始化顺序；&lt;/p&gt;&lt;p&gt;2. 模块的详细验证还未开始，高低温性能，传输性能等还需进一步确认，模块的功能（时序，DDM等）未验证；&lt;/p&gt;&lt;p&gt;3. 模块成本核算还没分析，需要进行成本核算，包括可选择的光器件，以及光器件或光芯片的供货能力需要分析；&lt;/p&gt;&lt;p&gt;4. 芯片方案目前Macom M037030A，该芯片目前还存在一些高温性能问题，具体见附件，预计今年6月份将会发布新版本；&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_pdf.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170407/1491550772719061.pdf&quot; title=&quot;MALD37030A_31A Excess ISIE_Jan-25-17.pdf&quot;&gt;MALD37030A_31A Excess ISIE_Jan-25-17.pdf&lt;/a&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;5. 目前SFP28与SFP+使用相同结构件，对于EMI/EMC是否满足要求存在风险，还需要进一步测试评估；&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;6. 目前AOI方案光器件只能支持到C-temp，无法满足I-temp要求；&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;7. Macom及代理的支持力度不够，这是一个风险，后续还需要考虑其他方案如美信方案。&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;br/&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;发射端（下图黄色眼图）和接收端（下图绿色眼图）的眼图如下所示，&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;img src=&quot;/ueditor/php/upload/image/20170407/1491547911118255.jpg&quot; alt=&quot;1491547911118255.jpg&quot; width=&quot;421&quot; height=&quot;299&quot;/&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;/ueditor/php/upload/image/20170407/1491548037638161.jpg&quot; title=&quot;1491548037638161.jpg&quot; alt=&quot;IMG_20170407_141324.jpg&quot; width=&quot;400&quot; height=&quot;297&quot;/&gt;&lt;/p&gt;', '54', '1491551288', '54,55,76', null);
INSERT INTO `atop_project_discuss` VALUES ('139', '31', '&lt;p&gt;&lt;span style=&quot;font-family:宋体&quot;&gt;&lt;span style=&quot;font-size: 21px;&quot;&gt;&lt;span style=&quot;line-height: 1.5;&quot;&gt;LUXNET TOSA&amp;amp;ROSA已完成初步的三温测试，结论如下：&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;table width=&quot;811&quot;&gt;&lt;colgroup&gt;&lt;col style=&quot;width: 154pt;&quot; width=&quot;205&quot;/&gt;&lt;col style=&quot;width: 221pt;&quot; width=&quot;294&quot;/&gt;&lt;col style=&quot;width: 218pt;&quot; width=&quot;290&quot; span=&quot;2&quot;/&gt;&lt;/colgroup&gt;&lt;tbody&gt;&lt;tr style=&quot;height: 43.5pt;&quot; class=&quot;firstRow&quot;&gt;&lt;td colspan=&quot;4&quot; class=&quot;xl64&quot; style=&quot;padding: 0px; font-size: 16pt; font-family: 宋体; vertical-align: middle; border: medium none;&quot; width=&quot;811&quot;&gt;1、该方案的样品TOSA可以满足模块Case温度在0~70℃的工作要求，但是无法满足工业级的温度需求；眼图比AOI TO封装的TOSA+AOI柔板的抖动略大。&lt;/td&gt;&lt;/tr&gt;&lt;tr style=&quot;height: 54pt;&quot;&gt;&lt;td colspan=&quot;4&quot; class=&quot;xl64&quot; style=&quot;padding: 0px; font-size: 16pt; font-family: 宋体; vertical-align: middle; border: medium none;&quot; width=&quot;811&quot;&gt;2、该方案的样品ROSA性能可以满足模块在商业级温度下的指标要求，但ROSA结构与我们现有的结构件直接存在装配问题，故以上收端SEN测试均为裸PCBA条件下测得；TOSA的结构可以和我司SFP+ LR结构相匹配，装配无问题。&lt;/td&gt;&lt;/tr&gt;&lt;tr style=&quot;height: 20.25pt;&quot;&gt;&lt;td colspan=&quot;4&quot; class=&quot;xl64&quot; style=&quot;padding: 0px; font-size: 16pt; font-family: 宋体; vertical-align: middle; border: medium none;&quot; width=&quot;811&quot;&gt;3、该方案的ROSA性能指标会比3U的ROSA指标差一些，但是仍基本可以满足模块要求。&lt;/td&gt;&lt;/tr&gt;&lt;/tbody&gt;&lt;/table&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '100', '1506502986', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('32', '31', '&lt;p&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt;SFP28最新进度如下：&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt;SFP28的方案：目前暂定Maxim&amp;nbsp;DS4834+&amp;nbsp;Macom&amp;nbsp;M037030A。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt;TOSA：&amp;nbsp;AOI&amp;nbsp;/Macom&amp;nbsp;25G&amp;nbsp;TO&amp;nbsp;+外协封装。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt;ROSA：&amp;nbsp;三优&amp;nbsp;25G&amp;nbsp;LR&amp;nbsp;ROSA。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt;备选方案：Maxim&amp;nbsp;DS4834+&amp;nbsp;Maxim&amp;nbsp;Max24033。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt;目前先按Macom37030A备100套试产。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 14px;&quot;&gt;下周开始准备前期Demo样品。&lt;/span&gt;&lt;br/&gt;&lt;br/&gt;&lt;/p&gt;', '58', '1492064737', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('33', '33', '&lt;p&gt;&amp;nbsp;综合仿真结果 &amp;nbsp; 原厂设计建议 &amp;nbsp;以及第一版调试中遇到的问题 &amp;nbsp;对csfp+ 作了原理图以及pcb的优化改进，目前原理图pcb已经自审 &amp;nbsp;评审通过，主板 和柔板 本周四 已经外发加工，副板 需要结构工程师修改拼版文件后发出。&lt;/p&gt;', '81', '1492160170', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('34', '28', '&lt;p&gt;本周对两只待做EVT测试模块的基本工作做了验证， 测试了TX-SD时序 ，验证收发端监控校准，vcc、温度、bias的监控校准等。&lt;/p&gt;', '81', '1492162569', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('35', '35', '&lt;p&gt;项目最新进度更新：Gate3 会议评审完成进入研发Gate4状态，目前PCB试产待料贴片；&lt;/p&gt;', '58', '1492163596', '54', null);
