INSERT INTO `atop_project_discuss` VALUES ('37', '31', '&lt;p&gt;SFP28 LR模块项目进度如下：&lt;br/&gt;&lt;/p&gt;&lt;p&gt;目前已完成2PCS Demo样品准备，主要指标测试报告如附件。&lt;/p&gt;&lt;p&gt;带周一上交换机测试IIC读取及写码后可以作为前期样品送样。&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_txt.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170416/1492356911109989.xlsx&quot; title=&quot;SFP28 LR样品测试报告.xlsx&quot;&gt;SFP28 LR样品测试报告.xlsx&lt;/a&gt;&lt;/p&gt;&lt;p&gt;由于前期第一次试用该TO，封装TOSA时的耦合光功率偏大，为了使模块的眼图性能最优，调试的2PCS模块光功率比较偏大。&lt;/p&gt;&lt;p&gt;以后可以在封TOSA时注意控制耦合的光功率来改善该问题。&lt;/p&gt;', '60', '1492356973', '54,55', null);
INSERT INTO `atop_project_discuss` VALUES ('38', '46', '&lt;p&gt;2017-04-10项目进度更新： 原理图设计开始；&lt;br/&gt;2017-04-14项目进度更新： PCB Layout 设计开始；&lt;br/&gt;2017-04-18项目进度更新： 原理图评审完毕；（有评审文档）&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_doc.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170419/1492589594717770.doc&quot; title=&quot;设计评审记录_10G XFP_ZR 原理图评审.doc&quot;&gt;设计评审记录_10G XFP_ZR 原理图评审.doc&lt;/a&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '58', '1492589684', '54', null);
