INSERT INTO `atop_project_discuss` VALUES ('45', '35', '&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_txt.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170505/1493975601112429.xlsx&quot; title=&quot;FVT-00001-V1.0  APCA01-SSC150-24.xlsx&quot;&gt;FVT-00001-V1.0 &amp;nbsp;APCA01-SSC150-24.xlsx&lt;/a&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_txt.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170505/1493975602541124.xlsx&quot; title=&quot;EVT-00001-V1.0  APCA01-SSC150-24.xlsx&quot;&gt;EVT-00001-V1.0 &amp;nbsp;APCA01-SSC150-24.xlsx&lt;/a&gt;&lt;/p&gt;&lt;p&gt;1.本周完成PRD第三次修正；待评审；&lt;/p&gt;&lt;p&gt;2.手工二次试产82PCS，良率96.3；&lt;/p&gt;&lt;p&gt;3.半自动夹具试产有问题，待修模改进；&lt;/p&gt;&lt;p&gt;4.本月12号进行第三次贴片，准备第三次半自动试产；&lt;/p&gt;&lt;p&gt;5.DVT测试完成，数据整理中；&lt;/p&gt;', '53', '1493975613', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('46', '34', '&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;1. 本周没有更新，外壳加工结构件，采购给的交期是5月20日；&lt;/p&gt;', '53', '1493975714', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('47', '46', '&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;ol class=&quot; list-paddingleft-2&quot; style=&quot;list-style-type: decimal;&quot;&gt;&lt;li&gt;&lt;p&gt;PCB 于4月28日投板出去；采购给的交期是5月17日；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;&lt;img src=&quot;/ueditor/php/upload/image/20170505/1493976190132701.jpg&quot; title=&quot;1493976190132701.jpg&quot;/&gt;&lt;/p&gt;&lt;/li&gt;&lt;/ol&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp;3. 相关芯片样品申请已经完成；&lt;/p&gt;', '53', '1493976228', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('48', '30', '&lt;p&gt;PCBA已贴好，开始准备写固件中，预计5/19完成固件初稿及固件验证，之后协调永贵帮忙加工成7M，5M，3M的成品DAC线各一条。加工完成后继续优化固件及进行具体的调测试。&lt;/p&gt;', '60', '1494575196', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('49', '35', '&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_txt.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170515/1494837189842992.xlsx&quot; title=&quot;DVT APCA01-SSC150-24.xlsx&quot;&gt;DVT APCA01-SSC150-24.xlsx&lt;/a&gt;&lt;/p&gt;&lt;ol class=&quot; list-paddingleft-2&quot; style=&quot;width: 1056.39px; white-space: normal;&quot;&gt;&lt;li&gt;&lt;p&gt;DVT测试报告已经整理完成，待评审；&lt;br/&gt;&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;永贵半自动夹具已完成修模，可进行半自动化试产；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;本月16号进行第三次贴片，&lt;span style=&quot;font-family: &amp;quot;Helvetica Neue&amp;quot;, Helvetica, &amp;quot;PingFang SC&amp;quot;, 微软雅黑, Tahoma, Arial, sans-serif; background-color: rgb(255, 255, 255);&quot;&gt;准备第三次半自动试产&lt;/span&gt;；&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;/li&gt;&lt;/ol&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '82', '1494837230', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('50', '46', '&lt;ol class=&quot; list-paddingleft-2&quot; style=&quot;list-style-type: decimal;&quot;&gt;&lt;li&gt;&lt;p&gt;所有新物料样品均已收到；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;新物料正在新建料号，bom及贴片文件，待新物料的料号建好后即可上传至系统；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;采购给的最新的PCB交货时间是5月22号，已经让采购与供应商沟通，尽量提前交货时间；&lt;br/&gt;&lt;/p&gt;&lt;/li&gt;&lt;/ol&gt;', '82', '1494837918', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('51', '46', '&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_doc.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170516/1494928732213437.docx&quot; title=&quot;TPS63070 验证报告.docx&quot;&gt;TPS63070 验证报告.docx&lt;/a&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;1、2017-4-10完成&lt;span style=&quot;font-family: 微软雅黑; line-height: 21px; background-color: rgb(255, 255, 255);&quot;&gt;AD8519运放搭建的外部bias采样电路功能验证；&lt;/span&gt;&lt;/p&gt;&lt;p&gt;2、2017-4-28完成TEC芯片TPS63070的功能验证，芯片符合低功耗设计要求（有验证报告）；&lt;br/&gt;&lt;/p&gt;&lt;p&gt;3、最新的PCB交货时间为5月22日；&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '82', '1494929182', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('52', '48', '&lt;p&gt;&amp;nbsp;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 12px;&quot;&gt;2017-04-24~2017-05-03&amp;nbsp; 最新项目进度：原理图改版完成；&lt;br/&gt;&amp;nbsp;2017-05-04~ 2017-05-10 最新项目进度： PCB layout完成；&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 12px;&quot;&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_rar.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170517/1495000459630975.zip&quot; title=&quot;1.12.EL10-D38原理图及PCB.zip&quot;&gt;1.12.EL10-D38原理图及PCB.zip&lt;/a&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 12px;&quot;&gt;&lt;/span&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 12px;&quot;&gt; 2017-05-11 最新项目进度：原理图及PCB评审完成；&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 12px;&quot;&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_doc.gif&quot;/&gt;&lt;a style=&quot;color: rgb(0, 102, 204); text-decoration: underline; font-family: arial,helvetica,sans-serif; font-size: 12px;&quot; href=&quot;/ueditor/php/upload/file/20170517/1494999049122231.doc&quot; title=&quot;设计评审记录_10G SFP+_ZR 原理图评审.doc&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 12px;&quot;&gt;设计评审记录_10G SFP+_ZR 原理图评审.doc&lt;/span&gt;&lt;/a&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif; font-size: 12px;&quot;&gt;&amp;nbsp;2017-05-12 最新项目进度：1.制版文件上传导系统发并完成PCB投板；（预计交货时间2017-06-10）2.完成bias电压ADC功能验证；3.完成收端功能验证；&lt;br/&gt;&amp;nbsp;2017-05-15 最新项目进度：BOM制作完成，新物料AD5691样品还未到；&lt;/span&gt;&lt;br/&gt;&lt;/p&gt;', '58', '1495000630', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('53', '48', '&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_doc.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170519/1495157259927205.docx&quot; title=&quot;APAT 同轴EML问题总结.docx&quot;&gt;APAT 同轴EML问题总结.docx&lt;/a&gt;&lt;/p&gt;&lt;p&gt;1 提交一个之前APAT第一次验证测试的问题总结。便于后续查询&lt;br/&gt;&lt;/p&gt;', '53', '1495157294', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('54', '48', '&lt;ol class=&quot; list-paddingleft-2&quot; style=&quot;list-style-type: decimal;&quot;&gt;&lt;li&gt;&lt;p&gt;2017-05-21 验证测试Ton/Toff 电路时序，使用双P-mos管搭载测试不满足要求；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;&amp;nbsp;2017-05-21 验证测试OLT上面的模拟开关，DCDC 1.5V输入，满足要求；DCDC 2.0V输入，时序不满足使用要求；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;2017-05-22 正式使用TI的模拟开关&lt;span style=&quot;font-family: 微软雅黑; line-height: 21px; background-color: rgb(255, 255, 255);&quot;&gt;TS5A3166搭载，以保证电路Ton/Toff 时序要求；今天完成原理图更改和PCB设计；&lt;/span&gt;&lt;br/&gt;&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;图的依次是模拟开关Atop Ton；DCDC 1.5V Toff ；DCDC 1.9V Toff；极致Ton and Toff；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;&lt;img src=&quot;/ueditor/php/upload/image/20170522/1495445137122649.jpg&quot; title=&quot;1495445137122649.jpg&quot;/&gt;&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;&lt;img src=&quot;/ueditor/php/upload/image/20170522/1495445137131668.jpg&quot; title=&quot;1495445137131668.jpg&quot;/&gt;&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;&lt;img src=&quot;/ueditor/php/upload/image/20170522/1495445137674221.jpg&quot; title=&quot;1495445137674221.jpg&quot;/&gt;&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;&lt;img src=&quot;/ueditor/php/upload/image/20170522/1495445137137443.jpg&quot; title=&quot;1495445137137443.jpg&quot;/&gt;&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;&lt;img src=&quot;/ueditor/php/upload/image/20170522/1495445137621895.jpg&quot; title=&quot;1495445137621895.jpg&quot;/&gt;&lt;/p&gt;&lt;/li&gt;&lt;/ol&gt;', '53', '1495445278', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('55', '46', '&lt;p&gt;1. 2017-05-22, 采购给出第一次交期为17号，第二次给出PCB交期为22号；今天给出交期为23号，明天PCB到厂；&lt;/p&gt;', '53', '1495445398', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('56', '34', '&lt;p&gt;恒得于5月18日对AOC的结构件进行了送样，该模具（采用COB的模具修模而成）制作的毛坯样品不符合设计要求，具体如下图。5月19日我们与恒得的技术人员沟通了毛坯件存在的详细尺寸问题和遗漏的特征问题，恒得决定利用周末进行修模，修模后的毛坯件预计5月23日提供给我司。&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;/ueditor/php/upload/image/20170523/1495504285916576.png&quot; title=&quot;1495504285916576.png&quot; alt=&quot;blob.png&quot;/&gt;&lt;/p&gt;', '79', '1495504296', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('57', '34', '&lt;ol class=&quot; list-paddingleft-2&quot; style=&quot;list-style-type: decimal;&quot;&gt;&lt;li&gt;&lt;p&gt;安捷讯的OM3光纤3、5、7米各到货120条，试装OK。&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;恒得修模后的结构件已送到公司，上盖基本符合要求；底座还有几个尺寸不满足设计要求，如下图红色尺寸，已通知到恒得修改。&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;/ueditor/php/upload/image/20170523/1495528913183702.png&quot; title=&quot;1495528913183702.png&quot; alt=&quot;blob.png&quot;/&gt;&lt;br/&gt;&lt;/p&gt;&lt;/li&gt;&lt;/ol&gt;', '79', '1495529026', '54,41,55,83,84', null);
INSERT INTO `atop_project_discuss` VALUES ('58', '35', '&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;ol class=&quot; list-paddingleft-2&quot; style=&quot;list-style-type: decimal;&quot;&gt;&lt;li&gt;&lt;p&gt;ADDON 客退 15M cable 今天在实验室使用nexus 3K 测试各种金手指接触，结构问题，都未能复现不link的情况；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;ADDON 客退 15M cable 在juniper4300 交换机上昨天link 不通，今天测试link是通的，主要原因为其中一个万兆口&lt;/p&gt;&lt;p&gt;有磨损的问题，接触不好。&lt;/p&gt;&lt;/li&gt;&lt;/ol&gt;', '53', '1495532579', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('59', '46', '&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;ol class=&quot; list-paddingleft-2&quot; style=&quot;list-style-type: decimal;&quot;&gt;&lt;li&gt;&lt;p&gt;XFP_ZR PCB &amp;nbsp;今天已经到厂，目前正在开钢网贴片；mike预计贴片交期5月27日；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;firmware requirement 初稿完成；&lt;br/&gt;&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_txt.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170524/1495619573324287.xlsx&quot; title=&quot;ATOP FirmwareRequirement for XFP_ZR GN2044+TPS63070.xlsx&quot;&gt;ATOP FirmwareRequirement for XFP_ZR GN2044+TPS63070.xlsx&lt;/a&gt;&lt;/p&gt;&lt;/li&gt;&lt;/ol&gt;', '53', '1495619810', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('60', '48', '&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: 微软雅黑; line-height: 21px; background-color: rgb(255, 255, 255);&quot;&gt;1. APAT &amp;nbsp;AET0003LC10 &amp;nbsp;器件验证结果：从测试数据来看，效果比光恒的都还要好一点；&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: 微软雅黑; line-height: 21px; background-color: rgb(255, 255, 255);&quot;&gt;&amp;nbsp; &amp;nbsp;建议可以小批量采购一批进行二次试跑验证；&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_txt.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170527/1495862702554292.xlsx&quot; title=&quot;APAT TOSA Evaluation.xlsx&quot;&gt;APAT TOSA Evaluation.xlsx&lt;/a&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: 微软雅黑; line-height: 21px; background-color: rgb(255, 255, 255);&quot;&gt;&lt;/span&gt;&lt;br/&gt;&lt;/p&gt;', '53', '1495862707', '54,83', null);
INSERT INTO `atop_project_discuss` VALUES ('61', '33', '&lt;p&gt;csfp+ 4对样品测试数据&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_txt.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170602/1496381621117752.xlsx&quot; title=&quot;APCSP32B33CDL10 .xlsx&quot;&gt;APCSP32B33CDL10 .xlsx&lt;/a&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_txt.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170602/1496381621182669.xlsx&quot; title=&quot;APCSP23B33CDL10 .xlsx&quot;&gt;APCSP23B33CDL10 .xlsx&lt;/a&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '81', '1496381631', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('62', '33', '&lt;p&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;产品规格书&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;br/&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_pdf.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170602/1496381929115217.pdf&quot; title=&quot;APCSPxxB33xDL10&amp;nbsp;V1.1.pdf&quot;&gt;APCSPxxB33xDL10&amp;nbsp;V1.1.pdf&lt;/a&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_doc.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170602/1496381929617506.docx&quot; title=&quot;APCSPxxB33xDL10&amp;nbsp;V1.1.docx&quot;&gt;APCSPxxB33xDL10&amp;nbsp;V1.1.docx&lt;/a&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '81', '1496381953', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('63', '35', '&lt;p&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;本周返修一共43条cable，29条为良品，10条bert有误码，4条焊盘掉；&lt;/p&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;有误码的cable经分析都为装配问题；&lt;/p&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;1、cable线与焊盘接触点没有点胶进行固定，在装配完成后晃动cable线都会导致cable有误码产生；&lt;/p&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;2、在点胶前，应该把cable线与PCBA平行，再进行点胶固定，可以避免在装配后拉扯及&lt;span style=&quot;font-size: 10.5pt; line-height: 1.5; background-color: window;&quot;&gt;晃动cable线导致的误码产生；&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 10.5pt; line-height: 1.5; background-color: window;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;3、个人建议，可以做到像无源cable的点胶模试，在焊盘及点胶固定块处有一个缓冲区；&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 10.5pt; line-height: 1.5; background-color: window;&quot;&gt;附件为图片，可以参照一下。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;/ueditor/php/upload/image/20170623/1498187944138205.png&quot; title=&quot;1498187944138205.png&quot;/&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;/ueditor/php/upload/image/20170623/1498187944540694.png&quot; title=&quot;1498187944540694.png&quot;/&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;/ueditor/php/upload/image/20170623/1498187944107940.png&quot; title=&quot;1498187944107940.png&quot;/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '53', '1498188046', '54,56,57,71', null);
INSERT INTO `atop_project_discuss` VALUES ('64', '48', '&lt;p&gt;&lt;img src=&quot;/ueditor/php/upload/image/20170623/1498195600992614.png&quot; title=&quot;1498195600992614.png&quot; alt=&quot;image.png&quot;/&gt;&lt;/p&gt;', '53', '1498195619', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('65', '48', '&lt;ol class=&quot; list-paddingleft-2&quot; style=&quot;list-style-type: decimal;&quot;&gt;&lt;li&gt;&lt;p&gt;PCB 打样 6月20日到厂；（主要是快捷商务停单原因）&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;PCBA 6月21日准备好所有贴片资料，申请贴片，已经批准；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;计划给的贴片交期为6月27日钢网到绵阳，6月27日贴片完成；&lt;br/&gt;&lt;/p&gt;&lt;/li&gt;&lt;/ol&gt;', '53', '1498195849', '54,71', null);
