INSERT INTO `atop_project_discuss` VALUES ('67', '46', '&lt;ol class=&quot; list-paddingleft-2&quot; style=&quot;list-style-type: decimal;&quot;&gt;&lt;li&gt;&lt;p&gt;6月9日 &amp;nbsp;～ 6月23日 EVT 测试完成90%；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;6月9日 ～ 6月 23日 FVT测试完成90%；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;制作出4只工程样品；C-temp 功耗&amp;lt;1.5W; I-temp&amp;lt;1.8W;&lt;br/&gt;&lt;/p&gt;&lt;/li&gt;&lt;/ol&gt;', '53', '1498200991', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('68', '46', '&lt;p&gt;FVT测试发现较多问题，下周抽空一起过一下做个汇总，看看能否解决。&lt;/p&gt;', '30', '1498209302', '54,74,82', null);
INSERT INTO `atop_project_discuss` VALUES ('69', '46', '&lt;ol class=&quot; list-paddingleft-2&quot; style=&quot;list-style-type: decimal;&quot;&gt;&lt;li&gt;&lt;p&gt;6月21日 晚上测出firmware bug；模块现象就是重新上电之后模块发很小的光，&lt;/p&gt;&lt;p&gt;需要初始化一下I2C，模块发光才能正常；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;经分析主要原因是：使用update 进行firmware更新，更新的程序跑飞了，产生如此现象；使用download直接下载不会出现此现象；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;进一步分析为keil 设置的hex文件输出格式的问题引起；&lt;br/&gt;&lt;/p&gt;&lt;/li&gt;&lt;/ol&gt;', '53', '1498637041', '54,74', null);
INSERT INTO `atop_project_discuss` VALUES ('70', '46', '&lt;ol class=&quot; list-paddingleft-2&quot; style=&quot;list-style-type: decimal;&quot;&gt;&lt;li&gt;&lt;p&gt;截止今天EVT 功能均测试完毕，基本功能均已经实现，数据也整理完毕；&lt;br/&gt;&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;大致的说一下 XFP_ZR 低功耗 C-temp&amp;lt;1.6W; I-temp&amp;lt;1.9W; &lt;strong&gt;老方案只能做到C-temp&amp;lt;2.5W; I-temp&amp;lt;3.0W;&lt;/strong&gt;&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;SDH/SONET应用 协议jitter测试部分抖动指标不满足协议，但是挂长纤能跑通SDH应用；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;下面附上本次测试的EVT数据，供大家参考；&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_txt.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170629/1498735311810417.xlsx&quot; title=&quot;EVT_PLN-2017-A-017-1.xlsx&quot;&gt;EVT_PLN-2017-A-017-1.xlsx&lt;/a&gt;&lt;/p&gt;&lt;/li&gt;&lt;/ol&gt;', '53', '1498735328', '86,85', null);
INSERT INTO `atop_project_discuss` VALUES ('71', '35', '&lt;ol class=&quot; list-paddingleft-2&quot; style=&quot;list-style-type: decimal;&quot;&gt;&lt;li&gt;&lt;p&gt;金信诺和Atop cable 工艺对比差异分析：&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_doc.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170706/1499311604137662.docx&quot; title=&quot;金信诺与ATOP装配对比报告.docx&quot;&gt;金信诺与ATOP装配对比报告.docx&lt;/a&gt;&lt;/p&gt;&lt;/li&gt;&lt;/ol&gt;', '53', '1499311616', '54,68,71', null);
INSERT INTO `atop_project_discuss` VALUES ('72', '34', '&lt;p&gt;&lt;span style=&quot;color: rgb(51, 51, 153); font-family: 微软雅黑; line-height: 21px; widows: auto; background-color: rgb(255, 255, 255);&quot;&gt;解锁键和底座弹簧槽的间隙偏大，需要调整解锁键的尺寸，避免弹簧被勾出变形。解决方案：1.通知恒得对解锁组合件修模，已将需要调整的图纸发给恒得，恒得预计本周末送样；2.采购寻找线径0.3mm的弹簧代替BOM中0.2mm线径的弹簧，源宝预计本周六送货。此2方案同时解决后，弹簧被勾出的问题即可彻底解决。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;/ueditor/php/upload/image/20170707/1499394677902075.png&quot; title=&quot;1499394677902075.png&quot; alt=&quot;blob.png&quot;/&gt;&lt;/p&gt;', '79', '1499394884', '', null);
INSERT INTO `atop_project_discuss` VALUES ('73', '49', '&lt;p&gt;PCBA已外发贴片，预计7月12号完成，暂时PCBA上漏贴了56uH电感和0201低频磁珠2种物料，已向采购申请样品，交期待采购回复。&lt;/p&gt;&lt;p&gt;固件暂时还未开始开发。现在研发手上有三优和昱升的光器件收发端样品各2PCS。&lt;/p&gt;', '60', '1499737809', '', null);
INSERT INTO `atop_project_discuss` VALUES ('74', '31', '&lt;p&gt;近期制作7pcs样品发现厦门三优提供的10PCS ROSA结构尺寸与规格书不一致，无法装入我司模块结构件。&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_jpg.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170711/1499738636749613.jpg&quot; title=&quot;CatchD726(07-11-10-02-16).jpg&quot;&gt;CatchD726(07-11-10-02-16).jpg&lt;/a&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_jpg.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170711/1499738637115820.jpg&quot; title=&quot;CatchDC44(07-11-10-02-16).jpg&quot;&gt;CatchDC44(07-11-10-02-16).jpg&lt;/a&gt;&lt;/p&gt;&lt;p&gt;为完成销售的2PCS订单需求，使用昱升提供的2PCS样品ROSA及之前SEMTECH送样的2PCS ROSA制作。焊接过程中有1PCS SEMTECH的ROSA柔板焊盘损坏无法使用。测试报告如附件。TOSA的高温下性能劣化较严重，只能支持到Case温度70°，环境温度60°下的传纤性能。&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_txt.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170711/1499738523251865.xlsx&quot; title=&quot;SFP28 LR测试报告170707.xlsx&quot;&gt;SFP28 LR测试报告170707.xlsx&lt;/a&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;现在暂时只有1PCS成品模块可以用于自动化软件调试。&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '60', '1499738702', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('75', '30', '&lt;p&gt;之前永贵加工的3条DAC线只有8M的一条成品，另外2条在制作过程中造成了焊盘脱离，原因是加工制作工艺在DAC壳件装配时受力造成的。&lt;/p&gt;&lt;p&gt;其中8M的有源DAC性能调试已完成，固件还需细微的优化。现又贴片90PCS，预计本周内完成。贴片完成后发永贵加工为成品有源DAC，具体加工长度及规格需计划及销售部门讨论后决定。&lt;br/&gt;&lt;/p&gt;', '60', '1499739823', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('77', '48', '&lt;ol style=&quot;list-style-type: decimal;&quot; class=&quot; list-paddingleft-2&quot;&gt;&lt;li&gt;&lt;p&gt;钢网已到；&lt;br/&gt;&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;缺AD5691，第一次送货封装对不上，要求8pin寄过来的却是10pin，&lt;/p&gt;&lt;p&gt;退回给供应商要求重新发货，预计明天上午可以到&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;第二批增加贴片40套，与第一批一起贴&lt;br/&gt;&lt;/p&gt;&lt;/li&gt;&lt;/ol&gt;', '100', '1499767599', '', null);
INSERT INTO `atop_project_discuss` VALUES ('78', '46', '&lt;p&gt;因缺以下几款芯片无法贴片，芯片交期在7/30&lt;br/&gt;料号&amp;nbsp;&amp;nbsp; &amp;nbsp;数量&amp;nbsp;&amp;nbsp; &amp;nbsp;交期&lt;br/&gt;1.05.BM110-3159&amp;nbsp;&amp;nbsp; &amp;nbsp;50&amp;nbsp;&amp;nbsp; &amp;nbsp;2017/7/30&lt;br/&gt;1.05.B8108-3070&amp;nbsp;&amp;nbsp; &amp;nbsp;50&amp;nbsp;&amp;nbsp; &amp;nbsp;2017/7/30&lt;br/&gt;1.05.B8130-2097&amp;nbsp;&amp;nbsp; &amp;nbsp;50&amp;nbsp;&amp;nbsp; &amp;nbsp;2017/7/30&lt;br/&gt;1.05.BME10-2776&amp;nbsp;&amp;nbsp; &amp;nbsp;50&amp;nbsp;&amp;nbsp; &amp;nbsp;2017/7/30&lt;/p&gt;', '100', '1499767689', '', null);
