INSERT INTO `atop_project_discuss` VALUES ('80', '34', '&lt;p&gt;本周对源宝新发过来的结构件进行了验证，装配弹簧没有问题；&lt;/p&gt;&lt;p&gt;等解锁件到货后，产线的100套即可完成小批量试产。&lt;br/&gt;&lt;/p&gt;', '100', '1500014083', '54', null);
