INSERT INTO `atop_project_discuss` VALUES ('82', '48', '&lt;p&gt;制作4只样品完成，测试完成；firmware修正bug如下：&lt;br/&gt;1、增加了原始温度，CASE温度校准根据原始温度进行校准&lt;br/&gt;2、修改查找表由&amp;nbsp;2度一个点，改为3度一个点&lt;br/&gt;3、增加DAC值缓慢增加&lt;br/&gt;4、增加上电后，TEC锁定前不发光，锁定后发光&lt;br/&gt;5、增加&amp;nbsp;F4&amp;nbsp;TAB_B表（TECDAC&amp;nbsp;温补表，暂时未使用，赋订制，0x860）&lt;br/&gt;6、增加F4&amp;nbsp;TAB_F表（DAC初始值配置和权重配置表）&lt;br/&gt;7、解决上电浪涌问题，上电配置IO口时，8833EN脚和&amp;nbsp;APDEN&amp;nbsp;脚配置低电平，虽然外部加了下拉到地，但是实测，上电后不配置IO口还是为高电平&lt;br/&gt;8、4834&amp;nbsp;DAC配置初始化时，需要先给DAC寄存器赋值后，再写配置寄存器，这时候就可以正常输出电压，如果先写配置寄存器再赋DAC值，会出现一段时间的零电平。&lt;br/&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;这个时候回导致TEC电流过大，产生浪涌。&lt;br/&gt;9、4834&amp;nbsp;MCU&amp;nbsp;上电时，在配置DAC之前默认有2.5V左右的电压&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '100', '1500025836', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('83', '50', '&lt;p&gt;&lt;span style=&quot;font-size:14px;font-family:宋体&quot;&gt;产品原理图初版已评审，又增加了调整和兼容设计，待二次评审&lt;/span&gt;&lt;br/&gt;&lt;/p&gt;', '100', '1500355683', '54', null);
