INSERT INTO `atop_project_discuss` VALUES ('90', '48', '&lt;p&gt;7/21更新:&lt;br/&gt;&lt;/p&gt;&lt;p&gt;本周完成15PCS 样品制作; 浪涌调试完成; EVT报告完成; Bias监控完成; TEC 电流监控完成；&lt;/p&gt;&lt;p&gt;上电时序调试完成；ATE本周调试完成；手动软件本周也跟进调试完成；温补调试完成；&lt;/p&gt;', '100', '1501224733', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('91', '50', '&lt;p&gt;原理图评审已经完成，PCB布板交由罗洋进行,预计下周开始布板；&lt;/p&gt;&lt;p&gt;项目的硬件设计由黄正银改成罗洋。&lt;br/&gt;&lt;br/&gt;&lt;/p&gt;', '100', '1501225731', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('92', '27', '&lt;p&gt;7/14更新：&lt;/p&gt;&lt;p&gt;1.10G-EPON对称ONU的板子贴好后有问题：上电时供电不正常（已解决），模块不发光（修改中）；修改好之后再开始验证器件；现在示波器比较紧张，后续要协调使用；&lt;br/&gt;2.TSR已完成，待九洲确认指标是否能完成；&lt;br/&gt;3.本周已对关键IC提出采购申请，其中LTC3203-1和SN74LVC1G14DRLR仓库已经没有备料，要求采购把交期提到7月下旬；&lt;/p&gt;', '100', '1501226160', '54', null);
