INSERT INTO `atop_project_discuss` VALUES ('95', '31', '&lt;p&gt;1、这次采购到料的10PCS 三优ROSA与其规格书内的尺寸不一致，无法装入我司结构件，需要三优退换货；退换货已发货，预计今天可以收到；&lt;/p&gt;&lt;p&gt;2、MACOM TO预计今天发给光恒封装成TOSA，完成时间待定；&lt;br/&gt;&lt;/p&gt;&lt;p&gt;3、DSN制作的柔板验证后发现光信号抖动偏大，需要确认问题原因，重新打板柔板制作。&lt;br/&gt;&lt;/p&gt;', '100', '1501228340', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('96', '30', '&lt;p&gt;1、贴片90pcs已完成；&lt;/p&gt;&lt;p&gt;2、永贵补做2条QSFP+有源DAC均有PCB板与线连接处的焊盘脱离，需要永贵改进生产工艺解决。&lt;/p&gt;', '100', '1501228551', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('97', '46', '&lt;p&gt;本周完成8PCS ADG 样品制作，还有jitter tolenrance 、firmware 上电disable 发光未调试完成&lt;br/&gt;&lt;br/&gt;&lt;/p&gt;', '100', '1501234964', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('98', '48', '&lt;p&gt;1 ～ 11.3G WM 多速率性能评估：&lt;/p&gt;&lt;p&gt;结论是： 1 ～ 11.3G &amp;nbsp; -24 的灵敏度 I-temp 达不到要求。&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_txt.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170803/1501745446492498.xlsx&quot; title=&quot;1 ～ 10GWM 性能评估.xlsx&quot;&gt;1 ～ 10GWM 性能评估.xlsx&lt;/a&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '53', '1501745459', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('99', '48', '&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_txt.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170809/1502272162137955.xlsx&quot; title=&quot;Sumitomo rosa_ Gennum 3357_25km.xlsx&quot;&gt;Sumitomo rosa_ Gennum 3357_25km.xlsx&lt;/a&gt;&lt;/p&gt;&lt;ol class=&quot; list-paddingleft-2&quot; style=&quot;list-style-type: decimal;&quot;&gt;&lt;li&gt;&lt;p&gt;附件为今天李川协助测试的 D38方案带CDR 和 不带CDR 在使用Sumitomo TOSA 和 GN3357 I-temp 使用 home bert的测试结果；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;与8月3日上传的1 ～ 11.3G 测试数据形成对比；1 ～ 11.3G 测试使用安利bert；使用Cy TOSA +Gn3357 2PCS；使用光恒TOSA+GN3357 1pcs；&lt;br/&gt;&lt;/p&gt;&lt;/li&gt;&lt;/ol&gt;', '53', '1502272288', '54,101', null);
INSERT INTO `atop_project_discuss` VALUES ('100', '27', '&lt;p&gt;10G对称ONU优化验证情况：&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&amp;nbsp; 1、&amp;nbsp;硬件及配置：板子发端硬件参数做了优化，改善眼图质量，并优化了寄存器参数配置；&lt;/p&gt;&lt;p&gt;&amp;nbsp; 2、对收端APD硬件参数做了调整，FW修复了对APD写表的问题，当前版本&amp;nbsp;FIRM_0720_V09；&lt;/p&gt;&lt;p&gt;&amp;nbsp; 3、BOSA验证情况：对当前Truelight的良品BOSA做了全温性能验证，模块壳温-40℃~85℃范围内满足性能指标，规格书见附件；&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_doc.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170809/1502289697366673.docx&quot; title=&quot;APXEU25SYHCDSP3_V1.1 - 20170807.docx&quot;&gt;APXEU25SYHCDSP3_V1.1 - 20170807.docx&lt;/a&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_doc.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170809/1502289697125243.docx&quot; title=&quot;APXEU25SYHxDSP3_V1.1 - 20170807.docx&quot;&gt;APXEU25SYHxDSP3_V1.1 - 20170807.docx&lt;/a&gt;&lt;/p&gt;&lt;p&gt;PS1：收端SD及SEN在验证过程中发现指标偏低，检查后发现是由于高温偏压没有调整到位，测试发现是APD偏压刚好处在了非线性区域，将APDSET做了些调整，SEN和SD已经满足指标；现在已经对DC-DC的分压电阻做了修改验证，尽量在保证精度的条件下将适应的输出电压调整到了线性区域，APD偏压输出更线性；&lt;/p&gt;&lt;p&gt;PS2：&lt;span style=&quot;font-family: &amp;#39;Microsoft YaHei UI&amp;#39;; line-height: 21px; background-color: rgb(255, 255, 255);&quot;&gt;由于只有一只良品，所以只做了性能摸底验证，EVT报告等准备样品的时候再补齐，现在已经提了20pcs的TO采购申请，便后后期样品准备。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: &amp;#39;Microsoft YaHei UI&amp;#39;; line-height: 21px; background-color: rgb(255, 255, 255);&quot;&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_txt.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170809/1502290578551796.xlsx&quot; title=&quot;1.13.4SNUD02-A00 10G-EPON ONU Sym Tuning_Test.xlsx&quot;&gt;1.13.4SNUD02-A00 10G-EPON ONU Sym Tuning_Test.xlsx&lt;/a&gt;&lt;/p&gt;', '99', '1502290610', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('101', '33', '&lt;p&gt;2017/3/21-&amp;nbsp;重新更改组件柔版外形&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_rar.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170810/1502348321533120.rar&quot; title=&quot;CSFP柔版 更改后.rar&quot;&gt;CSFP柔版 更改后.rar&lt;/a&gt;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;2017/4/3 &amp;nbsp;完成主板副板 以及柔版的评审。&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_xls.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170810/1502350118132111.xls&quot; title=&quot;1.14.LL10D00-B00 Design For Manufacture CheckList(可制造性设计指导清单).xls&quot;&gt;1.14.LL10D00-B00 Design For Manufacture CheckList(可制造性设计指导清单).xls&lt;/a&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_xls.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170810/1502350118486517.xls&quot; title=&quot;1.12.LL10-D03 Design For Manufacture CheckList(可制造性设计指导清单).xls&quot;&gt;1.12.LL10-D03 Design For Manufacture CheckList(可制造性设计指导清单).xls&lt;/a&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_xls.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170810/1502350118752496.xls&quot; title=&quot;1.12.LL10-D04 Design For Manufacture CheckList(可制造性设计指导清单).xls&quot;&gt;1.12.LL10-D04 Design For Manufacture CheckList(可制造性设计指导清单).xls&lt;/a&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/