_rar.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170810/1502350288106813.rar&quot; title=&quot;制版文件1.12.LL10-D03.rar&quot;&gt;制版文件1.12.LL10-D03.rar&lt;/a&gt;&lt;/p&gt;&lt;p&gt;2017/4/24 &amp;nbsp;完成csfp+bom，下贴片申请。&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_rar.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170810/1502350439848887.zip&quot; title=&quot;1.12.LL10-D04贴片文件.zip&quot;&gt;1.12.LL10-D04贴片文件.zip&lt;/a&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_rar.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170810/1502350439962707.zip&quot; title=&quot;1.12.LL10-D03贴片文件.zip&quot;&gt;1.12.LL10-D03贴片文件.zip&lt;/a&gt;&lt;/p&gt;&lt;p&gt;2017/5/5 &amp;nbsp;&amp;nbsp;初步完成收端发端调试。&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_jpg.gif&quot; width=&quot;16&quot; height=&quot;16&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170810/1502350721612987.jpg&quot; title=&quot;tx.jpg&quot;&gt;tx.jpg&lt;/a&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_jpg.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170810/1502350721951992.jpg&quot; title=&quot;rx.jpg&quot;&gt;rx.jpg&lt;/a&gt;&lt;/p&gt;&lt;p&gt;2017/5/31 &amp;nbsp;&amp;nbsp;完成10pcs样品调测试。&lt;/p&gt;&lt;p&gt;2017/6/14 &amp;nbsp;&amp;nbsp;初步确认更改组件柔版ps&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_rar.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170810/1502350977112781.rar&quot; title=&quot;csfp+初步ps.rar&quot;&gt;csfp+初步ps.rar&lt;/a&gt;&lt;/p&gt;&lt;p&gt;2017/6/20 &amp;nbsp; &amp;nbsp;申请小批量试产，物料申请。&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_jpg.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170810/1502351155121483.jpg&quot; title=&quot;试产.jpg&quot;&gt;试产.jpg&lt;/a&gt;&lt;/p&gt;&lt;p&gt;2017/7/7 &amp;nbsp; &amp;nbsp; &amp;nbsp;完成柔版改版评审&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_xls.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170810/1502351704549903.xls&quot; title=&quot;1.14.LL10D00-C00 Design For Manufacture CheckList(可制造性设计指导清单).xls&quot;&gt;1.14.LL10D00-C00 Design For Manufacture CheckList(可制造性设计指导清单).xls&lt;/a&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_doc.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170810/1502351704247949.doc&quot; title=&quot;设计评审记录_1.14.LL10-D00-C00.doc&quot;&gt;设计评审记录_1.14.LL10-D00-C00.doc&lt;/a&gt;&lt;/p&gt;&lt;p&gt;2017/7/17 &amp;nbsp; 完成投板&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_rar.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170810/1502351822838689.zip&quot; title=&quot;1.14.LL10D00-C00制板文件.zip&quot;&gt;1.14.LL10D00-C00制板文件.zip&lt;/a&gt;&lt;/p&gt;&lt;p&gt;2017/8/4 &amp;nbsp; 柔版装配已验证，未发现异常。试产除mini bosa 外其他物料已备齐。&lt;/p&gt;', '81', '1502351960', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('102', '31', '&lt;p&gt;1、已收到重新更换的三优ROSA，本次无结构上的问题。预计下周三之前出验证结果&lt;/p&gt;&lt;p&gt;2、MACOM TO封装的TOSA偏心严重，光耦合效率很低，最终成品光功率会偏小。重新改用AOI的TO来封装，交期待定&lt;/p&gt;&lt;p&gt;3、新改版柔板已发加工文件&lt;/p&gt;', '100', '1502446126', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('103', '49', '&lt;p&gt;1、固件初版调试完成，器件可以正常发光，DDMI监控，校准完成。&lt;br/&gt;2、因为驱动芯片本身不带APC控制，需要固件完成APC闭环控制，待完成。&lt;br/&gt;3、收到磁珠和电感样品各一款，已安排领料，下周验证。剩余替代品交期待采购回复&lt;br/&gt;&lt;/p&gt;', '100', '1502446205', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('104', '48', '&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_txt.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170814/1502680973821218.xlsx&quot; title=&quot;SFP+ER-DP测试数据.xlsx&quot;&gt;SFP+ER-DP测试数据.xlsx&lt;/a&gt;&lt;/p&gt;&lt;ol class=&quot; list-paddingleft-2&quot; style=&quot;list-style-type: decimal;&quot;&gt;&lt;li&gt;&lt;p&gt;针对诺基亚EML 40km gap 对比，而特制的2PCS 样品验证测试数据；&lt;br/&gt;&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;DDMI 监控tx +/- 1.5 &amp;nbsp;rx +/-2 DDM 可以满足；DP 可选可以满足；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;ROSA不能满足要求 ，需要寻找真正的I-temp Pin-ROSA；&lt;br/&gt;&lt;/p&gt;&lt;/li&gt;&lt;/ol&gt;', '53', '1502681175', '54,83', null);
INSERT INTO `atop_project_discuss` VALUES ('105', '48', '&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_txt.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170814/1502681557836107.xlsx&quot; title=&quot;Jitter Test.xlsx&quot;&gt;Jitter Test.xlsx&lt;/a&gt;&lt;/p&gt;&lt;p&gt;SFP+ 抖动测试结果，其中抖动容限不符合协议要求；&lt;br/&gt;&lt;/p&gt;', '53', '1502681583', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('106', '49', '&lt;p&gt;模块基本调试完成，因为现在暂时手上只有1款磁珠和电感，眼图暂时没有在硬件上进行优化。使用三优的25G SR TOSA&amp;amp;ROSA，在模块自发自收的情况下初步评估结果如下：&lt;/p&gt;&lt;p&gt;0℃：AOP:-1dBm，ER:3.8,SEN:-10.9dBm;30℃：AOP:-1.6dBm，ER:3.8,SEN:-10.8dBm;70℃：AOP:-2.5dBm，ER:3.8,SEN:-11dBm;&lt;/p&gt;&lt;p&gt;三温下光眼图在高温下劣化较大，但是收端的灵敏度在三温下的差别不大。&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;模块现在采用的是双开环设计，固件还在继续完善中。后期收端磁珠及电感后会进一步调试一下硬件电路，希望能改善眼图质量。&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;/ueditor/php/upload/image/20170818/1503046259682914.bmp&quot; title=&quot;1503046259682914.bmp&quot;/&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;/ueditor/php/upload/image/20170818/1503046259112119.bmp&quot; title=&quot;1503046259112119.bmp&quot;/&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;/ueditor/php/upload/image/20170818/1503046259915458.bmp&quot; title=&quot;1503046259915458.bmp&quot;/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '60', '1503046394', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('107', '31', '&lt;p&gt;本周用三优新送样的ROSA完成了5PCS模块样品制作，ROSA性能满足模块要求。评估了光恒新封装的NEC TO的TOSA，该送样的2PCS TOSA为自带柔板，但是自带的柔板对TOSA发端的眼图影响很大，如下图所示1为更换了AOI的柔板的发端眼图，2为自带柔板的发端眼图。&lt;/p&gt;&lt;p&gt;现在可以开始用自制的模块样品开始自动化软件的调试。同时试产90PCS的模块备料已经提出采购申请。模块所用的主芯片方案M37030在今年7月份推出了B版本的样品，现已向供应商申请样品中。&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;/ueditor/php/upload/image/20170818/1503046987874793.bmp&quot; title=&quot;1503046987874793.bmp&quot;/&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;/ueditor/php/upload/image/20170818/1503046987107863.bmp&quot; title=&quot;1503046987107863.bmp&quot;/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '60', '1503047120', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('108', '50', '&lt;p&gt;新物料已申请料号，提交样品请购并在询价中；&lt;/p&gt;&lt;p&gt;BOM表已更新，待询价后进行产品价格评估。&lt;/p&gt;', '99', '1503132544', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('109', '27', '&lt;p&gt;XGPON ONU优化情况：&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: 宋体; background: white;&quot;&gt;新板子初始参数配合&lt;/span&gt;&lt;span style=&quot;font-family: Helvetica, sans-serif; background: white;&quot;&gt;Truelight BOSA&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; background: white;&quot;&gt;抖动较大，&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; background: white;&quot;&gt;现在眼图已经优化变细&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; background: white;&quot;&gt;，后续将对当前的两块裸板装成模块后在全温进行性能评估。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: 宋体; background: white;&quot;&gt;&lt;img src=&quot;/ueditor/php/upload/image/20170819/1503132983883012.png&quot; title=&quot;1503132983883012.png&quot; alt=&quot;blob.png&quot;/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: 宋体; background: white;&quot;&gt;PS: 后续TO的请购已在进行当中，提前为随后的样品做准备。&lt;/span&gt;&lt;/p&gt;', '99', '1503133144', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('110', '49', '&lt;p&gt;固件问题已解决，开始在现有条件下测试模块三温性能，待磁珠及电感样品到料后再试图进一步优化眼图。&lt;/p&gt;', '60', '1503646339', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('111', '31', '&lt;p&gt;完成NEC 25G TO封装的TOSA性能评估，该TO只能满足商业级应用。&lt;/p&gt;&lt;table width=&quot;1581&quot; style=&quot;width: 1024px;&quot;&gt;&lt;colgroup&gt;&lt;col width=&quot;127&quot; style=&quot;;width:127px&quot;/&gt;&lt;col width=&quot;294&quot; style=&quot;;width:295px&quot;/&gt;&lt;col width=&quot;290&quot; span=&quot;3&quot; style=&quot;;width:291px&quot;/&gt;&lt;col width=&quot;288&quot; style=&quot;;width:288px&quot;/&gt;&lt;/colgroup&gt;&lt;tbody&gt;&lt;tr style=&quot;height:27px&quot; class=&quot;firstRow&quot;&gt;&lt;td colspan=&quot;6&quot; width=&quot;1581&quot;&gt;1、该方案2PCS模块的高温传纤灵敏度可以满足要求；&lt;/td&gt;&lt;/tr&gt;&lt;tr style=&quot;height:27px&quot;&gt;&lt;td colspan=&quot;6&quot;&gt;2、该方案2PCS模块的发射端高温眼图劣化较大，模块散热对模块性能的影响较大，后期需要重点关注改善散热情况。&lt;/td&gt;&lt;/tr&gt;&lt;tr style=&quot;height:27px&quot;&gt;&lt;td colspan=&quot;6&quot;&gt;3、由于评估NEC的25G TO性能，均为替换了自带柔板后进行的测试，原TOSA自带柔板引入的抖动会较大，在替换柔板的时候有一定的焊接问题，可能会影响到最终的眼图效果。&lt;/td&gt;&lt;/tr&gt;&lt;/tbody&gt;&lt;/table&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_txt.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170825/1503646629707571.xlsx&quot; title=&quot;SFP28 LR NEC TO样品测试报告.xlsx&quot;&gt;SFP28 LR NEC TO样品测试报告.xlsx&lt;/a&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '60', '1503646640', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('112', '30', '&lt;p&gt;待永贵协助验证进一步加强可靠性的方案。现有的芯片方案制作的8M，7M,5M有源DAC模块均能跑10G误码仪测试无误码产生。10M的有源DAC前期送焊接的影响存在有时通，有时不通的情况，待改进生产工艺后看能否进一步改善。后期的长距离有源QSFP+ DAC线尽量切换到现在的新方案上来。&lt;/p&gt;', '60', '1503646843', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('113', '27', '&lt;p&gt;XGPON ONU验证情况：对当前两只模块在无电压拉偏的情况下做了摸底测试&lt;/p&gt;&lt;p&gt;其中1pcs常温SEN偏小（-25.7,E-3），确认为BOSA收端异常；另1pcs收端指标很好，与之前验证的10G对称BOSA收端性能一致。&lt;/p&gt;&lt;p&gt;另外，测试了这2pcs XGPON ONU的发端指标，满足I-Temp指标；并测试了高温传纤性能（包括20km/40km），均优于-28.5dBm。&lt;/p&gt;&lt;p&gt;当前验证提供的BOSA数量较少，担心BOSA封装工艺问题（之前10G对称有1pcs发端掉光，这次有1pcs SEN偏低），后续还需要与九州沟通反馈。&lt;/p&gt;&lt;p&gt;当前的XGPON ONU模块，有1pcs是好的，收发端指标待补充全温拉偏数据；另1pcs SEN异常的可以补充发端全温拉偏数据。&lt;/p&gt;', '99', '1503654434', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('114', '48', '&lt;p&gt;1. 本周无进度更新，主要是PCB 物料不齐，待试产；&lt;br/&gt;&lt;/p&gt;', '53', '1503654592', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('115', '46', '&lt;ol class=&quot; list-paddingleft-2&quot; style=&quot;list-style-type: decimal;&quot;&gt;&lt;li&gt;&lt;p&gt;本周PCBA物料bom未齐，试产未按时推进；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;本周完成PCBA改板原理图以及PCB Layout 改版制作；待评审之后投出；&lt;/p&gt;&lt;/li&gt;&lt;/ol&gt;', '53', '1503654763', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('116', '35', '&lt;ol class=&quot; list-paddingleft-2&quot; style=&quot;list-style-type: decimal;&quot;&gt;&lt;li&gt;&lt;p&gt;本周与永贵详细的进行的DAC cable 制作的工艺改进方法；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;Atop 这边主要是缩短10/15M cable的尾部，使塑封胶不会与PCB 排斥，导致可靠性不良的问题；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;永贵那边，我司提出的需要将同轴线上的焊盘和焊接好的同轴线一起塑封起来，参考金信诺的设计方案，但是永贵那边未给出明确的回复，涉及到商务问题。&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;本周 10m/15m cable PCB dxf图纸已经发给永贵秦工，待秦工评审；&lt;/p&gt;&lt;/li&gt;&lt;/ol&gt;', '53', '1503655178', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('117', '34', '&lt;ol class=&quot; list-paddingleft-2&quot; style=&quot;list-style-type: decimal;&quot;&gt;&lt;li&gt;&lt;p&gt;AOC 试产由于结构件的原因，备料的原因迟迟未能试产；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;终于在下周，预计8月29日开始试产；&lt;br/&gt;&lt;/p&gt;&lt;/li&gt;&lt;/ol&gt;', '53', '1503655260', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('118', '34', '&lt;p&gt;&lt;a&gt;&lt;span style=&quot;;color:black;background:white&quot;&gt;本次试产,下单&lt;/span&gt;&lt;/a&gt;&lt;span style=&quot;font-family:&amp;#39;Times&amp;#39;,&amp;#39;serif&amp;#39;;color:black;background:white&quot;&gt;250&lt;/span&gt;&lt;span style=&quot;;color:black;background: white&quot;&gt;条,还有&lt;/span&gt;&lt;span style=&quot;font-family:&amp;#39;Times&amp;#39;,&amp;#39;serif&amp;#39;;color:black;background:white&quot;&gt;15&lt;/span&gt;&lt;span style=&quot;;color:black;background: white&quot;&gt;条未装；输入&lt;/span&gt;&lt;span style=&quot;font-family:&amp;#39;Times&amp;#39;,&amp;#39;serif&amp;#39;;color:black;background:white&quot;&gt;235&lt;/span&gt;&lt;span style=&quot;color:black;background: white&quot;&gt;条，测试通过&lt;/span&gt;&lt;span style=&quot;font-family:&amp;#39;Times&amp;#39;,&amp;#39;serif&amp;#39;;color:black;background:white&quot;&gt;218&lt;/span&gt;&lt;span style=&quot;color:black;background:white&quot;&gt;条，直通率为&lt;/span&gt;&lt;span style=&quot;font-family:&amp;#39;Times&amp;#39;,&amp;#39;serif&amp;#39;;color:black;background:white&quot;&gt;92.7%&lt;/span&gt;&lt;span style=&quot;color:black;background:white&quot;&gt;，良率&lt;/span&gt;&lt;span style=&quot;font-family:&amp;#39;Times&amp;#39;,&amp;#39;serif&amp;#39;;color:black;background:white&quot;&gt;99%&lt;/span&gt;&lt;span style=&quot;color:black;background: white&quot;&gt;。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color:black;background: white&quot;&gt;本次试产主要问题是：&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;text-align:justify;text-justify:inter-ideograph;line-height:150%;page-break-after:avoid&quot;&gt;&lt;span style=&quot;;color:black&quot;&gt;1.&lt;/span&gt;&lt;span style=&quot;color:black&quot;&gt; AOC在装配中有出现拉坏不能回弹问题；&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;text-align:justify;text-justify:inter-ideograph;line-height:150%;page-break-after:avoid&quot;&gt;&lt;span style=&quot;color:black&quot;&gt;2. AOC在高温测试时，AOC线容易产生折痕；&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;text-align:justify;text-justify:inter-ideograph;line-height:150%;page-break-after:avoid&quot;&gt;&lt;span style=&quot;color:black&quot;&gt;3. PCBA在进行工装夹具测试时，有部份PCBA有插拔问题。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '100', '1504234403', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('119', '33', '&lt;p&gt;50 套小批量试产备料中，&lt;span style=&quot;;color:#1F497D&quot;&gt;&lt;/span&gt;9/5&lt;span style=&quot;font-family:宋体&quot;&gt;号前可齐套&lt;/span&gt;10&lt;span style=&quot;font-family:宋体&quot;&gt;套，其余&lt;/span&gt;9/17&lt;span style=&quot;font-family:宋体&quot;&gt;号左右&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoListParagraph&quot; style=&quot;margin-left:24px;text-indent:0&quot;&gt;PCB&lt;span style=&quot;font-family:宋体&quot;&gt;：&lt;/span&gt;1.12.LL10-D03，&lt;span style=&quot;font-family:宋体&quot;&gt;交期&lt;/span&gt;9/8&lt;/p&gt;&lt;p class=&quot;MsoListParagraph&quot; style=&quot;margin-left:24px;text-indent:0&quot;&gt;MINI-BOSA&lt;span style=&quot;font-family:宋体&quot;&gt;：&lt;/span&gt;7.03.11171I-5F400，&lt;span style=&quot;font-family:宋体&quot;&gt;交期&lt;/span&gt;9/17&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color:#1F497D&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;span style=&quot;font-family:宋体&quot;&gt;芯片：&lt;/span&gt;1.05.0FH70-4016，9/4*30pcs, 9/15*100pcs&lt;/p&gt;&lt;p style=&quot;margin-left:24px&quot;&gt;&lt;span style=&quot;font-family:宋体&quot;&gt;新改版的柔板待评估后修正原工装图纸&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;br/&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '100', '1504249723', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('120', '49', '&lt;p&gt;模块正在进行FVT测试，本周四收到了昱升光器件的柔板，接来下验证昱升光器件的性能，及调试模块眼图。&lt;/p&gt;', '60', '1504253292', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('121', '31', '&lt;p&gt;正在进行FVT测试，接下来准备开始EVT测试及试生产调测试准备。&lt;/p&gt;', '60', '1504253355', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('122', '30', '&lt;p&gt;本周已发出新版PCBA给永贵加工，加工完成后再次用AB胶验证可靠性。&lt;/p&gt;', '60', '1504253703', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('123', '27', '&lt;p&gt;XGPON ONU验证情况&lt;br/&gt;&lt;/p&gt;&lt;p&gt;a、1pcs对发端在全温进行了EVT测试（因为收端SEN低，故没有对收端进行测试）：发端指标良好(-40℃~85℃)，在-40℃下对该只模块进行了12小时20KM传纤测试，长时间之后有误码（本次使用了安立BERT+衰减器的环境）；今天更换环境后又测试了3小时，没有出现误码；改变环境后还需要做12小时验证，在下周一进行。测试完之后器件返回给九州做检查。&lt;/p&gt;&lt;p&gt;b、1pcs对收发端均进行了EVT测试：收端指标良好；发端有双模，特别是在-40℃时双模严重，SMSR太低，不满足指标；该只器件需返回给九州做检查。&lt;/p&gt;', '99', '1504259579', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('124', '34', '&lt;p&gt;针对不回弹的解锁件，挑选了5件比较严重的寄给供应商，请他们分析原因。&lt;/p&gt;&lt;p&gt;反馈结果是解锁组合键滑动槽变形导致，已把自行处理的结构件发到绵阳了。&lt;/p&gt;&lt;p&gt;下周一安排验证，若没有问题，供应商就按此问题修模，保证没有变形&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '100', '1504840936', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('125', '31', '&lt;p&gt;FVT测试已完成，EVT测试正在进行中。新做柔板本周五已到，下周开始验证柔板性能及MACOM TO的性能。&lt;/p&gt;', '60', '1504861026', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('126', '27', '&lt;p&gt;1. 对XGPON ONU进行了传纤验证测试：-20C及以上20KM长时间传纤没有误码，在-40C时长时间传纤有误码出现；当前怀疑TO或板上芯片在低温时可能出现问题，下一步将BOSA换到GN25L96方案的板子上再进行验证，正在更换板子调整参数并调试发端，然后进行低温传纤验证；&lt;/p&gt;&lt;p&gt;2. 对之前未做的时序进行了补测，同时优化了XGPON ONU的浪涌参数。&lt;br/&gt;&lt;/p&gt;', '99', '1504862703', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('127', '31', '&lt;p&gt;附FVT报告如下：&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_txt.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170908/1504865113123918.xlsx&quot; title=&quot;FIRM_0710_V06_FVT报告.xlsx&quot;&gt;FIRM_0710_V06_FVT报告.xlsx&lt;/a&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '100', '1504865119', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('128', '27', '&lt;p&gt;1、XGPON ONU更换到GN25L96方案的板子上做交叉验证，传纤测试温度在-40℃时，加/不加20KM光纤，以及在1.25G速率下，在0.5-2小时内均会出现误码，温度上升到-20℃以上不会误码，与在XGPON板子上的现象一致，初步判断是光器件问题。现在已将问题反馈给TO原厂帮忙分析。&lt;/p&gt;&lt;p&gt;2、双模的那只BOSA上周五已直接寄给TO原厂帮忙分析。&lt;/p&gt;', '99', '1505443257', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('129', '50', '&lt;p&gt;OLT布板已初步完成，已经完成第一次评审，布板做了更新，现正准备进一步检查，包括封装、走线等。&lt;/p&gt;', '99', '1505443792', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('130', '28', '&lt;p&gt;改版后的PCBA结合新的Truelight光器件，已经调整好收发端硬件参数，优化了眼图。&lt;/p&gt;&lt;p&gt;现在光器件性能已经验证（只有1pcs良品BOSA），I-Temp全温（模块Case温度）性能指标满足要求；这一只的EVT已经完成，后续待九州新BOSA提供后将EVT补齐。&lt;/p&gt;', '99', '1505444467', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('131', '54', '&lt;p&gt;2017/9/15&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_txt.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170915/1505456427210425.xlsx&quot; title=&quot;24016 eye  tunning.xlsx&quot;&gt;24016 eye &amp;nbsp;tunning.xlsx&lt;/a&gt;&lt;/p&gt;&lt;p&gt;1.FW已完成&lt;/p&gt;&lt;p&gt;2.TXPDADC采样跳动，更换C50到0.01UF后OK&lt;/p&gt;&lt;p&gt;3.眼图调试，眼图过欠 ，冲不起来，调了几组值不理想，详细见附件，计划更换一些46 ohm,和48Ohm的柔板，物料在绵阳仓库&lt;/p&gt;&lt;p&gt;4.FVT下周一开始&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '100', '1505456434', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('132', '31', '&lt;p&gt;自制的25G FPC评估报告如附件，DSN与快捷两家制作的柔板用的是相同的加工文件，要求的板材也是一致的，但是这次做完的FPC在实际TOSA上的效果是，DSN的比快捷的要好，但是眼图抖动还是比AOI制作的FPC抖动要大一些。&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_txt.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170919/1505801497192438.xlsx&quot; title=&quot;25G LR模块柔板对发端眼图的影响对比.xlsx&quot;&gt;25G LR模块柔板对发端眼图的影响对比.xlsx&lt;/a&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '60', '1505801507', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('134', '48', '&lt;p&gt;已完成试产，试产数量30pcs，良率为100%&lt;/p&gt;&lt;p&gt;有以下问题：1&amp;gt;DWDM模块等波长稳定长，要15S以上；&lt;/p&gt;&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 2&amp;gt;自动软件，自动进行波长补偿还有问题，有些模块无法进行补偿。&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '100', '1506065502', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('135', '54', '&lt;ol class=&quot; list-paddingleft-2&quot; style=&quot;list-style-type: decimal;&quot;&gt;&lt;li&gt;&lt;p&gt;眼图调试情况：最好常温可以到16%左右，眼线比较粗&lt;br/&gt;&lt;/p&gt;&lt;p&gt;a.目前最好的情况 1级磁珠EG221+2级10UF，10ohm电阻+48ohm柔板，,24016的0X02配置为F2，0X07配置为F7，&lt;/p&gt;&lt;p&gt;因为中间尝试过不同组合，最好的MASK在16%左右，眼形和抖动和下图类似&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;/ueditor/php/upload/image/20170922/1506069892242139.png&quot; title=&quot;1506069892242139.png&quot; alt=&quot;image.png&quot; width=&quot;328&quot; height=&quot;234&quot;/&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;b.对比过CSFP+的TOSA，抖动和MASK都比华星的好，CSFP+TOSA眼图&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;img src=&quot;/ueditor/php/upload/image/20170922/1506069782902849.png&quot; title=&quot;1506069782902849.png&quot; alt=&quot;image.png&quot; width=&quot;331&quot; height=&quot;246&quot;/&gt;&lt;/p&gt;&lt;p&gt;c.感觉48ohm柔板下眼图还是欠chong&lt;/p&gt;&lt;p&gt;d.总结：目前看起来抖动和mask都还需要再做调试，&lt;/p&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;44ohm柔板没库存，已联系采购看能否紧急送样测试。&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;FVT松文已测试完毕&lt;/p&gt;&lt;p&gt;a 光浪涌 无&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;/ueditor/php/upload/image/20170922/1506070334908271.png&quot; title=&quot;1506070334908271.png&quot; alt=&quot;image.png&quot; width=&quot;458&quot; height=&quot;244&quot;/&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;b.电浪涌 最大270mA,模块正常工作140mA，协议是要求300mA以下&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;/ueditor/php/upload/image/20170922/1506070375119262.png&quot; title=&quot;1506070375119262.png&quot; alt=&quot;image.png&quot; width=&quot;456&quot; height=&quot;330&quot;/&gt;&lt;br/&gt;&lt;/p&gt;&lt;/li&gt;&lt;/ol&gt;', '100', '1506070657', '54,52', null);
INSERT INTO `atop_project_discuss` VALUES ('136', '50', '&lt;p&gt;芯片等新物料申购已经到料（除了限放芯片，反馈本月底到），PCB已经发出制板，反馈本月底回板。&lt;/p&gt;', '99', '1506072109', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('137', '27', '&lt;p&gt;BOSA问题已与TO原厂进行了沟通，反馈下周三给出分析结果。&lt;/p&gt;', '99', '1506072213', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('138', '28', '&lt;p&gt;对10G-EPON非对称ONU模块进行了长时间传纤测试，加20KM光纤条件下全温均正常，无误码。&lt;/p&gt;', '99', '1506072317', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('140', '31', '&lt;p&gt;LUXNET TOSA&amp;amp;ROSA已完成初步的三温测试，结论如下：&lt;/p&gt;&lt;p&gt;1、该方案的样品TOSA可以满足模块Case温度在0~70℃的工作要求，但是无法满足工业级的温度需求；眼图比AOI TO封装的TOSA+AOI柔板的抖动略大。&lt;/p&gt;&lt;p&gt;2、该方案的样品ROSA性能可以满足模块在商业级温度下的指标要求，但ROSA结构与我们现有的结构件直接存在装配问题，故以上收端SEN测试均为裸PCBA条件下测得；TOSA的结构可以和我司SFP+ LR结构相匹配，装配无问题。&lt;/p&gt;&lt;p&gt;3、该方案的ROSA性能指标会比3U的ROSA指标差一些，但是仍基本可以满足模块要求&lt;/p&gt;', '100', '1506503705', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('141', '57', '&lt;p&gt;&lt;span style=&quot;font-size:14px;font-family:&amp;#39;微软雅黑&amp;#39;,&amp;#39;sans-serif&amp;#39;;color:black&quot;&gt;9&lt;/span&gt;&lt;span style=&quot;font-size:14px;font-family:&amp;#39;微软雅黑&amp;#39;,&amp;#39;sans-serif&amp;#39;;color:black&quot;&gt;月21日DD进度更新：&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size:14px;font-family:&amp;#39;微软雅黑&amp;#39;,&amp;#39;sans-serif&amp;#39;;color:black&quot;&gt;1. QDD PCB &lt;/span&gt;&lt;span style=&quot;font-size:14px;font-family:&amp;#39;微软雅黑&amp;#39;,&amp;#39;sans-serif&amp;#39;;color:black&quot;&gt;板长偏长，陈工模拟PCB板长还需要再缩小4mm，才能满足协议尺寸要求；&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size:14px;font-family:&amp;#39;微软雅黑&amp;#39;,&amp;#39;sans-serif&amp;#39;;color:black&quot;&gt;&amp;nbsp; &amp;nbsp; Layout &lt;/span&gt;&lt;span style=&quot;font-size:14px;font-family:&amp;#39;微软雅黑&amp;#39;,&amp;#39;sans-serif&amp;#39;;color:black&quot;&gt;要&lt;span style=&quot;background:white&quot;&gt;大改；一开始是按照板长36mm 设计（考虑超协议制作），后面经实际layout布局完成，可以满足再缩短4mm 空间位置，满足协议；&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size:14px;font-family:&amp;#39;微软雅黑&amp;#39;,&amp;#39;sans-serif&amp;#39;;color:black;background:white&quot;&gt;2. Rx submont &lt;/span&gt;&lt;span style=&quot;font-size:14px;font-family:&amp;#39;微软雅黑&amp;#39;,&amp;#39;sans-serif&amp;#39;;color:black;background:white&quot;&gt;由于之前PD chip 间距按照2.0mm设计，但是由于Mux/Demux 没有2.0mm间距的，所以更改PD chip 间距为1.9mm；Rx submont 需要重新layout；（未开始）&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size:14px;font-family:&amp;#39;微软雅黑&amp;#39;,&amp;#39;sans-serif&amp;#39;;color:black;background:white&quot;&gt;3.&lt;/span&gt;&lt;span style=&quot;font-size:14px;font-family:&amp;#39;微软雅黑&amp;#39;,&amp;#39;sans-serif&amp;#39;;color:black;background:white&quot;&gt;今天陈工与郑博商讨之后会给出另外一个100G的 Tx Rx FPC 柔板外形图纸还需要重新出图；也需要重新layout；（未开始）&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size:14px;font-family:&amp;#39;微软雅黑&amp;#39;,&amp;#39;sans-serif&amp;#39;;color:black;background:white&quot;&gt;4. &lt;/span&gt;&lt;span style=&quot;font-size:14px;font-family:&amp;#39;微软雅黑&amp;#39;,&amp;#39;sans-serif&amp;#39;;color:black;background:white&quot;&gt;另外一个100G的 Rx submont 需要重新设计；（未开始）&lt;/span&gt;&lt;span style=&quot;font-size:14px;font-family:&amp;#39;微软雅黑&amp;#39;,&amp;#39;sans-serif&amp;#39;;color:black&quot;&gt;一共需要绘制的PCB 数量是 4Pcs FPC 柔板，2PCS Rx submont 硬制板，1Pcs DD 主板；&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '100', '1506504069', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('142', '27', '&lt;p&gt;Truelight原厂反馈：&lt;/p&gt;&lt;p&gt;验证的这款2.5G DFB TO（TME-2B83-507）他们是以C-temp规格出的，某些性能在I-Temp下可能得不到保障，他们的样品出货前也没有在-40℃下做较为全面的测试。&lt;/p&gt;&lt;p&gt;鉴于此，我们需要找别的厂家寻样进行新的验证，看能否满足I-Temp的规格。&lt;/p&gt;', '99', '1506611185', '54,42,83,55', null);
INSERT INTO `atop_project_discuss` VALUES ('143', '48', '&lt;ol class=&quot; list-paddingleft-2&quot; style=&quot;list-style-type: decimal;&quot;&gt;&lt;li&gt;&lt;p&gt;大连藏龙APD I-temp 验证评估通过，性能上可以用于替代目前Gn3357；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;价格上藏龙APD 较 Gennum APD 低一半的价格，在成本上可以降低200元左右的价格；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_txt.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170929/1506655718741910.xlsx&quot; title=&quot;藏龙APD验证.xlsx&quot;&gt;藏龙APD验证.xlsx&lt;/a&gt;&lt;/p&gt;&lt;/li&gt;&lt;/ol&gt;', '53', '1506655726', '54,83', null);
INSERT INTO `atop_project_discuss` VALUES ('144', '55', '&lt;p&gt;仕佳方案的CWDM4 PCB已贴好，固件正在开发中，完成后开始模块验证。现在手上有1对仕佳光子的光器件。&lt;/p&gt;', '60', '1506750152', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('145', '49', '&lt;p&gt;SR模块进行了眼图优化调整，优化的幅度不大，Margin很小，但是传输没问题，现在缺少PCB板，已安排用M37028B版本芯片贴片10PCS再验证。SFP28 AOC的制作可以开始准备，由于SR4与AOC的结构件不同，需要重新画PCB。&lt;/p&gt;&lt;p&gt;待结构件的PSD图完成后开始LAYOUT AOC的PCB,M37028B的PCBA节后安排发出贴片，新申请了三优的光器件，待PCBA贴好后开始验证。SFP28 SR模块的MAXIM方案开始原理图设计中。&lt;/p&gt;', '60', '1506750226', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('146', '31', '&lt;p&gt;EVT报告已完成待评审。该模块的PCBA由于贴片问题，主芯片管脚存在短路情况，已返给贴片厂进行了返修。25G示波器采购暂时没有回复。美信方案的SFP28 LR模块PCBlayout已完成，节后发出评审以及让MAXIM帮忙review。LUXNET的光器件初步评估完成，TOSA可以基本满足模块要求，ROSA的结构及柔板长度需要LUXNET调整后才可与我司结构件兼容。&lt;/p&gt;', '60', '1506750328', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('147', '31', '&lt;p&gt;附上LUXNET LR光器件的测试评估报告，如附件！&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_txt.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20170930/1506750440111349.xlsx&quot; title=&quot;LUXNET SFP28 LR TOSA&amp;amp;ROSA测试报告.xlsx&quot;&gt;LUXNET SFP28 LR TOSA&amp;amp;ROSA测试报告.xlsx&lt;/a&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '60', '1506750445', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('148', '33', '&lt;p&gt;焊接工装10.9号已完成验证可以正常使用，预计10.12号开始预试产验证&lt;/p&gt;', '52', '1507713307', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('149', '54', '&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_rar.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20171013/1507884396989386.rar&quot; title=&quot;SFP+24016_V02.rar&quot;&gt;SFP+24016_V02.rar&lt;/a&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_txt.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20171013/1507884398687819.xlsx&quot; title=&quot;EVT-00xxx-00 SFP+ MAX24016.xlsx&quot;&gt;EVT-00xxx-00 SFP+ MAX24016.xlsx&lt;/a&gt;&lt;/p&gt;&lt;ol class=&quot; list-paddingleft-2&quot; style=&quot;list-style-type: decimal;&quot;&gt;&lt;li&gt;&lt;p&gt;收发端眼图初步验证完成&lt;br/&gt;&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;确认改版方案&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;/li&gt;&lt;/ol&gt;&lt;p&gt;&lt;span style=&quot;font-family: &amp;#39;Courier New&amp;#39;, sans-serif; line-height: 1.5; background-color: window;&quot;&gt;&lt;span style=&quot;color:#ff0000&quot;&gt;&amp;nbsp; &amp;nbsp; 1）.Add R24 10k/0201 up to VCC_MCU---速率选择PIN增加上啦&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color:#ff0000&quot;&gt;&lt;span style=&quot;font-size:-1px;font-family:Courier New,sans-serif&quot;&gt;&amp;nbsp; &amp;nbsp; 2）.Add L20.R22,R23,L21&lt;/span&gt;&lt;span class=&quot;Apple-converted-space&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size:-1px;font-family:Courier New,sans-serif&quot;&gt;All footpoint is 0402----------TX 发端串联一个5.1ohm电阻再并联一个磁珠EG221&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;background-color: window; font-family: &amp;#39;Courier New&amp;#39;, sans-serif; font-size: small; line-height: 1.5;&quot;&gt;&lt;span style=&quot;color:#ff0000&quot;&gt;&amp;nbsp; &amp;nbsp; 3）.add R25/R26 0201/0 OHM----RX输出串联一个电阻，用来调整输出幅度&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;', '100', '1507884535', '54,52,81', null);
INSERT INTO `atop_project_discuss` VALUES ('150', '27', '尽快完成骏通的评估，另外GN28L96方案需要尽快开始，设计需要兼容GN28L95考虑。', '54', '1507886451', null, '142');
INSERT INTO `atop_project_discuss` VALUES ('151', '48', '&lt;p&gt;本次PMR 试产总结如下：&lt;/p&gt;&lt;p&gt;1. 后续PMR报告增加灵敏度和los等规格书有相关要求的真实值测试，统计真实数据；&lt;/p&gt;&lt;p&gt;2. PMR报告后续需要将温度在图表中标识清楚；&lt;/p&gt;&lt;p&gt;3. 本次试产30pcs，发货只发了6pcs；其余的请将CDR打开，抽选11Pcs进行DVT测试；&lt;/p&gt;&lt;p&gt;4. 有单的时候再做一次50pcs的试产，鉴于柔板改善的问题，使用藏龙的APD进行I-temp 试产，&lt;/p&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; 收集数据和良率；&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '100', '1508320373', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('152', '27', '&lt;p&gt;当前正在准备样品，同时将EVT完成，预计本月底能完成。&lt;/p&gt;', '99', '1508490361', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('153', '28', '&lt;p&gt;当前正在准备样品，同时将EVT完成，预计本月底能完成。&lt;/p&gt;', '99', '1508490395', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('154', '50', '&lt;p&gt;PCB已回板，已经安排贴片，下周能拿到PCBA，然后软件部门开发FW并验证。&lt;/p&gt;', '99', '1508490520', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('155', '48', '&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 10月16日至10月19日，针对ADTRAN9.95G~11.3G参数调整验证性通道代价测试。&lt;/p&gt;&lt;ol class=&quot; list-paddingleft-2&quot; style=&quot;list-style-type: decimal;&quot;&gt;&lt;li&gt;&lt;p&gt;测试条件包括了 W/O 80KM&amp;nbsp;fiber。&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;测试码型选择2^31-1。&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;测试速率9.95G~11.3G。&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;测试温度25℃和85℃两种环境温度。&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;测试时使用3.3v的电源。&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;测试时使用的是Anritsu MP2101A BERT板。&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;Sensitivity(dBm) BER=10E-12。&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;span style=&quot;line-height: 0px; display: none;&quot;&gt;&amp;nbsp; ‍&lt;/span&gt;经过参数的微调后，具体的测试结果见附件，&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_txt.gif&quot;/&gt;&lt;a title=&quot;ADTRAN-TEST.xlsx&quot; style=&quot;color: rgb(0, 102, 204); font-size: 12px;&quot; href=&quot;/ueditor/php/upload/file/20171026/1508982469470337.xlsx&quot;&gt;ADTRAN-TEST.xlsx&lt;/a&gt;。&lt;/p&gt;&lt;/li&gt;&lt;/ol&gt;', '105', '1508982683', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('156', '33', '&lt;ol class=&quot; list-paddingleft-2&quot; style=&quot;list-style-type: decimal;&quot;&gt;&lt;li&gt;&lt;p&gt;试产已完成，做了13pcs有1pcs高低温组件掉光，初步验证模块性能、ATE、生产流程无异常，组件及柔板焊接工装需继续改进。&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;新改的CSFP测试子板已完成验证，确认模块性能良好，之前测试板存在异常导致测试结果较差。&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p style=&quot;line-height: 16px;&quot;&gt;&lt;img src=&quot;http://61.139.89.33:8088/Public/UEditor/dialogs/attachment/fileTypeImages/icon_txt.gif&quot;/&gt;&lt;a style=&quot;font-size:12px; color:#0066cc;&quot; href=&quot;/ueditor/php/upload/file/20171027/1509069333830728.xlsx&quot; title=&quot;csfp+&amp;nbsp;对比测试.xlsx&quot;&gt;csfp+&amp;nbsp;对比测试.xlsx&lt;/a&gt;&lt;/p&gt;&lt;/li&gt;&lt;/ol&gt;', '52', '1509069362', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('160', '46', '&lt;ol class=&quot; list-paddingleft-2&quot; style=&quot;list-style-type: decimal;&quot;&gt;&lt;li&gt;&lt;p&gt;10月23日，新改的增加全功能版本的XFP_ZR （带扩展I/O）版本的PCBA 贴片完成；&lt;br/&gt;&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;10月23日 ～ 10月27日做手工样品，评估其功能完整性以及firmware 需求表以及firmware更改修正；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;10月30日 ～ 10月31日测试发现，使用10G FPGA Bert 点击start的时候，就是初始化Bert的时候，会导致模块TX CDR loss of lock；安利Bert 不会出现此种情况；经详细检查评估，为TXLOS_TH_NEG 配置不对，经修正已经ok；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;11月1日起开始制作详细的样品测试验证评估报告；&lt;br/&gt;&lt;/p&gt;&lt;/li&gt;&lt;/ol&gt;', '53', '1509443822', '54,105,68', null);
INSERT INTO `atop_project_discuss` VALUES ('158', '57', '&lt;p&gt;&lt;span style=&quot;box-sizing: border-box; margin: 0px; padding: 0px; line-height: 25.2px; background-color: rgb(249, 250, 252); font-family: 微软雅黑, sans-serif;&quot;&gt;9&lt;/span&gt;&lt;span style=&quot;box-sizing: border-box; margin: 0px; padding: 0px; line-height: 25.2px; background-color: rgb(249, 250, 252); font-family: 微软雅黑, sans-serif;&quot;&gt;月27日DD进度更新：&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;box-sizing: border-box; margin: 0px; padding: 0px; line-height: 25.2px; background-color: rgb(249, 250, 252); font-family: 微软雅黑, sans-serif;&quot;&gt;1. 本周Rx_submont 按照AE推荐增加去耦电容，并更改原理图设计和PCB设计；完成EQ确认；待采购回复交期；&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;box-sizing: border-box; margin: 0px; padding: 0px; line-height: 25.2px; background-color: rgb(249, 250, 252); font-family: 微软雅黑, sans-serif;&quot;&gt;2. Tx FPC_D 和 Rx FPC_D 按照EQ工艺更改推荐，更改原路图设计和PCB设计；完成EQ确认；&lt;span style=&quot;font-family: 微软雅黑, sans-serif; background-color: rgb(249, 250, 252);&quot;&gt;待采购回复交期；&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;box-sizing: border-box; margin: 0px; padding: 0px; line-height: 25.2px; background-color: rgb(249, 250, 252); font-family: 微软雅黑, sans-serif;&quot;&gt;3. DD 主板按照EQ工艺更改推荐，更改原理图设计和PCB设计，完成EQ确认；&lt;span style=&quot;font-family: 微软雅黑, sans-serif; background-color: rgb(249, 250, 252);&quot;&gt;待采购回复交期；&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;box-sizing: border-box; margin: 0px; padding: 0px; line-height: 25.2px; background-color: rgb(249, 250, 252); font-family: 微软雅黑, sans-serif;&quot;&gt;4. DD 座子还没找到，EVB设计还未开始；&lt;/span&gt;&lt;/p&gt;', '53', '1509099414', '54', null);
INSERT INTO `atop_project_discuss` VALUES ('159', '56', '&lt;p&gt;仕佳光子器件调试：目前正在进行常温下的QSFP28 CWDM4模块调试，发端TX存在CH1通道无眼图，CH2~CH4通道有眼图，但还需要调试寄存器看能否进一步优化眼图，同时用其它测试板复测排除一下是否由于测试环境造成的该问题。&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;http://61.139.89.33:8088/ueditor/php/upload/image/20171027/1509098365212663.gif&quot; title=&quot;1509098365212663.gif&quot;/&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;http://61.139.89.33:8088/ueditor/php/upload/image/20171027/1509098370103594.gif&quot; title=&quot;1509098370103594.gif&quot;/&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;http://61.139.89.33:8088/ueditor/php/upload/image/20171027/1509098370115970.gif&quot; title=&quot;1509098370115970.gif&quot;/&gt;&lt;/p&gt;&lt;p&gt;仕佳光子接收端光调试：现在存在的问题有，D+与D-的电口眼图明细差别很大，D+的电口眼图都很差，D-的电口眼图就会好很多，具体是由于测试板造成的，还是模块芯片寄存器配置造成的还需要进一步确认。&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;http://61.139.89.33:8088/ueditor/php/upload/image/20171027/1509098846120609.gif&quot; title=&quot;1509098846120609.gif&quot;/&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;http://61.139.89.33:8088/ueditor/php/upload/image/20171027/1509098846512895.gif&quot; title=&quot;1509098846512895.gif&quot;/&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;http://61.139.89.33:8088/ueditor/php/upload/image/20171027/1509098847206165.gif&quot; title=&quot;1509098847206165.gif&quot;/&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;http://61.139.89.33:8088/ueditor/php/upload/image/20171027/1509098847246227.gif&quot; title=&quot;1509098847246227.gif&quot;/&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;http://61.139.89.33:8088/ueditor/php/upload/image/20171027/1509098847585447.gif&quot; title=&quot;1509098847585447.gif&quot;/&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;http://61.139.89.33:8088/ueditor/php/upload/image/20171027/1509098847986503.gif&quot; title=&quot;1509098847986503.gif&quot;/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;仕佳光子方案的固件现在也还需要进一步的完善，但是由于IOS和大连藏龙方案的PCBA已经收到，优先级更高，现在需要先开发IOS和大连藏龙的方案的固件，故暂缓仕佳光子方案的固件开发。&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '100', '1509413798', '54', null);
