INSERT INTO `atop_software_log` VALUES ('6', '2', '评估板手动控制软件，支持读取评估板状态、模块内部调试、EEPROM检查和查找表拟合，以及固件下载功能。', null, '1497245145', 'V1.0', '30', null, null);
INSERT INTO `atop_software_log` VALUES ('7', '3', '1，[模块调试_SFP] MCU方案产品写入LUT、收端校准系数后不再切回原表，避免SFP+ AOC / CSFP+产品RAM丢失的情况。<br />2，[固件下载] C8051Fxxx通过bootloader升级时，写入一个page后的延时优化，避免部分电脑无法升级的情况。', '[{\"ext\":\"zip\",\"savename\":\"EVB Manual_V1.4.7.2.zip\",\"path\":\"./Uploads/Software/3/EVB Manual_V1.4.7.2.zip\"}]', '1497430835', 'V1.4.7.2', '30', '[{\"name\":\"杨培云 \",\"id\":\"52\",\"email\":\"yangpeiyun@atoptechnology.com\"},{\"name\":\"肖艾佑 \",\"id\":\"53\",\"email\":\"xiaoaiyou@atoptechnology.com\"},{\"name\":\"马晓东 \",\"id\":\"59\",\"email\":\"maxiaodong@atoptechnology.com\"},{\"name\":\"何松文 \",\"id\":\"74\",\"email\":\"hesongwen@atoptechnology.com\"},{\"name\":\"罗洋 \",\"id\":\"81\",\"email\":\"luoyang@atoptechnology.com\"},{\"name\":\"刘孙国 \",\"id\":\"82\",\"email\":\"liusunguo@atoptechnology.com\"},{\"name\":\"陈凯 \",\"id\":\"67\",\"email\":\"chenkai@atoptechnology.com\"},{\"name\":\"何志贤 \",\"id\":\"68\",\"email\":\"hezhixian@atoptechnology.com\"},{\"name\":\"黄正银 \",\"id\":\"99\",\"email\":\"huangzhengyin@atoptechnology.com\"},{\"name\":\"陈朋 \",\"id\":\"87\",\"email\":\"chenpeng@atoptechnology.com\"},{\"name\":\"陈实 \",\"id\":\"60\",\"email\":\"chenshi@atoptechnology.com\"}]', '[{\"name\":\"丁征 \",\"id\":\"54\",\"email\":\"dingzheng@atoptechnology.com\"}]');
INSERT INTO `atop_software_log` VALUES ('8', '4', '1，新增对DS4834 MCU的firmware下载支持，需要在ChipSolution表配置MCU类型为DS4834。<br />2，新增对CSFP+模块的调测试支持，由于DS4834的RAM限制，切表会导致RAM丢失，所以ED_INIT和RxMonTune需要配置\"SaveFlash:1\"。<br />3，新增对MCU产品的MOD查找表拟合方式\"LINE3\"，即三段线性拟合且支持拐点可配，完整配置示例如：\"LUT:LINE3,Slope1:0.8,Slope2:0.5,Slope3:1.2,TL:-10,TA:20,TB:55,TH:95,\"<br />4，生产帐号无法操作RD模式产品。', '[{\"ext\":\"rar\",\"savename\":\"ATOM_V4.7.1.0.rar\",\"path\":\"./Uploads/Software/4/ATOM_V4.7.1.0.rar\"}]', '1497431340', 'V4.7.1.0', '30', '[{\"name\":\"杨培云 \",\"id\":\"52\",\"email\":\"yangpeiyun@atoptechnology.com\"},{\"name\":\"罗洋 \",\"id\":\"81\",\"email\":\"luoyang@atoptechnology.com\"},{\"name\":\"何志贤 \",\"id\":\"68\",\"email\":\"hezhixian@atoptechnology.com\"},{\"name\":\"陈凯 \",\"id\":\"67\",\"email\":\"chenkai@atoptechnology.com\"}]', '[{\"name\":\"肖艾佑 \",\"id\":\"53\",\"email\":\"xiaoaiyou@atoptechnology.com\"},{\"name\":\"丁征 \",\"id\":\"54\",\"email\":\"dingzheng@atoptechnology.com\"},{\"name\":\"夏小森 \",\"id\":\"56\",\"email\":\"xiaxiaosen@atoptechnology.com\"},{\"name\":\"余波 \",\"id\":\"57\",\"email\":\"yubo@atoptechnology.com\"},{\"name\":\"李平 \",\"id\":\"30\",\"email\":\"liping@atoptechnology.com\"}]');
INSERT INTO `atop_software_log` VALUES ('9', '4', '1，[品质发端/收端测试] 取消CSFP 2通道需要标摸验证的设置，截至目前为止，所有品质测试不需要标摸验证工位。<br />2，[发端常温调试] 修复软件无法识别XFP SR的老版本查找表拟合方式“LUTMODE”。<br />3，[信息导入] 电口模块不获取寄存器配置，也不检查模块寄存器配置。<br />4，由于数据库分离推进情况不理想，暂时不限制生产帐号操作RD模式产品。', '[{\"ext\":\"rar\",\"savename\":\"ATOM_V4.7.1.1.rar\",\"path\":\"./Uploads/Software/4/ATOM_V4.7.1.1.rar\"}]', '1498620365', 'V4.7.1.1', '30', '[{\"name\":\"陈凯 \",\"id\":\"67\",\"email\":\"chenkai@atoptechnology.com\"},{\"name\":\"何志贤 \",\"id\":\"68\",\"email\":\"hezhixian@atoptechnology.com\"}]', '[{\"name\":\"李平 \",\"id\":\"30\",\"email\":\"liping@atoptechnology.com\"},{\"name\":\"杨培云 \",\"id\":\"52\",\"email\":\"yangpeiyun@atoptechnology.com\"},{\"name\":\"肖艾佑 \",\"id\":\"53\",\"email\":\"xiaoaiyou@atoptechnology.com\"},{\"name\":\"丁征 \",\"id\":\"54\",\"email\":\"dingzheng@atoptechnology.com\"},{\"name\":\"夏小森 \",\"id\":\"56\",\"email\":\"xiaxiaosen@atoptechnology.com\"},{\"name\":\"余波 \",\"id\":\"57\",\"email\":\"yubo@atoptechnology.com\"}]');
