INSERT INTO `atop_software_log` VALUES ('29', '24', '1.该版本解决了一个BUG :校准发端光功率时，收端功率与发端功率监控值一样。原因是在收端校准函数中定义了一个局部变量，这个局部变量莫名其妙的会跟发端监控函数中的局部变量一致，猜测可能是编译器优化为同一变量，或者栈区数据过多。<br />解决办法：把收端校准函数的局部变量定义为静态局部变量，放在静态存储区。', '[{\"ext\":\"zip\",\"savename\":\"FIRM_0660_V04.zip\",\"path\":\"./Uploads/Software/24/FIRM_0660_V04.zip\"}]', '1498634666', 'V0.4', '74', '', '');
