INSERT INTO `atop_software_log` VALUES ('36', '4', '1，[TecCheck] 增加\"From\"关键字配置，\"REG\"为老方式，从F4寄存器读取ADC，上位机计算；配置为\"DDM\"为新方式，从A0(XFP)或者A2(SFP)读取。<br />2，[ErTune/SensTune] LUT增加\"LINE3\"关键字配置，三段线性拟合，步进需要根据firmware具体情况配置，\"LutStep:2\"或者\"LutStep:3\"，LUT的DAC范围可配，语法为\"LutMin:0000,LutMax:03FF,\"。<br />3，[SaveFlash] 受DS4834 RAM较小导致且表RAM丢失的影响，ED_INIT/SensTune/RxMonTune需要配置\"SaveFlash:1\"。<br />4，[RxMonTune] 修复获取“SaveFlash”配置时软件自动退出的问题。<br />5，[SDH_Test] 新工序，支持自动测试SDH传输性能，需要选择Anritsu MP 1590B。', '[{\"ext\":\"rar\",\"savename\":\"ATOM_V4.7.1.4.rar\",\"path\":\"./Uploads/Software/4/ATOM_V4.7.1.4.rar\"}]', '1500453808', 'V4.7.1.4', '30', '[{\"name\":\"何志贤 \",\"id\":\"68\",\"email\":\"hezhixian@atoptechnology.com\"},{\"name\":\"陈凯 \",\"id\":\"67\",\"email\":\"chenkai@atoptechnology.com\"}]', '[{\"name\":\"李平 \",\"id\":\"30\",\"email\":\"liping@atoptechnology.com\"},{\"name\":\"陈朋 \",\"id\":\"87\",\"email\":\"chenpeng@atoptechnology.com\"},{\"name\":\"杨培云 \",\"id\":\"52\",\"email\":\"yangpeiyun@atoptechnology.com\"},{\"name\":\"肖艾佑 \",\"id\":\"53\",\"email\":\"xiaoaiyou@atoptechnology.com\"},{\"name\":\"丁征 \",\"id\":\"54\",\"email\":\"dingzheng@atoptechnology.com\"},{\"name\":\"夏小森 \",\"id\":\"56\",\"email\":\"xiaxiaosen@atoptechnology.com\"},{\"name\":\"余波 \",\"id\":\"57\",\"email\":\"yubo@atoptechnology.com\"}]');
INSERT INTO `atop_software_log` VALUES ('37', '3', '1，[模块调试_SFP] 增加MCU真实温度值显示。<br />2，[模块调试_SFP] TEC电流和温度直接读DDM值，不再通过上位机计算。<br />3，[模块调试_SFP] 温度校准Slope精度从1位小数改为3位小数。<br />4，[模块调试_查找表] 适应最新版本firmware，支持2度和3度索引；表格视图按点拟合功能由两段改为三段拟合；查找表上下限可在界面更改。<br />5，[模块调试_Cfg Backup] 新页面，支持一键备份和还原MCU产品数据，包括A0/A2/F4，需要备份的table可选。<br />6，[模块调试_SF RSSI]新页面，支持SF APD高温或低温补偿系数修改和读取。<br />7，[E方_QA Check] 如果勾选了检查CDR选项，增加判断插入的模块是否和选择的类型匹配，避免所选类型不一致时误写入密码到A0的问题。', '[{\"ext\":\"zip\",\"savename\":\"EVB Manual_V1.4.7.4.zip\",\"path\":\"./Uploads/Software/3/EVB Manual_V1.4.7.4.zip\"}]', '1500533893', 'V1.4.7.4', '30', '[{\"name\":\"杨培云 \",\"id\":\"52\",\"email\":\"yangpeiyun@atoptechnology.com\"},{\"name\":\"肖艾佑 \",\"id\":\"53\",\"email\":\"xiaoaiyou@atoptechnology.com\"},{\"name\":\"马晓东 \",\"id\":\"59\",\"email\":\"maxiaodong@atoptechnology.com\"},{\"name\":\"何松文 \",\"id\":\"74\",\"email\":\"hesongwen@atoptechnology.com\"},{\"name\":\"罗洋 \",\"id\":\"81\",\"email\":\"luoyang@atoptechnology.com\"},{\"name\":\"刘孙国 \",\"id\":\"82\",\"email\":\"liusunguo@atoptechnology.com\"},{\"name\":\"陈凯 \",\"id\":\"67\",\"email\":\"chenkai@atoptechnology.com\"},{\"name\":\"何志贤 \",\"id\":\"68\",\"email\":\"hezhixian@atoptechnology.com\"},{\"name\":\"黄正银 \",\"id\":\"99\",\"email\":\"huangzhengyin@atoptechnology.com\"},{\"name\":\"陈朋 \",\"id\":\"87\",\"email\":\"chenpeng@atoptechnology.com\"},{\"name\":\"陈实 \",\"id\":\"60\",\"email\":\"chenshi@atoptechnology.com\"},{\"name\":\"刘燕 \",\"id\":\"70\",\"email\":\"liuyan@atoptechnology.com\"}]', '[{\"name\":\"丁征 \",\"id\":\"54\",\"email\":\"dingzheng@atoptechnology.com\"},{\"name\":\"夏小森 \",\"id\":\"56\",\"email\":\"xiaxiaosen@atoptechnology.com\"},{\"name\":\"余波 \",\"id\":\"57\",\"email\":\"yubo@atoptechnology.com\"}]');
INSERT INTO `atop_software_log` VALUES ('38', '19', '==============================<br />170407: V04<br />1、因为是否加调制对光功率影响较大，需要固件判断txlol状态，通过修改EA，保持光功率不变<br /><br />==============================<br />170407: V03<br />1、因为BIAS ADC ,TXPOWER ADC 已经超过量程，需要做假值，bias假值为AOP设置值为基础，上报值跳动<br /> TXPOWER 假值为固定ADC值 0x150。不变化，上报值跳动<br />2、因为温补为3度一个点，所引值跨度大，所引增加了两个温度点之间做平滑处理<br /><br />3、增加SF RSSI监控修正<br />4、修改TEC TEMP ,TEC 电流告警警告门限判断标志<br /><br />==============================<br />170407: V02<br /><br />1、增加了原始温度，CASE温度校准根据原始温度进行校准<br />2、修改查找表由 2度一个点，改为3度一个点<br />3、增加DAC值缓慢增加<br />4、增加上电后，TEC锁定前不发光，锁定后发光<br />5、增加 F4 TAB_B表（TECDAC 温补表，暂时未使用，赋定值，0x860）<br />6、增加F4 TAB_F表（DAC初始值配置和权重配置表）<br />7、解决上电浪涌问题，上电配置IO口时，8833EN脚和 APDEN 脚配置低电平，虽然外部加了下拉到地，但是实测，上电后不配置IO口还是为高电平<br />8、4834 DAC配置初始化时，需要先给DAC寄存器赋值后，再写配置寄存器，这时候就可以正常输出电压，如果先写配置寄存器再赋DAC值，会出现一段时间的零电平。<br />      这个时候回导致TEC电流过大，产生浪涌。<br />9、4834 MCU 上电时，在配置DAC之前默认有2.5V左右的电压<br />10、因为BIAS ADC ,TXPOWER ADC 已经超过量程，需要做假值，假值为AOP设置值为基础，在上报ibias，txpower实现跳动。<br />    因为可能会使用AOP温补偿表，温度会变就会导致监控值偏差很大<br /><br />==============================<br />170407: V01<br />验证了PID 算法，已经确认OK，并且实现了DCDC2 动态设置电压值<br /><br />==============================<br />SFP+_ZR_DS4834_GN2044  ', '[{\"ext\":\"rar\",\"savename\":\"FIRM_0016_V04.rar\",\"path\":\"./Uploads/Software/19/FIRM_0016_V04.rar\"}]', '1501033208', 'V0.4', '59', '[{\"name\":\"肖艾佑 \",\"id\":\"53\",\"email\":\"xiaoaiyou@atoptechnology.com\"},{\"name\":\"何志贤 \",\"id\":\"68\",\"email\":\"hezhixian@atoptechnology.com\"},{\"name\":\"李川 \",\"id\":\"101\",\"email\":\"lichuan@atoptechnology.com\"}]', '[{\"name\":\"李平 \",\"id\":\"30\",\"email\":\"liping@atoptechnology.com\"}]');
INSERT INTO `atop_software_log` VALUES ('39', '23', '170707:V03<br />是否加调制对光光率影响较大，现在需要判断GN2044txlol状态，通过改变EA值使光功率保持不变<br /><br />==============================<br />170707:V02<br />优化5V上电浪涌问题，在TEC PID算法的delta 做缓慢变化调整，浪涌抑制效果明显<br />==============================<br />170707:V01<br />修改了状态标志，增加DAC缓慢上电等', '[{\"ext\":\"rar\",\"savename\":\"FIRM_0661_V03.rar\",\"path\":\"./Uploads/Software/23/FIRM_0661_V03.rar\"}]', '1501033928', 'V0.3', '59', '[{\"name\":\"肖艾佑 \",\"id\":\"53\",\"email\":\"xiaoaiyou@atoptechnology.com\"},{\"name\":\"何志贤 \",\"id\":\"68\",\"email\":\"hezhixian@atoptechnology.com\"},{\"name\":\"李川 \",\"id\":\"101\",\"email\":\"lichuan@atoptechnology.com\"},{\"name\":\"何松文 \",\"id\":\"74\",\"email\":\"hesongwen@atoptechnology.com\"},{\"name\":\"李平 \",\"id\":\"30\",\"email\":\"liping@atoptechnology.com\"}]', '');
INSERT INTO `atop_software_log` VALUES ('40', '22', '1.上电时候的INT状态不对，经过检查发现是温度低的报警（最开始读取MCU温度的数据不正常）引起的，现在的解决方法是把最开始的读取10次的数据不去做判断，然后问题解决。', '[{\"ext\":\"zip\",\"savename\":\"FIRM_0670_V14.zip\",\"path\":\"./Uploads/Software/22/FIRM_0670_V14.zip\"}]', '1501036015', 'V1.4', '74', '[{\"name\":\"杨培云 \",\"id\":\"52\",\"email\":\"yangpeiyun@atoptechnology.com\"},{\"name\":\"罗洋 \",\"id\":\"81\",\"email\":\"luoyang@atoptechnology.com\"}]', '[{\"name\":\"马晓东 \",\"id\":\"59\",\"email\":\"maxiaodong@atoptechnology.com\"},{\"name\":\"李平 \",\"id\":\"30\",\"email\":\"liping@atoptechnology.com\"}]');
