INSERT INTO `atop_software_log` VALUES ('53', '4', '1，[LambdaTest] “发端常温测试”工序测试波长之前，先根据Manual DAC值自动初始化TEC LUT为一条直线，高低温测试如果不过，自动微调并拟合对应温度段LUT，配置方法示例“IsTune:1,TecStep:0005,TecMin:0500,TecMax:0B00,LUT:LINE3,LutMin:0600,LutMax:0A00,”。<br />2，[FiberTest] 增加新工序“长纤测试”，工序名“FIBER_TEST”，单独设置工序是避免SFP+ LR产品发端经过分光器、长纤和衰减器后衰减太大，导致无法设定到目标值；新工序使用GVPM锁定输出，不需要通过测试发端功率计算衰减。<br />3，[5vCurrentMonTest] 新测试项，测试5V电源的电流大小，针对XFP产品，和CurrentMonTest配置方法相同。<br />4，[ChecksumTest] 新测试项，检查A0[127]字节是否等于A0[96-126]的和，针对NOKIA产品定制。默认情况下只检查不修改，如果需要在错误的情况下修正，需要配置\"IsModify:1,\"。<br />5，[MaskMarginTest] 增加测试Margin真实值功能，需要配置“Mode:Real,”；如果需要测试门限，则配置“Mode:Threshold,”，默认测试门限。<br />6，[SensTune] 调试APD时是否需要检查BERT的LOS状态取决于数据库配置，\"CheckLos:1,\"代表要检查，\"CheckLos:0,\"代表不检查，默认不检查。<br />7，新增对台式功率计“GL-3B”的支持。', '[{\"ext\":\"rar\",\"savename\":\"ATOM_V4.7.2.0.rar\",\"path\":\"./Uploads/Software/4/ATOM_V4.7.2.0.rar\"}]', '1503558046', 'V4.7.2.0', '30', '[{\"name\":\"陈凯 \",\"id\":\"67\",\"email\":\"chenkai@atoptechnology.com\"},{\"name\":\"何志贤 \",\"id\":\"68\",\"email\":\"hezhixian@atoptechnology.com\"}]', '[{\"name\":\"李平 \",\"id\":\"30\",\"email\":\"liping@atoptechnology.com\"},{\"name\":\"陈朋 \",\"id\":\"87\",\"email\":\"chenpeng@atoptechnology.com\"},{\"name\":\"杨培云 \",\"id\":\"52\",\"email\":\"yangpeiyun@atoptechnology.com\"},{\"name\":\"肖艾佑 \",\"id\":\"53\",\"email\":\"xiaoaiyou@atoptechnology.com\"},{\"name\":\"丁征 \",\"id\":\"54\",\"email\":\"dingzheng@atoptechnology.com\"},{\"name\":\"夏小森 \",\"id\":\"56\",\"email\":\"xiaxiaosen@atoptechnology.com\"},{\"name\":\"余波 \",\"id\":\"57\",\"email\":\"yubo@atoptechnology.com\"}]');
