INSERT INTO `atop_software_log` VALUES ('56', '39', '1，新增登录界面，需要登录后才能使用软件；<br />2，新增监测所有模块的温度、电压、bias电流和发端功率功能，超出范围则告警，范围从数据库抓取，界面支持修改；<br />3，模块监控信息和告警信息存储到本地数据库中。', '[{\"ext\":\"zip\",\"savename\":\"BibMonitor_V1.2.0.0.zip\",\"path\":\"./Uploads/Software/39/BibMonitor_V1.2.0.0.zip\"}]', '1503909738', 'V1.2.0.0', '30', '[{\"name\":\"陈凯 \",\"id\":\"67\",\"email\":\"chenkai@atoptechnology.com\"},{\"name\":\"何志贤 \",\"id\":\"68\",\"email\":\"hezhixian@atoptechnology.com\"},{\"name\":\"夏小森 \",\"id\":\"56\",\"email\":\"xiaxiaosen@atoptechnology.com\"}]', '[{\"name\":\"杨培云 \",\"id\":\"52\",\"email\":\"yangpeiyun@atoptechnology.com\"},{\"name\":\"肖艾佑 \",\"id\":\"53\",\"email\":\"xiaoaiyou@atoptechnology.com\"},{\"name\":\"陈朋 \",\"id\":\"87\",\"email\":\"chenpeng@atoptechnology.com\"},{\"name\":\"李平 \",\"id\":\"30\",\"email\":\"liping@atoptechnology.com\"},{\"name\":\"丁征 \",\"id\":\"54\",\"email\":\"dingzheng@atoptechnology.com\"},{\"name\":\"余波 \",\"id\":\"57\",\"email\":\"yubo@atoptechnology.com\"}]');
INSERT INTO `atop_software_log` VALUES ('57', '14', '1、上电后模块发光不稳定，发光一段时间后出现光断掉，再正常发光情况：<br />   原因：是因为37030 APC设置时会有先把光断掉，再设置目标值，再发光的步骤，模块上电后进入轮询时就执行一次根据F4LOW的值设置目标值<br />   ，所以就出现了断光现象。<br />   处理方式：上电初始化37030寄存器时，在初始化APC目标值时，不用driver配置表中的值，用F4LOW 的APC目标值设置，并且在轮询时APC设置开关<br />   默认关闭，即模块上电到正常工作时不对APC进行更改，就不会出现断光现象。但是在调试过程中，写APC目标值时会有一次使能，所以在调试过程中，<br />   每次调APC目标值(即界面上的AOP SET)，都会出现一次光断掉再开启的现象。但不影响模块正常工作使用<br />2、写入MOD查找表，有异常值出现情况：<br />   因为在轮询中查找表，当从I2C在查找值结束到I2C 写入目标值之间有从I2C中断访问，就会出现异常值在界面上，但写入的值不会是该异常值。采用<br />   临时变量，在写driver之前把查找到的目标值给到F4LOW_MOD_SET 寄存器，这样就会避免实现读到的MOD SET值异常。', '[{\"ext\":\"zip\",\"savename\":\"FIRM_0710_V06.zip\",\"path\":\"./Uploads/Software/14/FIRM_0710_V06.zip\"}]', '1504763698', 'V0.6', '59', '[{\"name\":\"李平 \",\"id\":\"30\",\"email\":\"liping@atoptechnology.com\"},{\"name\":\"吕代兵 \",\"id\":\"104\",\"email\":\"lvdaibing@atoptechnology.com\"},{\"name\":\"陈实 \",\"id\":\"60\",\"email\":\"chenshi@atoptechnology.com\"},{\"name\":\"何松文 \",\"id\":\"74\",\"email\":\"hesongwen@atoptechnology.com\"}]', '');
INSERT INTO `atop_software_log` VALUES ('58', '40', '1. 调整后台界面（侧边栏、页头、滚动条、操作按钮等），通知栏及用户操作栏调整至右上角，用户栏集成修改资料/修改头像/退出登录， 后台首页界面更新，左侧菜单栏二级菜单切换为下拉展开式，首页栏目集成在logo上（返回首页可通过点击logo跳转）。 <br />2. 新版客诉上线，新版客诉将增加推送功能，提供每个步骤日志更新及回退、转交处理人等操作，旧版客诉将停止维护，如需更新则须通过销售转为新版方可操作。 <br />3. 未来样品管理功能将重构。', '', '1492704000', 'V2.4', '91', '', '');
INSERT INTO `atop_software_log` VALUES ('59', '40', '新版“客诉处理(RMA)上线<br/>1. 样品管理后台界面(详情页，总览页，首页，添加等)，功能：添加订单、进度流程、邮件推送，评审流程、订单搜索等。<br /><br />2. 软件发布后台界面(首页，发布页，详情页等)，首页类型分类，版本发布，邮件推送，添加软件等。<br /><br />3. 修改旧版客诉转为新版客诉的判断逻辑BUG，修改旧版客诉转新版客诉页面的样式，修改兼容表详情页样式，修改客诉筛选样式及静态资源层级，解决项目管理中关联样品bug及面板通用样式等。', '', '1496160000', 'V2.5', '91', '', '');
INSERT INTO `atop_software_log` VALUES ('60', '40', '1. 用户新增性别，软件发布修正，关闭审批功能，排除离职人员，删除审批文件<br />2. 修改项目管理上传文件，修复样品汇总bug。', '', '1498665600', 'V2.6', '91', '', '');
INSERT INTO `atop_software_log` VALUES ('61', '40', '1. 修复样品管理、软甲发布bug。<br />2. 文件管理后台页面(首页、文件详情、评审详情、评审步骤等)，添加文件，添加评审，评审流程及推送，申请文件编号，编辑文件，添加到评审，发起评审', '', '1500566400', 'V2.7', '91', '', '');
INSERT INTO `atop_software_log` VALUES ('62', '40', '1. 用户新增多职位<br />2. 新版文件管理上线，文件编辑功能转到文件详情页(增加编辑，评审，升版按钮)，发起评审自动生成ecn编号，评审人添加DCC评审，评审通过、拒绝以及发起人撤回，评审流程中邮件推送', '', '1502899200', 'V2.8', '91', '', '');
INSERT INTO `atop_software_log` VALUES ('63', '40', '1. ECN独立，新版文件管理上线。新版文件管理发起评审(申请ecn号，申请文件号)。<br /><br />2. 项目管理讨论区新增回复功能(回复楼层层主会抄送给所有参与项目的人)，项目计划修改、进度选择、新增状态，延期邮件提醒（每天定时通知延期的项目）。<br /><br />3. 服务器上旧版文件评审已存在的数据跟新到新版文件评审，OA系统增加了版本功能(software)，首页将展示最近期更新的版本信息以及更新的具体内容。<br /> <br />4. 修改用户页面提示样式，邮件格式。', '', '1505404800', 'V2.9', '91', '', '');
INSERT INTO `atop_software_log` VALUES ('64', '4', '1，[TecCheck] 修复\"From:DDM\"配置不生效的问题。<br />2，[LambdaTest] 高低温补偿了LUT后，先保存FLASH再读取波长，避免DS4834 LUT不生效的问题。<br />3，[SDHTest] GVPM使用闭环方式，避免由于自发自收时光源功率变化导致收端功率不一致的问题。<br />4，修复WIN7系统编译后在XP系统下无法连接数据库的问题（msado15.dll采用XP的2.81.3012.0，放到目标文件夹下）。<br />5，新增对100G BERT GL100G的支持。<br />6，新增对示波器Tek CSA8200的支持。', '[{\"ext\":\"zip\",\"savename\":\"ATOM_V4.7.2.3.zip\",\"path\":\"./Uploads/Software/4/ATOM_V4.7.2.3.zip\"}]', '1505718122', 'V4.7.2.3', '30', '[{\"name\":\"陈凯 \",\"id\":\"67\",\"email\":\"chenkai@atoptechnology.com\"},{\"name\":\"何志贤 \",\"id\":\"68\",\"email\":\"hezhixian@atoptechnology.com\"}]', '[{\"name\":\"李平 \",\"id\":\"30\",\"email\":\"liping@atoptechnology.com\"},{\"name\":\"陈朋 \",\"id\":\"87\",\"email\":\"chenpeng@atoptechnology.com\"},{\"name\":\"杨培云 \",\"id\":\"52\",\"email\":\"yangpeiyun@atoptechnology.com\"},{\"name\":\"肖艾佑 \",\"id\":\"53\",\"email\":\"xiaoaiyou@atoptechnology.com\"},{\"name\":\"丁征 \",\"id\":\"54\",\"email\":\"dingzheng@atoptechnology.com\"},{\"name\":\"夏小森 \",\"id\":\"56\",\"email\":\"xiaxiaosen@atoptechnology.com\"},{\"name\":\"余波 \",\"id\":\"57\",\"email\":\"yubo@atoptechnology.com\"}]');
